INSERT INTO `events` (`id`,`title`,`description`,`text`,`thumbnail`,`created_at`,`updated_at`,`sponsor_id`,`price`,`image_url`,`web`,`duration`,`category_id`) VALUES 
 (2323,'La Sombra del Poder','','El apuesto e imperturbable congresista Stephen Collins, Ben Affleck , representa el futuro de su partido: debido a su honradez, ha sido elegido presidente del comité que supervisa los gastos de Defensa. Todos esperan que esta estrella en auge represente a su partido en la próxima carrera hacia la presidencia. Hasta que alguien asesina brutalmente a su ayudante/amante y los secretos se escapan de su escondite. Cal McCaffrey, Russell Crowe , un periodista de Washington DC, cuyo olfato le lleva a desenmarañar los misteriosos asesinatos de algunas de las figuras más prometedoras de la política y de la gran empresa, tiene la dudosa fortuna de ser un viejo amigo de Collins y de que su jefa, Helen Mirren , sea totalmente despiadada y le mande a investigar el caso. Mientras sigue la pista del asesino con la ayuda de su compañera Della Rachel McAdams , descubre una tapadera que amenaza con hacer temblar las estructuras del poder de la nación. En una ciudad de relaciones públicas, asesores y ricos políticos, aprenderá una verdad innegable: cuando miles de millones están en juego, la integridad, el amor y la vida de cualquiera están en peligro.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/953.jpg',NULL,127,2),
 (2324,'Transformers: La Venganza de los Caídos','','Comienza la batalla por el Universo. Al regresar a Cybertron, Starscream toma el liderazgo de los Decepticons, y decide regresar a la tierra. Los Autobots, creyendo que la paz es posible, descubren que el cuerpo sin vida de Megatron ha sido robado del Ejército de los Estados Unidos por Skorpinox quien lo devuelve a la vida. Ahora Megatron regresa en busca de venganza.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/835.jpg','http://Transformersmovie.com',147,2),
 (2325,'Adventureland: Un Verano Memorable','','Un joven recién graduado de la universidad se verá forzado a aceptar un trabajo en un parque de atracciones local. Si bien el trabajo no podía ser peor, fue la mejor época de su vida.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/1043.jpg',NULL,97,2),
 (2326,'17 Otra Vez','','Mike O\'Donnell (Zac Efron) es el chico más popular de su instituto. Tiene novia encantadora, Scarlett (Allison Miller), con la que piensa casarse en cuanto pueda, y es una estrella en las competiciones deportivas. \r\nVeinte años después, Mike (Matthew Perry) se da cuenta de que su vida no ha transcurrido tal como tenía previsto. Su matrimonio con Scarlett (Leslie Mann) ha terminado en divorcio, debe conformarse con vivir junto a su amigo Ned Freedman (Thomas Lennon), su trabajo en una compañía farmacéutica le aburre, y su relación con sus hijos adolescentes es prácticamente nula.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/2074.jpg','http://17Againmovie.com',110,2),
 (2327,'Código de Familia','','Es la historia de una multi-generacional familia de policías cuyo código moral se pone a prueba cuando uno de los hijos en la fuerza investiga un caso que involucra a su hermano y cuñado. De pronto, se verá obligado a escoger entre ser leal a la familia o al Departamento.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/789.jpg',NULL,125,2),
 (2328,'Synecdoche, New York','','Caden Cotard, un director teatral intenta representar una obra creando una réplica de Nueva York a tamaño natural dentro de un almacén.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/2091.jpg','http://SonyClassics.com/SynecdocheNY',124,2),
 (2329,'Tierra','','Este documental cuenta la maravillosa historia de tres familias de animales y su asombroso viaje a través del planeta al que llamamos hogar. Es una combinación de acción, con locaciones inimaginables que permiten capturar los más íntimos momentos de las criaturas más salvajes y evasivas de nuestro planeta.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/1836.jpg','http://Disney.com/Nature',90,2),
 (2330,'Ángeles y Demonios','','El profesor de simbología religiosa Robert Langdon se ve pronto sumido en la búsqueda de secretos de una antigua secta satánica denominada Illuminati y por la búsqueda del arma más mortífera de la humanidad (antimateria) que estos han puesto en el Vaticano. Con unas pocas horas para evitar el desastre, unos misteriosos ambigramas y con un asesino que siempre lleva la delantera, Langdon y una científica italiana se ponen en una carrera contra el reloj. \r\nTom Hanks vuelve a interpretar el profesor Langdon en la adaptación del segundo best-seller más conocido de Dan Brown.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/832.jpg',NULL,138,2),
 (2331,'Duplicidad','','Claire Stenwick, ex agente de la CIA, y Ray Koval, ex agente del MI6, han abandonado el mundo del espionaje nacional para aprovecharse de la lucrativa guerra fría existente entre dos multinacionales rivales. ¿Su misión? Conseguir la formula para un producto que hará ganar una auténtica fortuna a la empresa que la tenga primero.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/802.jpg','http://Duplicitymovie.net',NULL,2),
 (2332,'Toda La Gente Sola','','Cuenta la historia de seis personajes en busca de la felicidad.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/2361.jpg',NULL,NULL,2),
 (2333,'Jonas Brothers','','Los Jonas Brothers, uno de los grupos adolescentes con más éxito y talento de la actualidad, ya tienen su propia película. En ella, sus fans podrán disfrutar de su música como si realmente estuvieran en un concierto, gracias a la magia de las tres dimensiones. Además, se incluye material documental para saber cómo son Kevin, Joe y Nick detrás de las cámaras.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/2058.jpg','http://www.jonasbrothers.com',76,2),
 (2334,'Les Temoins','','Esta historia se refiere a la superposición de historias de un grupo de jóvenes franceses parisinos que descubren la realidad de la epidemia del SIDA a través de sus complejas relaciones con un hombre joven; Manu.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/366.jpg',NULL,112,2),
 (2335,'Resistencia','','Basada en hechos reales. Año 1941, tres hermanos  logran escapar de una muerte segura y se refugian en los densos bosques de alrededor de su casa, que conocen desde su infancia. Allí inician su desesperada lucha contra los nazis. Convertirán la lucha por la supervivencia en algo mucho más importante, una forma de vengar las muertes de sus seres queridos al salvar a miles de personas. Al principio es cuanto pueden hacer para sobrevivir pero, poco a poco, a medida que se extienden los rumores sobre su coraje, empiezan a atraer a otros hombres y mujeres, jóvenes y ancianos, dispuestos a arriesgarlo todo por un instante de libertad.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/1036.jpg',NULL,137,2),
 (2336,'Una Noche en el Museo 2','','Larry enfrenta una batalla tan épica, que sólo podría llevarse a cabo en los pasillos del museo más grande del mundo. Ahora, Larry deberá intentar salvar a sus ex amigos inanimados de lo que podría ser su última batalla entre las maravillas del Smithsonian, las cuales, desde las famosas pinturas en las paredes hasta las naves espaciales en los vestíbulos, de repente tienen mente propia.',NULL,'2009-06-05 14:42:24','2009-06-05 14:42:24',2,NULL,'http://img.cinemaki.com/m/240/1943.jpg','http://NightattheMuseummovie.com',103,2),
 (2337,'Zack & Miri Make a Porno','','Zack y Miri son dos amigos que se conocieron en el instituto y a los que les cuesta afrontar la edad adulta, a sus veintimuchos años, se ven inmersos en deudas. Para hacer dinero rápido deciden armar una empresa para grabar pornos amateur con sus amigos. Mientras ruedan las películas, descubrirán que sentían algo más que la platónica amistad que los había unido hasta ahora.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/1285.jpg',NULL,102,2),
 (2338,'Una Semana Solos','','La película fue supervisada por el norteamericano Martin Scorsese dentro de la Iniciativa Artística Rolex para Mentores & Protegidos.\r\nAdolescentes y niños a la deriva en el territorio delimitado de un country, una ciudadela modelo que supuestamente los contiene: casas con parque, escuela, salón de fiestas, pileta. Del ocio al tedio ida y vuelta, sin padres ni madres cerca, los niños huérfanos por una semana circulan para crear un régimen propio de descontrol en la comodidad de una prisión aceptada: nadie ni siquiera intenta huir de ahí. En ese estado cotidiano de conformidad se suma un extraño, el de afuera que irrumpe, pero ni siquiera en ese punto surge el conflicto tradicional, si no que todo se disuelve en un juego intermitente de crueldad y ternura. La idea es recuperar la densidad de cada gesto con una mirada frontal y seca. Un retrato coral, encarnado por un grupo de niños, con su vértice máximo en un brote musical, que concentra una gama amplia de sentidos y sensaciones. Esta es la crónica de esos días, entre la cotidianeidad inocente propia de la infancia y la ferocidad incipiente que surge del encierro.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/2268.jpg',NULL,110,2),
 (2339,'Nueva en la Ciudad','','Lucy Hill es una ambiciosa y en pleno ascenso ejecutiva en Miami. Ama sus zapatos, sus autos y ascender en su carrera corporativa. Cuando se le ofrece un trabajo temporal para la reestructuración de una fábrica, en medio de la nada, se lanza sobre la oportunidad sabiendo que un nuevo ascenso está a la mano. Lo que empieza como una simple asignación de empleo, se convierte en una experiencia de cambio de vida para Lucy, quien descubre un mayor significado en su vida y más inesperadamente, al hombre de sus sueños.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/1198.jpg','http://www.newintownmovie.com/',97,2),
 (2340,'Visita Inesperada','','Walter Vale (Richard Jenkins), un profesor universitario de Connecticut que viaja a Nueva York, se ve envuelto en la vida de una joven pareja inmigrante que descubre viviendo en su apartamento de Manhattan, un piso que apenas visita. Tarek (Haaz Sleiman), un músico Sirio, y Zainab (Danai Gurira), su novia senegalesa, viven allí porque alguien les ha alquilado el apartamento, haciéndose pasar por el dueño.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/1992.jpg',NULL,104,2),
 (2341,'La Profecía del No Nacido','','Casey Bell odiaba a su madre por haberla abandonado de niña, pero cuando cosas inexplicables comienzan a ocurrir, Casey comprende el motivo por el cual la dejó. Plagada de sueños sin piedad y un fantasma que la acecha en sus horas de vigilia, decide recurrir a Sondak, el único asesor espiritual que puede detenerlo.\r\nCon la ayuda de Sendak, Casey descubre que el origen de una maldición familiar se remonta a la Alemania nazi, una criatura con la capacidad de habitar cualquiera o cualquier cosa que se está haciendo más fuerte con cada posesión. Con la maldición desatada, su única oportunidad de sobrevivir es cerrar una puerta más allá de nuestro mundo que se ha abierto por alguien que nunca nació.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/797.jpg','http://www.theunbornmovie.net/',94,2),
 (2342,'Haroldo Conti, Homo viator','','La película cuenta la vida del escritor Haroldo Conti, sus ideas acerca de la política y de la sociedad y su inmensa pasión por su Chacabuco natal.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/3329.jpg',NULL,90,2),
 (2343,'La Montaña Embrujada','','Historia de dos niños adoptados por la familia Mallone, Tony y su hermana Lea, quienes tienen poderes mágicos: predicen todo lo que va a pasar. Un magnate de la industria quiere hacerse con los hermanos, pues confia en que sean para él el mejor soporte de sus negocios. Sin embargo, el objetivo de los dos niños es una montaña, la montaña embrujada, a la que se dirigen con un secreto.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/948.jpg','http://disney.go.com/disneypictures/racetowitchmountain/',NULL,2),
 (2344,'Terminator: La Salvación','','Año 2018. John Connor (Christian Bale) es el hombre destinado a liderar la resistencia humana contra Skynet y su ejército de Terminators. Pero la creencia en el futuro que tiene Connor, se ve alterada, en parte por la aparición de Marcus Wright (Sam Worthington), un extraño cuya última memoria es de estar en el corredor de la muerte. Connor debe decidir si Marcus ha sido enviado desde el futuro, o rescatado del pasado. Como Skynet prepara su arremetida final, Connor y Marcus se embarcan en una odisea que los llevará al corazón de las operaciones de Skynet, donde descubren el terrible secreto detrás de la posible aniquilación de la humanidad.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/1201.jpg','http://www.terminatorsalvation.com/',130,2),
 (2345,'Tu Última Oportunidad','','Un hombre (Dustin Hoffman) y una mujer (Emma Thompson) se encuentran de manera fortuita en la Londres y, desde entonces, sus vidas se transforman drásticamente.\r\nÉl es un neoyorquino que malvive con los ingresos que le genera su trabajo como creador de eslóganes publicitarios. Su rutina termina cuando la conoce a ella en la boda de su hija.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/1896.jpg','http://LastChanceHarvey.com',92,2),
 (2346,'La Felicidad Trae Suerte','','Poppy (Sally Hawins) es una joven profesora de primaria divertida, abierta y generosa, inmune a la amargura. Es un espíritu libre que se toma la vida tal y como viene, pero siempre con actitud positiva. Cuando le roban la bici, decide que es el momento de sacarse el carnet de conducir. Su profesor de autoescuela es Scott (Eddie Marsan), un tipo amargado y poco simpático. A medida que se conozcan, Poppy acabará enseñándole al instructor más de lo que él puede enseñarle a ella.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/2208.jpg','http://www.happy-go-lucky-movie.co.uk',118,2),
 (2347,'Up','','Podrá verse en 3D en los cines digitales. Carl Fredricksen, un vendedor de globos de 78 años, finamente consigue llevar a cabo el sueño de su vida al enganchar miles de globos a su casa y salir volando rumbo a América del Sur. Pero descubre demasiado tarde que la mayor de sus pesadillas se ha embarcado también en el viaje: un Explorador de la Jungla llamado Russell, que tiene 8 años y un optimismo a prueba de bombas.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/2307.jpg','http://Disney.com/Up',106,2),
 (2348,'Bellamy','','Adaptación de \"Menno\'s Granddaughter\", una novela del escritor norteamericano Roy Parvin. Lisa, la primera mujer de un escritor fallecido recientemente, es conducida por los avatares del azar hasta la ciudad donde éste había huido años antes. Perdida en un lugar donde no conoce a nadie, contacta con la segunda mujer de su exmarido. En esta trama entra en acción un policía cuya jubilación está próxima (Depardieu) y que está investigando a una poderosa familia mafiosa.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/2269.jpg',NULL,110,2),
 (2349,'Star Trek XI','','Podremos ver el inicio de la amistad del capitán Kirk y Spock en la academia Starfleet, y la primera misión de ambos.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/2136.jpg','http://StarTrekmovie.com',120,2),
 (2350,'Che, Guerrilla','','La película arranca con el Che en lo más alto de su popularidad y poder tras la Revolución Cubana, cuando pronuncia un vehemente discurso en las Naciones Unidas, reafirmando su compromiso con la lucha del Tercer Mundo contra el imperialismo de los EE.UU. De repente desaparece, reapareciendo de incógnita en Bolivia.',NULL,'2009-06-05 14:42:25','2009-06-05 14:42:25',2,NULL,'http://img.cinemaki.com/m/240/1247.jpg',NULL,131,2),
 (2351,'El Lector','','Cuando cae enfermo en su camino a casa desde el colegio, Michael Berg (David Kross) un joven de 15 años, es rescatado por Hanna (Kate Winslet), una mujer que le dobla la edad. Ambos comienzan un inesperado y apasionado idilio hasta que Hanna desaparece inesperadamente.\r\nOcho años después, Michael, convertido en un joven estudiante de derecho vuelve a encontrarse con su antigua amante mientras está como observador en un tribunal donde se está juzgando a colaboradores de la Alemania Nazi. Hanna está acusada de un horrible crimen y rechaza defenderse a sí misma. Michael, gradualmente, se va dando cuenta de que el amor de su juventud guarda un secreto que considera aún más vergonzoso que el asesinato.',NULL,'2009-06-05 14:42:26','2009-06-05 14:42:26',2,NULL,'http://img.cinemaki.com/m/240/1287.jpg',NULL,123,2),
 (2352,'Felicitas','','La película recreará el célebre drama romántico de Felicitas Guerrero, una joven de la alta sociedad porteña del siglo XIX que fue obligada a casarse con un hombre mucho mayor, aunque estaba enamorada de otro pretendiente, quien finalmente la asesinaría, desesperado por no poder tenerla.',NULL,'2009-06-05 14:42:26','2009-06-05 14:42:26',2,NULL,'http://img.cinemaki.com/m/240/2571.jpg',NULL,NULL,2),
 (2353,'Los Fantasmas de mi Ex','','Un mujeriego incorregible recibe la visita del fantasma de todas las novias que tuvo en el pasado, presente y también las futuras. Pronto comprenderá que en realidad está enamorado de la chica que le rompió el corazón en su infancia.',NULL,'2009-06-05 14:42:26','2009-06-05 14:42:26',2,NULL,'http://img.cinemaki.com/m/240/1897.jpg',NULL,100,2),
 (2354,'Big Bang Love','','Jun, un joven introvertido que ha asesinado al cliente de un bar y Shiro, quien ha conocido la violencia desde su más tierna infancia están encerrados en la misma prisión. Pese a sus aparentes diferencias, establecerán una estrecha relación que se verá interrumpida por un misterioso crimen.',NULL,'2009-06-05 14:42:26','2009-06-05 14:42:26',2,NULL,'http://img.cinemaki.com/m/240/3304.jpg',NULL,85,2),
 (2355,'X-Men Origins: Wolverine','','X-Men Origins: Wolverine cuenta el violento y romántico pasado de Wolverine, su compleja relación con Victor Creed y el ominoso programa Arma X. A lo largo del camino, Wolverine se encuentra muchos mutantes, tanto conocidos como nuevos, incluyendo apariciones sorpresa de varias leyendas de otros X-Men.',NULL,'2009-06-05 14:42:26','2009-06-05 14:42:26',2,NULL,'http://img.cinemaki.com/m/240/830.jpg',NULL,107,2),
 (2356,'Frost / Nixon','','En la película Frost / Nixon, el director Ron Howard lleva a la pantalla grande la obra de teatro de Peter Morgan, mostrando la electrizante batalla entre Richard Nixon, el presidente deshonrado con un legado para guardar, y David Frost, un periodista con toda su carrera por delante. Las entrevistas son entorno al escándalo de WaterGate y en una de ellas, Nixon reconoce su cunpabilidad.',NULL,'2009-06-05 14:42:26','2009-06-05 14:42:26',2,NULL,'http://img.cinemaki.com/m/240/1195.jpg','http://www.frostnixon.net/',122,2),
 (2357,'Monsters vs. Aliens','','Cuando un meteorito golpea a una joven mujer llamada Susan Murphy y la convierte en un mounstro gigante, es llevado a un refugio secreto del gobierno donde se encuentra con otros mounstros que fueron reclutados a lo largo de los años. \r\nAl poco tiempo, un misterioso robot Alien aterriza en la Tierra y comienza a atormentar a la población. Como último recurso para salvar al país, la tripulación de mounstros es llamada a la acción bajo la dirección del General WR Monger tras un pedido de la Presidenta, para salvar al mundo de una inminente destrucción.',NULL,'2009-06-05 14:42:26','2009-06-05 14:42:26',2,NULL,'http://img.cinemaki.com/m/240/868.jpg','http://MonstersvsAliens.com',NULL,2),
 (2358,'Rápido y Furioso 4','','Vin Diesel y Paul Walker vuelven a juntarse para concretar la última edición de esta serie. \r\nCuando un delito los trae nuevamente a Los Angeles, Brian y Dom deben enfrentar a un enemigo en común. Dom volverá a poner a prueba su confianza en Brian para tratar de derrotarlo. Ellos encuentran la mejor manera de buscar la venganza, pasando cualquier límite sobre las ruedas de sus autos.',NULL,'2009-06-05 14:42:26','2009-06-05 14:42:26',2,NULL,'http://img.cinemaki.com/m/240/1330.jpg','http://www.fastandfuriousmovie.net/',106,2),
 (2359,'Hannah Montana 3D en Concierto','','Miley Stewart (Miley Cyrus) se las arregla como puede para compaginar el colegio, sus amigos y su vida secreta como estrella del pop; pero su enorme popularidad amenaza con invadir toda su vida y ella parece aceptarlo. Así que su padre decide llevarla a Crowley Corners, en Tennessee, para darle una dosis de realidad. Allí comienza una aventura llena de diversión, risas y romance que ni la propia Hannah Montana podría imaginar.',NULL,'2009-06-05 14:42:26','2009-06-05 14:42:26',2,NULL,'http://img.cinemaki.com/m/240/1883.jpg',NULL,102,2),
 (2360,'Gomorra','','Poder, dinero y sangre: estos son los valores a los que los residentes de la provincia de Nápoles y Caserta tienen que enfrentarse cada día. Casi nunca tienen la posibilidad de elegir, y casi siempre están obligados a obedecer las reglas del \"sistema\" de la Camorra. Sólo un pocos afortunados pueden llegar a pensar en llevar una vida normal.',NULL,'2009-06-05 14:42:26','2009-06-05 14:42:26',2,NULL,'http://img.cinemaki.com/m/240/916.jpg',NULL,137,2),
 (2361,'Cuenta Regresiva','','Nicholas Cage interpreta a un maestro que abre una cápsula del tiempo enterrada en el colegio de su hijo, donde encontrará escalofriantes predicciones: algunas que ya se cumplieron, y otras aún no.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/866.jpg',NULL,NULL,2),
 (2362,'Esperando la Carroza 2','','En este nuevo envío, Antonio Musicardi (Luis Brandoni) y su esposa Nora (Betiana Blum) festejan, en su nueva mansión, su aniversario de casados. Allí estarán presentes las figuras más destacadas de la escena porteña, entre políticos, sindicalistas, periodistas y deportistas, quienes se entremezclarán con los miembros de la familia en situaciones divertidas y bizarras. Además, Antonio deberá soportar las continuas acusaciones sobre el funcionamiento irregular de su frigorífico.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/1827.jpg',NULL,NULL,2),
 (2363,'Dinosaurios, Gigantes de la Patagonia 3D','','Los dinosaurios están entre los animales más fascinantes que caminaron sobre la tierra. Cautivan por su enorme tamaño y por el hecho de que desaparecieron hace millones de años. Dinosaurios 3D llevarán a los espectadores a traves de un recorrido sin precedentes y único en 3D conociendo a los Dinosaurios más grandes del mundo, los cuales habitaron nuestra Patagonia Argentina. Esta película fue hecha con la colaboración cercana de importantes científicos del paleontólogos. La película tendrá escenas nunca antes vistas, generadas por computadoras, como por ejemplo del Giganotosaurus y del Argentinosaurus para nombrar algunos, mezclandose con imágenes verdaderas de la Patagonia',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/152.jpg',NULL,40,2),
 (2364,'Fuera de Menú','','Maxi cree que su vida es perfecta: es un cocinero prestigioso, propietario de un restaurante muy popular en Chueca y vive su homosexualidad sin complejos. Sin embargo, la aparición de sus hijos, fruto de un matrimonio de escaparate, y de su nuevo vecino, un atractivo ex futbolista argentino, dinamitarán su vida y le harán replantearse su escala de valores.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/2760.jpg',NULL,111,2),
 (2365,'La Sangre Brota','','Arturo, un parsimonioso taxista de sesenta años, tiene que conseguir mil dólares en menos de 24 horas. Su hijo mayor, Ramiro, que se fugó de casa hace tres años, acaba de llamar desde Amsterdam pidiéndole ayuda urgente. Ese mismo día, Leandro, el hijo menor que aún vive con él, planea robarle sus ahorros, comprar una partida de drogas y huir a la costa para venderla en los boliches. Cuando el destino los enfrente, Arturo se transformará de nuevo en aquel hombre que obligó a Ramiro a fugarse tres años atrás.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/2116.jpg',NULL,NULL,2),
 (2366,'Rumba','','Fiona y Dom, maestros rurales, comparten la misma pasión por el baile latino. Todos los fines de semana participan en algún concurso regional. Tienen la casa repleta de trofeos.\r\nUna noche, al volver a casa en coche de uno de esos concursos, se estrellan contra un muro al evitar atropellar a una persona que se les cruza por delante. Sus vidas dan un tremendo vuelco…',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/1831.jpg',NULL,77,2),
 (2367,'Simplemente No Te Quiere','','Basado en el popular bestseller de los escritores de \"Sex and the City\" Greg Behrendt y Liz Tuccillo, Simplemente No Te Quiere cuenta las historias de un grupo de jóvenes entre veinte y treinta años que viven en Baltimore, algunos solteros, otros casados, y que intentan entender al sexo opuesto... esperando ser la excepción que confirma la regla.\r\nLa película cuenta con un elenco destacado, entre ellos el ganador del Oscar Ben Affleck como Neil; Jennifer Aniston como Beth; Drew Barrymore como Mary; la ganadora del Oscar Jennifer Connelly como Janine; Kevin Connolly como Conor; Bradley Cooper como Ben; Ginnifer Goodwin como Gigi; Scarlett Johansson como Anna; Kris Kristofferson como Ken y Justin Long como Alex.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/828.jpg',NULL,NULL,2),
 (2368,'Días de Mayo','','Una historia que transcurre en el llamado “Rosariazo” sucedido en Mayo de 1969.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/2716.jpg',NULL,NULL,2),
 (2369,'Mil Años de Oración','','Basada en la novela de Yiyun Li.\r\nEl Sr. Shi es un viudo jubilado de Pekín. Cuando Yilan, su única hija que vive en Estados Unidos se divorcia, decide visitarla en la pequeña ciudad en la que trabaja como bibliotecaria. Su intención es estar con ella hasta que se recupere del trauma. El Sr. Shi se aventura en la ciudad y conoce a Madam, una señora mayor que huyó de la Revolución Iraní.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/2717.jpg',NULL,83,2),
 (2370,'Al Otro Lado','','A través de una serie de encuentros, relaciones e incluso muertes, las frágiles vidas de seis personas se cruzan durante sus viajes emocionales hacia el perdón y la reconciliación en Alemania y Turquía.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/1907.jpg',NULL,122,2),
 (2371,'Slumdog Millionaire  ¿Quién quiere ser millonario?','','Basada en la historia real de un chico pobre de Bombay, Jamal Malik (Dev Patel), que se hace rico en la versión hindú del programa de\r\ntelevisión ¿Quieres ser millonario?.\r\nJamal acude al concurso para impresionar a su amiga Latika (Freida Pinto) de la que está enamorado. Después de la penúltima emisión del\r\nprograma, el moderador Prem Kumar (Anil Kapoor) hace que Jamal sea detenido por la policía porque, según él, estaba haciendo trampa. Su\r\njustificación: ¿cómo un joven de tan sólo 18 años de edad y proveniente de una miserable barriada podría saber las respuestas a las\r\npreguntas?\r\nNo fue sino después de unos cuantos golpes y ciertas descargas eléctricas que Jamal relataría las aventuras y desventuras de su infancia\r\ncomo huérfano junto a su hermano Salim, llena de incertidumbre, violencia, traición, amor y desamor, en los basureros de Mumbai y como\r\ncada circunstancia vivida encerraba en sí tanta sabiduría.\r\nDanny Doyle dirige junto a Loveleen Tandan este drama moderno lleno de mucha acción, pasión, originalidad y frescura que te mantiene\r\natento y entretenido durante las casi dos horas de duración y que nos expone una realidad social diferente a la que estamos\r\nacostumbrados a ver en Occidente. Y que, pese a todo, la esperanza y el amor encuentran también su lugar.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/1665.jpg',NULL,120,2),
 (2372,'Los 100 Días que No Conmovieron al Mundo','','Documental acerca de la labor de la jueza argentina Inés Weinberg de Roca, integrante del Tribunal Criminal Internacional por Ruanda que tiene la tarea de juzgar los crímenes de guerra del genocidio ruandés ocurrido en 1994, donde fueron asesinadas casi un millón de personas en poco más de 90 días.\r\nEl equipo documental formó parte del convoy ONU por el interior del África. Fueron tomados registros del funcionamiento del Tribunal Penal Internacional por Ruanda en Arusha y Kigali y se recorrieron los memoriales de Kigali y Nyamata. También fueron obtenidos registros de la visita a la Corte Penal Internacional y al Tribunal Penal Internacional para la ex Yugoslavia en La Haya.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/2822.jpg',NULL,57,2),
 (2373,'Vicky Cristina Barcelona','','La película, rodada en el pasado verano boreal en locaciones de Barcelona y Asturias, trata sobre el viaje de dos turistas norteamericanas (interpretadas por Scarlett Johansson y Rebecca Hall) que en su visita a España ven como su mundo comienza a desintegrarse de manera compleja.\r\nEl encuentro con un pintor español desinhibido (Javier Bardem) y las proposiciones de éste,finalmente aceptadas por las turistas, se convierten en el detonante de una historia que tiene otro vértice: la aparición de la ex mujer del pintor (Penélope Cruz) en sus vidas.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/627.jpg','http://www.vickycristinabarcelonalapelicula.es/',96,2),
 (2374,'Un Abogado Enjaulado','','Un hombre se muere de miedo por ir a la cárcel por culpa de un delito fiscal. Entonces, tratará de aprender una misteriosa arte marcial gracias a un maestro que le instruirá para poder defenderse de sus nuevos “compañeros”.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/1925.jpg',NULL,105,2),
 (2375,'Cuando Todo Cambia','','Muestra la historia de una profesora de Nueva York que sufre la crisis de la mediana edad, cuando su marido la abandona, su madre adoptiva muere y su madre biológica, una mujer excéntrica que trabaja en un \"talk show \" comienza a vivir su vida al revés. El único consuelo lo encuentra en el padre de uno de sus alumnos.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/680.jpg',NULL,100,2),
 (2376,'Marido por Accidente','','Emma Lloyd (Uma Thurman) es una exitosa periodista que ha triunfado gracias a su sensibilidad, madurez y gran conocimiento acerca de las relaciones amorosas. Tiene un programa de radio puntero, un contrato millonario para escribir un libro y una sólida relación amorosa con su novio, Richard (Colin Firth). A poco tiempo de formalizar su relación, Emma descubre por casualidad que en realidad ya está casada con un hombre al que ni siquiera conoce, por lo que decide encontrarlo y conseguir así la nulidad matrimonial. Patrick (Jeffrey Dean Morgan), un encantador y atractivo bombero resulta ser su accidental marido. Pero, una vez se conocen, Emma comienza a admirar la pasión por la vida de este peculiar bombero y su enorme espontaneidad en contraste con la cómoda y segura vida que le ofrece Richard.',NULL,'2009-06-05 14:42:27','2009-06-05 14:42:27',2,NULL,'http://img.cinemaki.com/m/240/1917.jpg','http://TheAccidentalHusbandmovie.com',90,2),
 (2377,'El Artista','','Jorge es un enfermero que trabaja en un geriátrico. Su monótona vida se ve modificada por una peculiar asociación con uno de sus pacientes, un anciano a quien dedica especial atención. Gracias a este encuentro, Jorge se introduce en el mundo del arte contemporáneo y pasa del entorno del geriátrico a frecuentar curadores, críticos, galeristas, coleccionistas y admiradores. Realiza exitosas exposiciones, gana dinero y prestigio artístico. Pero a medida que Jorge crece como artista, se multiplican las discordancias y contradicciones.',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/2743.jpg',NULL,100,2),
 (2378,'Belle Toujours','','Después de 38 años de \"Belle de Jour\", dos personajes de la película vuelven a cruzarse con el misterio de un secreto que sólo conoce el personaje masculino y cuya revelación es imprescindible para el personaje femenino.',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/2515.jpg',NULL,70,2),
 (2379,'Entre Los Muros','','François es un joven profesor de lengua francesa en un instituto difícil, situado en un barrio conflictivo, el aprendizaje de la democracia puede implicar auténticos riesgos. Llenos de buenas intenciones, deseosos de aportar la mejor educación a sus alumnos, los profesores  se arman contra el desaliento. Pero las culturas y las actitudes se enfrentan en el aula, microcosmos de la Francia contemporánea. Por muy divertidos y estimulantes que sean los adolescentes, sus comportamientos pueden cortar de raíz el entusiasmo de un profesor que no cobra bastante. La tremenda franqueza de François sorprende a sus alumnos, pero su estricto sentido de la ética se tambalea cuando los jóvenes empiezan a no aceptar sus métodos.',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/2157.jpg',NULL,128,2),
 (2380,'Jardines en Otoño','','Vincent es un ministro del gobierno, de mediana edad, buen bebedor, aficionado a la buena mesa y con una hermosa amante. Presionado por manifestaciones populares en su contra, pierde su cargo, y ella lo abandona.\r\nEs entonces cuando Vincent recomienza su vida. Poco a poco, regresa a ambientes que había olvidado, redescubre simples pasatiempos, y finalmente logra reencontrarse con los amigos que dejó por largo tiempo',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/2742.jpg',NULL,115,2),
 (2381,'El Silencio de Lorna','','Lorna, una joven albanesa residente en Bélgica aspira a comprar un bar con su novio Sokol, para ello se asocia con Fabio, un mafioso que ha organizado un matrimonio de conveniencia entre Claudy y ella para que así pueda obtener la nacionalidad. Según el plan de éste, Lorna debería casarse más tarde con un delincuente ruso que también pretende adquirir la nacionalidad belga, pero para que este segundo matrimonio sea posible, Fabio planea asesinar a Claudy. ¿Permanecerá Lorna en silencio?',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/905.jpg',NULL,105,2),
 (2382,'La Muerte en Vivo','','La película muestra el reality show de tv más audaz nunca antes visto. El espectáculo es la ruleta rusa, con armas de fuego y concursantes que compiten por 5 millones de dólares al aire.',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/709.jpg',NULL,96,2),
 (2383,'Por Fin Viuda','','Anne-Marie vive en un mar de indecisiones; por un lado tiene una vida cómoda con su marido Gilbert, un rico cirujano plástico; por el otro, tiene un amante, Leo, con el que piensa fugarse a China. Un día, Gilbert muere en un accidente de tráfico, lo que aparentemente la libera de sus ataduras. Anne-Marie se siente libre, y decide rehacer su vida, pero no contaba con su familia.',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/2209.jpg',NULL,97,2),
 (2384,'Hancock','','Sin Sinopsis',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/88.jpg',NULL,92,2),
 (2385,'Fast Track','','Sin Sinopsis',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/1304.jpg',NULL,93,2),
 (2386,'El Último Rey de Escocia','','Por una increíble pirueta del destino, un médico escocés destacado en una misión médica en Uganda queda irreversiblemente enredado con uno de los personajes más bárbaros del mundo: Idi Amin. Impresionado por la descarada actitud del doctor Garrigan en un momento de crisis, el recientemente autonombrado presidente de Uganda, Amin, lo elige como médico personal y como su confidente más íntimo. Aunque Garrigan se siente al principio halagado y fascinado por su nuevo puesto, pronto se da cuenta del verdadero salvajismo de Amin. El horror y la traición persiguen a Garrigan cuando intenta enmendar sus errores y huir con vida de Uganda.',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/2919.jpg',NULL,123,2),
 (2387,'Sherlock Holmes','','La película mostrará una visión mas moderna del famoso personaje creado por Arthur Conan Doyle inspirado, a su vez, en el cómic de Lionel Wigram. Sherlock Holmes debe enfrentarse a un nuevo enemigo, Lord Blackwood, y para ello cuenta con la ayuda de su fiel ayudante, el Dr. Watson, y de la bella Irene Alder, la única mujer que ha sido capaz de derrotarle.',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/1001.jpg',NULL,NULL,2),
 (2388,'Te Amaré por Siempre','','La historia se centra en un librero de Chicago con un desorden genético, que lo hace viajar en el tiempo cuando está bajo presión. Aunque ese desorden hace que desaparezca durante largos periodos de tiempo, él intenta llevar una vida normal con la mujer a la que ama, una joven heredera que intenta adaptarse a la situación.',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/2310.jpg',NULL,NULL,2),
 (2389,'El Engaño','','Un auditor corporativo a la deriva en un mar de poder en la élite de Nueva York, se le presenta la oportunidad de ingresar a esa parte de la ciudad que sólo existe para los privilegiados cuando conoce a un abogado carismático, Wyatt Bose. En su mundo, los hombres usan trajes de cuatro mil dólares y fuera del trabajo, se mueven en un mundo clandestino donde las mujeres son hermosas y están al alcance de la mano. Para quienes su jornada de 16 hs de trabajo no les deja tiempo para desarrollar su vida personal, existe The List, un club donde teniendo el celular correcto, se puede acceder a una noche de completa satisfacción sexual. Al ingresar al club, Jonathan descubre cosas de si mismo que no conocía y una aventura con una misteriosa desconocida lo expondrá al mundo de la traición y el asesinato.',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/426.jpg','http://www.deception-movie.com/',108,2),
 (2390,'El Gran Golpe','','Basado en un hecho real, cuenta la historia del robo al Banco Baker Street de Inglaterra en 1971. Se trata de uno de los robos más importantes de la historia inglesa que no tuvo arrestos ni se consiguió recuperar el dinero. La película revela por primera vez todo lo que fue oculto hasta ahora. Una historia de asesinatos, corrupción y escándalo sexual donde los ladrones son los involucrados más inocentes.',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/376.jpg',NULL,111,2),
 (2391,'Espejos Siniestros','','Ben Carson (Kiefer Sutherland)es un ex policía que lucha contra el stress post-traumático. Comienzo a trabajar en una lujosa tienda que sufrió un grave incendio. Al poco tiempo, Ben es víctima de horrorosas visiones en los grandes espejos de la tienda. Tanto él como su familia son perseguidos, vigilados por entes a través de cualquier superficie con reflejo cerca de ellos. Ben tratará de develar el misterio que estos espíritus quieren mostrarle...antes de que sea demasiado tarde.',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/196.jpg',NULL,110,2),
 (2392,'Los Crímenes de Oxford','','La muerte de una anciana en las afueras de Oxford es sólo el primero de una serie de asesinatos con inquietantes puntos en común. El camino para descifrarlos supondrá para un profesor y su alumno poner a prueba no sólo convicciones matemáticas sino la propia forma de entender el mundo: ¿Podemos conocer la realidad? ¿Es posible alcanzar la verdad?',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/75.jpg',NULL,107,2),
 (2393,'Antes que el Diablo Sepa que Estás Muerto','','Es la historia de dos hermanos que, desesperados por conseguir dinero fácil, deciden robar la joyería de sus padres: sin violencia, sin armas... Parece el plan perfecto, perfectamente calculado, hasta que uno de sus cómplices decide saltarse las normas, desencadenado una serie acontecimientos que cambiarán la vida de todos los involucrados.',NULL,'2009-06-05 14:42:28','2009-06-05 14:42:28',2,NULL,'http://img.cinemaki.com/m/240/73.jpg',NULL,117,2),
 (2394,'Control Total','','Un joven y una madre soltera (LaBeouf y Monaghan), se ven implicados en un complot terrorista para asesinar a un político. Desconocidos entre ellos hasta entonces deberán unirse para detener al artífice de esta trampa y evitar ser enredados por un sistema que parece todo bajo control.',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/193.jpg',NULL,122,2),
 (2395,'La Muerte del Presidente','','La película La muerte del presidente se trata de una investigación sobre la muerte del presidente George W. Bush en Chicago. De origen inglés, no tuvo acepación en las principales cadenas de Estados Unidos.',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/424.jpg',NULL,90,2),
 (2396,'Búsqueda implacable','','Liam Neeson interpreta a un ex-espía que deberá recurrir a sus antiguas habilidades para rescatar a su hija, quien es secuestrada mientras realiza un viaje por Europa',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/189.jpg',NULL,93,2),
 (2397,'Vecinos en la mira','','La película Vecinos en la Mira cuenta la historia de un policía de Los Ángeles, Abel Turner, que se opone a la pareja interracial que forman sus nuevos vecinos, Chris y Lisa. Abel educa a sus hijos bajo standares muy estrictos y desaprueba cualquier mal comportamiento en el barrio.  Considera que sus nuevos vecinos son una mala influencia para sus hijos y hará todo lo posible para que se muden. Cuando Abel se pasa de la raya, Chris y Lisa deciden responder y la situación empeora.',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/377.jpg',NULL,110,2),
 (2398,'88 minutos','','Un profesor de universidad que emplea su tiempo en dar clases y aconsejar a la Brigada de investigación criminal recibe una amenaza de muerte en la que le avisan que sólo le quedan 88 minutos de vida. El profesor tendrá que usar toda su habilidad para descubrir quien le amenaza y salvar así su vida. Entre los posibles sospechosos se encontrarán un estudiante disgustado, una antigua amante rechazada y un asesino en serie que está en el corredor de la muerte.',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/78.jpg',NULL,108,2),
 (2399,'Batman: El Caballero de la Noche','','En esta película, Batman redobla la apuesta en su guerra contra el crimen. Con la ayuda del Teniente Jim Gordon y el Fiscal de Distrito Harvey Dent, Batman se propone desmantelar las organizaciones criminales que contaminan las calles de la ciudad. Esta sociedad demuestra ser eficaz, pero pronto se verán atrapados en el reino del caos desatado por una mente criminal en auge, conocida por los temerosos habitantes de Ciudad Gótica como El Guasón.',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/213.jpg','http://www.thedarkknight.com/',152,2),
 (2400,'La Niebla','','En un pequeño pueblo de Maine, estalla una violenta tormenta que termina tan bruscamente como comenzó. Entonces aparece una espesa niebla que va entrando y atrapando a la gente en sus hogares, supermercados, fruterías, etc y va matando a todo aquel que se adentra en su oscuridad. David Drayton y su joven hijo Billy están junto a un grupo de aterrados habitantes del pueblo que están atrapados en la frutería rodeados por una misteriosa niebla.',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/219.jpg',NULL,126,2),
 (2401,'Funny Games','','Sin Sinopsis',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/360.jpg',NULL,111,2),
 (2402,'El Padrino','','Don Vito Corleone es el jefe de una de las cinco familias que ejercen el mando de la Cosa Nostra en Nueva York en los años 40. Don Corleone tiene cuatro hijos; una chica, Connie y tres varones, Santino, o Sonny, como le gusta que le llamen, Michael y Freddie, al que envían exiliado a Las Vegas, dada su incapacidad para asumir puestos de mando en la ”Familia”. Cuando otro capo, Sollozzo, al rechazar el Padrino intervenir en el negocio de estupefacientes, intenta asesinar a éste, empieza una cruenta lucha de violentos episodios entre los distintos grupos.',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/180.jpg',NULL,175,2),
 (2403,'Los Extraños','','Kristen McKay (Liv Tyler) y James Hoyt (Scott Speedman) habían decidido pasar una noche especial en la aislada segunda residencia de la familia Hoyt. Al regresar a casa después de asistir a la boda de una amiga, el mundo de la feliz pareja se derrumba cuando alguien llama a la puerta a las 4 de la mañana y pregunta, con extraña voz: ¿Está Tamara?',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/179.jpg',NULL,85,2),
 (2404,'Desapareció una Noche','','Dorchester, es un barrio obrero de Boston en el que las sucias calles están pobladas de familias destrozadas y sueños rotos. Aquí es donde la pequeña Amanda McCready de 4 años ha desaparecido sin dejar huella. La policía no ha conseguido ni una sola pista, así que los desesperados tíos de Amanda suplican a los investigadores privados Patrick Kenzie y Angie Genarro que acepten el caso.',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/3098.jpg',NULL,114,2),
 (2405,'Traidor','','El agente del FBI Roy Clayton (Guy Pearce) dirige una investigación sobre una organización terrorista cuyo cabecilla parece ser un agente de la CIA. Clayton buscará pistas y pruebas para descubrir si el agente es un traidor.',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/697.jpg','http://Traitor-themovie.com',114,2),
 (2406,'Space Chimps','','Sin Sinopsis',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/293.jpg',NULL,81,2),
 (2407,'Corazón de tinta, el libro mágico','','Una niña descubre que su padre tiene un extraño talento: cuando lee un libro, puede hacer que los personajes cobren vida. Un día leyendo un libro acerca del ficticio reino de Inkheart, libera a tres mágicas criaturas: Capricornio, Dedo polvoriento y Lengua de brujo',NULL,'2009-06-05 14:42:29','2009-06-05 14:42:29',2,NULL,'http://img.cinemaki.com/m/240/727.jpg','http://www.inkheartmovie.com/',105,2),
 (2408,'La Leyenda del Tesoro Perdido: El Libro de los Sec','','Ben Gates emprende nuevamente una búsqueda global, estimulante y plena de acción para develar la Historia y los tesoros escondidos. Cuando sale a la luz una página perdida del diario de John Wilkes Booth, el tatarabuelo de Ben se ve de pronto implicado como uno de los conspiradores clave de la muerte de Abraham Lincoln. Decidido a demostrar la inocencia de su antepasado, Ben sigue una cadena internacional de pistas que lo llevan desde París hasta Londres y finalmente de vuelta a América. Este viaje conduce a Ben y a su equipo no solo hasta sorprendentes revelaciones… sino también hasta el rastro de uno de los secretos más atesorados del mundo.',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/3094.jpg',NULL,123,2),
 (2409,'What Just Happened','','Basada en las memorias del productor Art Linson -guionista del filme-. De Niro interpreta a un productor de Hollywood que intenta mantener su dignidad profesional envuelto en la maquinaria de los grandes estudios.',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/1915.jpg','http://WhatJustHappenedfilm.com',104,2),
 (2410,'A Christmas Carol','','Sin Sinopsis',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/1002.jpg',NULL,NULL,2),
 (2411,'Ray','','Ray Charles, nacido en una ciudad pobre de Georgia, se queda ciego a la edad de siete años, poco tiempo después de haber sido testigo de la accidental muerte de su hermano menor. Inspirado por su madre, encuentra su lugar detrás de un piano. Debido a su música, en la que mezcla una gran variedad de diferentes estilos, se hace mundialmente conocido. Al tiempo que provoca una revolución musical, lucha contra la discriminación y defiende los derechos de los artistas dentro del negocio de la música.',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/2726.jpg',NULL,152,2),
 (2412,'Arranged','','Sin Sinopsis',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/1048.jpg',NULL,NULL,2),
 (2413,'Red de Mentiras','','Basada en la novela \"Body of Lies\" de David Ignatius. Cuenta la historia de un antiguo periodista herido en la guerra de Irak que es contratado por la CIA para seguir la pista de un líder de Al Qaeda en Jordania.  Roger Ferris, es el mejor hombre de inteligencia que tiene la CIA en lugares donde la vida humana no vale más que la información que uno puede obtener. En operaciones que lo llevan alrededor del mundo, cada paso de Ferris depende de la voz en el otro extremo de una línea telefónica segura de Ed Hoffman, un veterano agente de la CIA. Desde los suburbios y a través de una laptop, Hoffman se encuentra en el camino de un emergente líder terrorista que planea una serie de bombardeos eludiendo la más sofisticada tecnología en seguridad. Para atraparlo, Ferris deberá penetrar en su oscuro mundo. Cuanto más se acerca a cumplir su objetivo, más descubre que la confianza es un lujo peligroso pero el único que lo sacará vivo de su misión.',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/655.jpg',NULL,128,2),
 (2414,'Robin Hood','','Mostrará los orígenes de Robin Hood, quien abandonado por sus padres en Nottingham conoce a una joven fuerte y valiente que es Marian, y que acaba luchando en la tercera cruzada junto a Ricardo Corazón de León.',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/1945.jpg',NULL,NULL,2),
 (2415,'Cuatro Hermanos','','Después de que su madre adoptiva es asesinada durante un asalto, los hermanos Mercer se reúnen para resolver el asunto por cuenta propia. Mientras que tratan de encontrar al asesino, descubren que su estilo usual de resolver los problemas tiene sus consecuencias. Los cuatro hermanos se unen para descubrir que están unidos por lazos más fuertes que la sangre.',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/2876.jpg',NULL,109,2),
 (2416,'La Carrera de la Muerte','','Un futuro próximo, con el deporte más brutal jamás inventado como telón de fondo. Una penitenciaría atestada de presos inspiró a los carceleros para crear un pasatiempos tan cruel como lucrativo. Presos capaces de todo, un público global hambriento de violencia televisada.',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/685.jpg','http://www.deathracemovie.net',105,2),
 (2417,'La Isla','','Lincoln Seis Eco y Jordan Dos Delta, son sólo dos de los cientos de residentes de un instituto altamente controlado de mitad del siglo XXI. Cada una de sus actividades diarias es monitoreada, aparentemente para su propio bien. La única manera de poder salir de ahí es que sean elegidos para ir a La Isla, el último lugar aún no contaminado de la Tierra, luego del desastre ecológico que acabó con la vida de la mayoría de los seres vivos del planeta. Lincoln comienza a cuestionarse las restricciones impuestas en su vida. Su curiosidad descubrirá que toda su existencia es una mentira. La Isla es un engaño cruel y él mismo y todos a los que conoce, valen más muertos que vivos.',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/2751.jpg',NULL,136,2),
 (2418,'Pearl Harbor','','Rafe y Danny crecieron juntos en una zona rural estadounidense y su amistad se ha prolongado a lo largo de los años hasta las filas de la Fuerza Aérea, donde los dos son pilotos de guerra. Rafe encontró en Evelyn, una  enfermera, al amor de su vida, pero pronto es llamado a servir en la Fuerza Aérea Británica para combatir a los Nazis como representante del ejército norteamericano. Mientras tanto, Danny y Evelyn son enviados a la base aérea de Pearl Harbor.',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/3108.jpg',NULL,183,2),
 (2419,'Indiana Jones y el Reino de la Calavera de Cristal','','La última aventura empieza en el desierto del suroeste de Estados Unidos en 1957, en plena Guerra Fría. Indiana y su amigo Mac acaban de escapar de las garras de unos infames agentes soviéticos en un remoto aeropuerto. El profesor Jones regresa a casa y se entera de que las cosas van de mal en peor. Su mejor amigo, el decano de la Universidad, le dice que muchos sospechan de sus últimas actuaciones y que el gobierno presiona a la Universidad para que lo despidan. Indiana, a punto de irse, conoce a un joven rebelde llamado Mutt, que le propone un trato. Si el arqueólogo lo ayuda a resolver un problema personal, podría hacer uno de los descubrimientos más espectaculares de la historia; se trata de la Calavera de Cristal de Akator, un objeto legendario que despierta la fascinación, la superstición y el miedo.',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/3261.jpg',NULL,122,2),
 (2420,'When In Rome','','Una neoyorquina está cansada del amor y aprovecha un viaje a Roma para robar algunas de las monedas que se han lanzado a una fuente que, según cuenta la leyenda, tiene propiedades mágicas. Los enamorados lanzan allí sus monedas para ser correspondidos, por lo que el robo provoca que un grupo de encolerizados pretendientes la persiga hasta Nueva York, después de haber sabido que robó las monedas que ellos habían tirado a la fuente.',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/1994.jpg',NULL,NULL,2),
 (2421,'How To Lose Friends & Alienate People','','Sin Sinopsis',NULL,'2009-06-05 14:42:30','2009-06-05 14:42:30',2,NULL,'http://img.cinemaki.com/m/240/778.jpg',NULL,NULL,2),
 (2422,'What Just Happened?','','Sin Sinopsis',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/677.jpg',NULL,107,2),
 (2423,'No te Metas con Zohan','','Zohan es un agente de la Fuerza de Inteliencia Israelí que finge estar muerto y resurge como estilista en Nueva York. Encanta a sus clientes brindándoles \"servicios especiales\" en el cuarto de atrás de su peluquería.',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/190.jpg',NULL,113,2),
 (2424,'Historias de Familia','','Los Berkman son una excéntrica familia de Brooklyn. Bernard, el padre, alguna vez fue un gran novelista, aunque ahora trabaja como maestro. Cuando su esposa Joan descubre también su talento para la escritura, los celos comienzan a dividir a la familia, obligando a los dos hijos adolescentes a iniciar nuevas relaciones con ambos padres. Los cambios no serán sencillos para ninguno, Joan comienza a salir con el maestro de tenis de su hijo más joven, mientras que Bernard tiene una aventura con la estudiante que su hijo mayor desea.',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/2858.jpg',NULL,88,2),
 (2425,'The Hunting Party','','Sin Sinopsis',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/218.jpg',NULL,96,2),
 (2426,'New Moon','','New Moon es la película que le sigue a Twilight. Producida por Summit Entertainment, buscarán repetir el éxito logrado en la primera versión, que lleva recaudados más de 150 millones de dólares en Estados Unidos en 4 semanas de exhibición.\r\nEl nuevo director será Chris Weitz.',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/1349.jpg',NULL,NULL,2),
 (2427,'Crepúsculo','','Crepúsculo es una película de acción que envuelve una moderna historia de amor entre una adolescent y un vampiro. \r\nBella Swan (Kristen Stewart) ha sido siempre un poco diferente a las demás, sin preocuparse por encajar con las chicas populares de la secundaria en Phoenix. Cuando su madre se casa por segunda vez y manda a Bella a vivir con su padre al lluvioso pueblo de Forks, Washington, Bella no espera que las cosas cambien demasiado.\r\nEs entonces cuando conoce al misterioso y asombrosamente guapo Edward Cullen (Robert Pattinson), un chico totalmente distinto a todos los que ha conocido. Inteligente e ingenioso, Edward se mete por completo en su alma. Muy pronto, Bella y Edward se ven envueltos en un apasionado y poco ortodoxo romance. Edward puede correr más rápido que un león y detener un auto en movimiento con sus manos y no ha envejecido nada desde 1918. Como todos los vampiros, es inmortal pero no tiene colmillos, ni bebe sangre humana, pues él y su familia son los únicos entre todos los vampiros en cuanto a su estilo de vida.\r\nPara Edward, Bella es aquello que ha esperado durante noventa años, su alma gemela. Pero entre más cercanos son, mas difícil es para Edward resistir la atracción de su aroma, el cual puede ponerlo frenético. Pero, ¿que es lo que ambos harán cuando Lauren (Edi Gathegi) y James (Cam Gigandet) -los vampiros enemigos de los Cullen- lleguen al pueblo buscando a Bella?',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/986.jpg','http://www.thetwilightmovie.com/',122,2),
 (2428,'Mamma mia!, la película','','Sophie (Amanda Seyfried), una chica inglesa de 20 años que vive en el hotel de su madre en una isla griega, está por casarse con Sky (Dominic Cooper). Su madre, Donna (Meryl Streep), nunca le ha dicho quién es su padre, y cuando Sophie encuentra su antiguo diario, encuentra la dirección de tres hombres que podrían ser su padre y decide invitarlos a su boda sin que su madre se entere.\r\n\r\nTodo se complica cuando Sam (Pierce Brosnan), Harry (Colinb Firth) y Bill (Stellan Skarsgård) llegan a la isla y se encuentran con Sophie y Donna, la última apoyada por sus dos mejores amigas Rosie (Julie Walters) y Tanya (Christine Baranski). Todos juntos intentaran resolver el misterio de quien es el verdadero padre de Sophie, y quien la llevará al altar.',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/111.jpg',NULL,108,2),
 (2429,'Abrígate','','Valeria ha cambiado su Buenos Aires natal por Betanzos, un pueblo de A Coruña del que procede su familia. Excéntrica, soñadora y divertida, a sus 25 años se encuentra en la encrucijada sentimental más surrealista de su vida: tras la repentina muerte de su maduro y atractivo amante, se enamora de Marcelo, el hijo del difunto. Su amiga Adela, dueña de la peluquería donde ambas trabajan, la ayudará a despejar la incógnita. Y mientras tanto disfrutan con sus vecinos de las pequeñas alegrías, se ríen de las penas y fantasean con tener una vida diferente (inspirada quizá en los carteles parisinos que decoran la peluquería...). Un hermoso relato sobre el afán universal de hallar la propia identidad, descifrar la colectiva y vivir el amor en una tierra que nada tiene que envidiar a los bulevares de París.',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/181.jpg',NULL,90,2),
 (2430,'Un Novio para Mi Mujer','','El Tenso (Adrián Suar) no sabe cómo enfrentar a su mujer, la Tana (Valeria Bertuccelli), para decirle que se quiere separar, ya que la relación se le hace insostenible debido a su terrible carácter. Ella vive constantemente malhumorada: si no protesta por el tiempo, es por el gobierno; si no es por los vecinos, es por los jóvenes, o por los viejos… o por lo que fuere. Carlos, amigo del Tenso, le sugiere invertir el problema… y provocar que la Tana lo abandone a él. ¿Cómo? se pregunta el Tenso, y Carlos le presenta una propuesta: recurrir al Cuervo Flores (Gabriel Goity), un viejo seductor irresistible que seducirá a su mujer hasta el enamoramiento para que por fin el Tenso encuentre la solución a sus problemas…',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/108.jpg',NULL,100,2),
 (2431,'Motivos para No Enamorarse','','CLARA es una chica sin suerte. Sus días transcurren en el encierro rutinario de un call center, mientras sueña con una vida mejor en alguna otra parte. En su compulsiva búsqueda de una relación sentimental mínimamente afortunada, inicia un romance poco feliz con AXEL pero pronto es victima de una traición y tiene que dejar el departamento que comparte con su ahora ex – amiga, aún sin tener adónde ir. Repentinamente aparece en su vida un misterioso hombre, bastante mayor que ella (a quien bautizará como “TEO”) que le ofrece asilo en su casa. Juntos establecen un “Código de convivencia” con una regla fundamental: NO ENAMORARSE.',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/173.jpg',NULL,90,2),
 (2432,'Escondido en Brujas','','Dos asesinos se encuentran en Brujas, Bélgica, tras un trabajo que no salió del todo bien y comienzan a diferir en su manera de ver la vida y la muerte, a medida que se adaptan a las costumbres locales.',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/197.jpg',NULL,107,2),
 (2433,'Superhéroes, la película','','Parodia de las películas de superhéroes. Un mal estudiante llamado Rick Rikers es picado por una libélula genéticamente alterada mientras se encuentra en una excursión del colegio, razón por la que comienza a desarrollar habilidades sobrehumanas y una especie de armadura protectora. Los creadores de “Scary Movie” responden a esta pregunta al estilo David Zucker con esta hilarante comedia.',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/185.jpg',NULL,85,2),
 (2434,'Manuale D\'Amore','','Es una historia de amor, vista a través de un caleidoscopio de colores, que describe las cuatro fases del amor: el enamoramiento, la crisis, la traición y el abandono. Así, las fases de Manuale d´amore están narradas en cuatro episodios protagonizados por cuatro parejas diferentes. Se trata de historias cotididanas, dulces e irónicas, románticas y divertidas.',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/199.jpg',NULL,116,2);
INSERT INTO `events` (`id`,`title`,`description`,`text`,`thumbnail`,`created_at`,`updated_at`,`sponsor_id`,`price`,`image_url`,`web`,`duration`,`category_id`) VALUES 
 (2435,'Mi Hermano es Hijo Único','','Es la historia de dos hermanos, Accio y Manrico enfrentados por sus diferentes ideales políticos en Italia en la década del 70. Manrico se enamora de Francesca, quien luego es conocida por Accio....',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/192.jpg',NULL,108,2),
 (2436,'Kung Fu Panda','','Animación de última generación, muestra a un panda que debe convertirse en campeón de kung fu a pesar de sus torpezas y su exceso de peso. El Panda Po es el más vago de los animales del Valle de la Paz, sin embargo, se convierte en el elegido para defender al Valle cuando su estilo de vida es amenazado por los enemigos. Y con un sabio maestro será entrenado pese a que él duda de sus capacidades.',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/87.jpg',NULL,92,2),
 (2437,'Antes de Partir','','Carter Chambers ha tenido una vida llena de trabajo y responsabilidades dejando pasar oportunidad tras oportunidad. Edward Cole es un hombre de negocios, que ha creado un importante imperio dejando a un lado sus necesidades más profundas. Sus vidas se cruzan en la cama de un hospital, ya que ambos son diagnosticados con enfermedades terminales. Entonces juntos deciden que ya es hora de recuperar el tiempo perdido. Ambos elaborarán una lista de todo aquello que siempre quisieron hacer, y no lo quierden dejar sin cumplir',NULL,'2009-06-05 14:42:31','2009-06-05 14:42:31',2,NULL,'http://img.cinemaki.com/m/240/70.jpg','http://wwws.la.warnerbros.com/bucketlist/',96,2),
 (2438,'El frasco','','PEREZ (Darío Grandinetti) Es chofer de una línea de ómnibus. Siempre un mismo recorrido. Un día va, al otro día vuelve. De cuarenta años, sin amigos, de aspecto pulcro, tímido, serio, algo torpe. Casi no habla, por eso le dicen “el MUDO”. En su viaje diario pasa por varios pueblitos donde día a día repite los mismos movimientos, saluda de la misma manera, se sienta en el mismo lugar y come lo mismo. Sólo en uno de esos paradores hay algo que lo trastoca y conmueve. Aunque nadie lo sabe y jamás se atrevería a confesarlo allí vive ... ROMINA (Leticia Bredice) Es la maestra del pueblo. Su simpleza esconde a una mujer atractiva y misteriosa. Vive en una casa rodante. Sólo los que conocen su pasado saben porqué nunca se la vio con un hombre. Le cuesta relacionarse. Los niños, sus alumnos, parecen ser su único contacto a tierra. Sólo la detención del ómnibus que pasa una vez al día por el pueblo llama su atención. Una orden del Ministerio de Educación le obliga a hacerse un análisis. Como ella no puede viajar le pide a PEREZ que le lleve ... el viaja ensimismado por ese frasco, pero en un descuido, se le cae y se rompe. No puede creer su torpeza, necesita quedar bien con ROMINA y se le ocurre una absurda solución. Este es el comienzo de una historia de AMOR muy especial entre dos personajes tan particulares que hace que aún el peor de los conflictos nos arranque una sonrisa.',NULL,'2009-06-05 14:42:32','2009-06-05 14:42:32',2,NULL,'http://img.cinemaki.com/m/240/188.jpg',NULL,97,2),
 (2439,'Dani, un tipo de suerte','','Dani es un hombre viudo quien dedica su vida a sus hijas, hasta que un día se enamora de una mujer que resulta ser la novia de su hermano.',NULL,'2009-06-05 14:42:32','2009-06-05 14:42:32',2,NULL,'http://img.cinemaki.com/m/240/194.jpg',NULL,98,2),
 (2440,'El invitado','','Con Daniel Auteuil en el papel de Gerard, un hombre al cual, tras más de 3 años desempleado, le ofrecen un puesto de trabajo. A fin de agradecer esto a su nuevo empleador, Gerard lo invita a cenar a su casa. Convencida de no estar a la altura de las circunstancias, su mujer le pide a su vecino, guru de relaciones publicas, que les haga un “cambio de look” en 24 horas.',NULL,'2009-06-05 14:42:32','2009-06-05 14:42:32',2,NULL,'http://img.cinemaki.com/m/240/161.jpg',NULL,86,2),
 (2441,'Una Guerra de Película','','Comedia de acción sobre un grupo de actores egocéntricos que deciden realizar la película de guerra más costosa que se ha producido. Los exorbitantes costos en que se incurren hacen que el estudio cancele la producción, pero el frustrado director se niega a suspender el rodaje y decide internar a todo el elenco en la jungla del sureste de Asiático, para terminar el film. Lo que nunca imaginó es que allí se toparían con villanos reales.',NULL,'2009-06-05 14:42:32','2009-06-05 14:42:32',2,NULL,'http://img.cinemaki.com/m/240/172.jpg',NULL,103,2),
 (2442,'Luciérnagas en el Jardín','','Los Taylors son el prototipo de familia americana con éxito. Lisa, la madre, se ha graduado después de pasar décadas criando a sus hijos y a su marido Charles, quien es un experimentado profesor en camino de convertirse en rector de la universidad en la que trabaja. Michael, el hijo mayor, es un famoso y prolífico escritor de novelas románticas, mientras que su hermana Ryne ha sido aceptada en una prestigiosa escuela de derecho. Pero cuando un desgraciado accidente sacude a la familia la historia oculta de sus relaciones saldrá a la luz.',NULL,'2009-06-05 14:42:32','2009-06-05 14:42:32',2,NULL,'http://img.cinemaki.com/m/240/718.jpg',NULL,99,2),
 (2443,'La Propuesta','','Sandra Bullock interpreta a una ejecutiva que está a punto de ser deportada a Canadá porque carece de permiso de residencia. Para intentar solucionar la situación, aceptará contraer matrimonio con su joven asistente. Tras haber contraído matrimonio por conveniencia, surgirá inesperadamente el amor.',NULL,'2009-06-05 14:42:32','2009-06-05 14:42:32',2,NULL,'http://img.cinemaki.com/m/240/1006.jpg',NULL,NULL,2),
 (2444,'Sólo un Sueño','','Basada en una novela de Richard Yates, la película retrata la vida de April and Frank Wheeler, una joven pareja que vive en un elegante barrio a las afueras de Connecticut, en los años 50, quienes luchan por solucionar sus problemas personales mientras crían a sus dos pequeños hijos. Ambos desean escapar de sus vidas sumidas en la mediocridad y piensan que la solución la encontrarán mudándose a Francia. Pero, ¿podrá este viaje terminar con el círculo de reproches, celos y peleas en el que están sumergidos?',NULL,'2009-06-05 14:42:32','2009-06-05 14:42:32',2,NULL,'http://img.cinemaki.com/m/240/777.jpg','http://www.revolutionaryroadmovie.com/',118,2),
 (2445,'All the King\'s Men','','Sin Sinopsis',NULL,'2009-06-05 14:42:32','2009-06-05 14:42:32',2,NULL,'http://img.cinemaki.com/m/240/620.jpg',NULL,110,2),
 (2446,'Closing the Ring','','Sin Sinopsis',NULL,'2009-06-05 14:42:32','2009-06-05 14:42:32',2,NULL,'http://img.cinemaki.com/m/240/412.jpg',NULL,119,2),
 (2447,'Feast Of Love','','Sin Sinopsis',NULL,'2009-06-05 14:42:32','2009-06-05 14:42:32',2,NULL,'http://img.cinemaki.com/m/240/280.jpg',NULL,102,2),
 (2448,'Ceguera','','En la película Ceguera, la esposa de un médico se convierte en la única persona con la capacidad de ver en una ciudad donde la población está sorprendida con un misterioso caso de repentina ceguera. Basada en la novela de José Saramango, ganador de un premio Nobel.',NULL,'2009-06-05 14:42:32','2009-06-05 14:42:32',2,NULL,'http://img.cinemaki.com/m/240/225.jpg',NULL,120,2),
 (2449,'El sabor de la noche: My blueberry nights','','En su debut en un film en lengua inglesa, el director internacionalmente aclamado Wong Kar Wai nos muestra el dramático viaje entre la ruptura de una relación y un nuevo comienzo. Luego de una dura separación, Elizabeth (representado por la cantante Norah Jones en su debut cinematográfico) emprende un viaje por Estados Unidos, dejando atrás una vida de recuerdos, un sueño y a un nuevo amigo – el dueño de un café (Jude Law) – en la búsqueda de algo que pueda reparar su corazón. Recorriendo el país, Elizabeth se encuentra con otras personas cuyos anhelos son incluso mayores a los de ella, incluyendo a un problemático policía (David Strathairn) y su esposa (Rachel Weisz) y a una apostadora (Natalie Portman). Rodeada de esos compañeros de ruta, Elizabeth logra llegar a los niveles más profundos de la soledad, del vacío y comienza a entender que su propio viaje es parte de la mayor exploración de si misma que haya hecho hasta entonces.',NULL,'2009-06-05 14:42:32','2009-06-05 14:42:32',2,NULL,'http://img.cinemaki.com/m/240/154.jpg',NULL,93,2),
 (2450,'Angel','','Sin Sinopsis',NULL,'2009-06-05 14:42:32','2009-06-05 14:42:32',2,NULL,'http://img.cinemaki.com/m/240/451.jpg',NULL,90,2),
 (2451,'Amorosa Soledad','','Soledad es abandonada por su novio. A partir de ese momento, resuelve estar sola por los próximos 3 años de su vida, y evitar otro fracaso amoroso. Desde que toma esa decisión, lo único que hace es trabajar a favor de su propia contradicción.\r\nSoledad -que cree estar enferma casi todo el tiempo- conoce a un hombre con el que las cosas parecen fluir de una manera inesperada, pero en ese mismo momento su ex la llama para decirle que quiere volver. El reencuentro la obliga a tener que tomar una decisión.\r\nUna madre ocupada por su imagen que no deja de llamarla por teléfono y no la visita, un padre al que casi no ve y un socio confidente al que abruma con sus problemas completan el abismal, luminoso y apasionante mundo de Soledad.',NULL,'2009-06-05 14:42:33','2009-06-05 14:42:33',2,NULL,'http://img.cinemaki.com/m/240/379.jpg',NULL,NULL,2),
 (2452,'Noches de Tormenta','','Diane Lane interpreta a Adrienne Willis, una mujer con su vida en caos. Viaja a la acogedora ciudad de Rodanthe a pasar el fin de semana a la hostería de una amiga, en busca de tranquilidad para repensar su vida y cómo resolver los problemas que la perturban a diario (un marido caprichoso que le ha pedido que regrese a casa, y una hija adolescente que resiente cada una de sus decisiones). El único huésped de la hostería es Richard Gere, quien viajó para reonciliarse con su hijo. Ahora, con una amenazante tormenta que se avecina, los dos acudirán el uno al otro para consolarse y, en un fin de semana mágico, poner en marcha un romance que cambiará sus vidas para siempre',NULL,'2009-06-05 14:42:33','2009-06-05 14:42:33',2,NULL,'http://img.cinemaki.com/m/240/200.jpg',NULL,97,2),
 (2453,'Lo que se de Lola','','Léon (Michaël Abiteboul) es un hombre solitario que no trabaja en nada ni se relaciona con nadie. Sólo cuida a su madre enferma hasta que ella muere. Para romper su soledad, le gusta robar el correo de los vecinos, escuchar las conversaciones de la gente, seguir las idas y venidas de los viajeros en una pequeña estación de tren. Un día, Dolores (Lola Dueñas), una española ruidosa, se instala en el vecindario y Léon fija en ella toda su atención. Conoce sus encuentros, sus tristezas, espía a través de los tabiques los altibajos de su suerte e interviene en su vida, mientras va consignando a lo largo de años en un cuaderno los pequeños detalles de su cotidianeidad.',NULL,'2009-06-05 14:42:33','2009-06-05 14:42:33',2,NULL,'http://img.cinemaki.com/m/240/365.jpg',NULL,112,2),
 (2454,'Over Her Dead Body','','Sin Sinopsis',NULL,'2009-06-05 14:42:33','2009-06-05 14:42:33',2,NULL,'http://img.cinemaki.com/m/240/289.jpg',NULL,95,2),
 (2455,'Posdata Te Amo','','La película cuenta la historia de Holly Kennedy, una mujer hermosa, inteligente que está casada con el amor de su vida, Gerry. Pero un día, una enfermedad se lo lleva, y con él también se va el espíritu de Holly. Terriblemente triste, la única persona que puede ayudarle ya no está a su lado. Pero su marido, muy previsor, le ha dejado cartas para guiarla en su camino. El primer mensaje llega en su primer cumpleaños sin él. Junto con la torta recibirá una cinta grabada por Gerry en la que le insiste que salga adelante y lo celebre. A medida que pasan los meses, Holly seguirá encontrando las cartas en los lugares más inesperados.',NULL,'2009-06-05 14:42:33','2009-06-05 14:42:33',2,NULL,'http://img.cinemaki.com/m/240/380.jpg',NULL,126,2),
 (2456,'El Último Samurai','','(1870) El Capitán Nathan Algren, un respetado oficial militar americano es contratado por el Emperador de Japón para entrenar al primer ejército del país en el arte de la guerra moderna. Cuando el Emperador trata de erradicar los antiguos guerreros Samurai Imperiales preparando normas de gobierno más occidentalizadas y más amistosas comercialmente, Algren se siente inesperadamente impresionado e influenciado por sus encuentros con los Samurais, lo que lo pone en el centro de una lucha entre dos épocas y dos mundos, guiándolo solamente su propio sentido del honor.',NULL,'2009-06-05 14:42:33','2009-06-05 14:42:33',2,NULL,'http://img.cinemaki.com/m/240/2246.jpg',NULL,154,2),
 (2457,'Dónde Están las Rubias','','Dos ambiciosos agentes del FBI se disfrazarán de chicas ricas para infiltrarse en la alta sociedad mientras investigan un caso.',NULL,'2009-06-05 14:42:33','2009-06-05 14:42:33',2,NULL,'http://img.cinemaki.com/m/240/2511.jpg',NULL,109,2),
 (2458,'Espanglish','','Flor, una bella mujer mexicana que emigró a Los Angeles con la esperanza de una mejor vida, se convierte en la ama de llaves de la adinerada pero problemática familia Clasky. John y Deborah, están teniendo dificultades en su matrimonio. Él es un paciente y estable padre y marido, así como el dueño de un exitoso restaurante. Ella recientemente perdió su trabajo en una compañía de diseño comercial y ahora está al borde de una crisis de identidad.',NULL,'2009-06-05 14:42:33','2009-06-05 14:42:33',2,NULL,'http://img.cinemaki.com/m/240/2866.jpg',NULL,127,2),
 (2459,'Analízame','','Un mafioso sufre ataques de pánico y decide ir a ver a un psiquiatra quien debe estar disponible las 24 horas del día, si quiere seguir vivo.',NULL,'2009-06-05 14:42:33','2009-06-05 14:42:33',2,NULL,'http://img.cinemaki.com/m/240/2728.jpg',NULL,109,2),
 (2460,'El Cadáver de la Novia','','En un pequeño y reprimido pueblo victoriano, dos jóvenes tímidos deben casarse, a pesar de no haberse conocido antes. Víctor y Victoria se conocen por primera vez en la víspera de su boda. Al conocerse, surge la posibilidad de que puedan tener una oportunidad de amor verdadero. Durante el ensayo, Víctor tiene mucha dificultad para decir sus votos matrimoniales, y es echado del ensayo hasta que consiga aprender correctamente la frase que tiene que decir. Víctor se adentra en el oscuro bosque que rodea al pueblo. Una vez a solas, es capaz de pronunciar sus votos a la perfección, depositando el anillo de la novia en una supuesta raíz de árbol. De la tierra, surge el cadáver de una mujer, luciendo los rezagos de un vestido de novia. En su dedo, luce el anillo de boda de Victoria. Víctor, involuntariamente, es ahora el prometido del Cadáver de la Novia, quien está decidido a no dejarlo escapar de los lazos de su matrimonio atroz. Pero él desea encontrar un camino para regresar de la Tierra de los Muertos a los brazos del amor de su vida.',NULL,'2009-06-05 14:42:33','2009-06-05 14:42:33',2,NULL,'http://img.cinemaki.com/m/240/2585.jpg',NULL,76,2),
 (2461,'Harry Potter y la Orden del Fénix','','Lord Voldemort ha recuperado sus fuerzas, aunque muchos no creen que sea cierto, ya que Harry fué el único que lo vió. Por eso Harry, los Weasley, Hermione y muchos más, son reclutados en la Orden del Fénix. Dentro del colegio, Harry entrenará a sus amigos para poder defenderse en los tiempos oscuros que se acercan.',NULL,'2009-06-05 14:42:33','2009-06-05 14:42:33',2,NULL,'http://img.cinemaki.com/m/240/2732.jpg',NULL,138,2),
 (2462,'Shrek','','Hace mucho, mucho tiempo, en una lejanísima ciénaga vivía un intratable ogro llamado Shrek. Su absoluta soledad se ve interrumpida por una invasión de sorprendentes personajes de cuento. Para conseguir salvar su terreno,  Shrek hace un pacto con Farquaad y emprende viaje para conseguir que la preciosa princesa Fiona sea la novia del Lord. En tan importante misión le acompañan un burro chistoso, dispuesto a hacer cualquier cosa por Shrek.. menos quedarse calladito. Rescatar a la princesa de una dragona enamoradiza que suelta fuego al respirar va a resultar una tontería comparado con lo que ocurre cuando el oscuro secreto que la joven guardaba es revelado.',NULL,'2009-06-05 14:42:34','2009-06-05 14:42:34',2,NULL,'http://img.cinemaki.com/m/240/2502.jpg',NULL,90,2),
 (2463,'Legalmente Rubia','','Elle Woods es una rubia auténtica, además de muy popular, buena estudiante, presidenta de su hermandad y Miss Junio en el calendario de la Universidad. Ha disfrutado de una vida maravillosa y está enamorada de Warner Huntington III. Pero todo se derrumba cuando su novio decide romper con ella debido a que es demasiado rubia y no lo suficientemente formal para su futura carrera en el mundo de la política. Decidida a salir adelante, Elle se matricula en la Facultad de Derecho de la Universidad de Harvard, asumiendo un reto aún mayor de lo que esperaba.',NULL,'2009-06-05 14:42:34','2009-06-05 14:42:34',2,NULL,'http://img.cinemaki.com/m/240/2725.jpg',NULL,96,2),
 (2464,'Un Papá Genial','','Sonny Koufax es un abogado treintañero al que nunca le han gustado las responsabilidades. Después de que su última novia lo abandone por su inmadurez, decide hacer algo drástico que cambie su vida: adoptar a Julian, un niño de 5 años.',NULL,'2009-06-05 14:42:34','2009-06-05 14:42:34',2,NULL,'http://img.cinemaki.com/m/240/2650.jpg',NULL,93,2),
 (2465,'Gangster Americano','','A principios de la década de los 70, la corrupción policíaca en la ciudad de Nueva York no tenía freno. La Guerra de Vietnam cobraba un precio devastador fuera y dentro de Estados Unidos. Los soldados regresaban al país, ya sea en bolsas para cadáveres o adictos a un opiáceo importado llamado heroína. Con la asistencia de los oficiales de la ley, la mafia funcionaba con impunidad relativa en este mercado sin competencia, vendiendo miles de kilos de heroína a los adictos desesperados por el producto. Una clase de hombres blancos, privilegiados e intocables pagaban millones de dólares a los jueces, abogados y policías de Nueva York para guardar silencio sobre esta relación beneficiosa para ambas partes. La Cosa Nostra y sus secuaces eran invencibles.\r\nHasta que un asistente de unos de los jefes de la mafia de Harlem, llamado Frank Lucas (Denzel Washington) se apoderó del juego.',NULL,'2009-06-05 14:42:34','2009-06-05 14:42:34',2,NULL,'http://img.cinemaki.com/m/240/2352.jpg',NULL,157,2),
 (2466,'Forrest Gump','','Forrest Gump es un chico con deficiencias mentales no muy profundas y con alguna incapacidad motora, que llegará a convertirse en héroe durante la Guerra del Vietnam. Su persistencia y bondad le llevarán a conseguir una gran fortuna, ser objeto del clamor popular y a codearse con las más altas esferas sociales y políticas del país.',NULL,'2009-06-05 14:42:34','2009-06-05 14:42:34',2,NULL,'http://img.cinemaki.com/m/240/2054.jpg',NULL,142,2),
 (2467,'La Momia: La tumba del Emperador Dragón','','Brendan Fraser regresa como el explorador Rick O\'Connell para combatir al resucitado Emperador Han (Jet Li) en una carrera épica de las catacumbas de la antigua China a las frías alturas de los Himalayas. Se unen a Rick O\'Connell su hijo Alex (Luke Ford), su esposa Evelyn (Maria Bello) y su cuñado Jonathan (John Hannah). Esta vez, los O\'Connell deben detener a una momia que despierta de su maldición después de 2,000 años y que amenaza en dominar al mundo bajo su desapiado mando.',NULL,'2009-06-05 14:42:34','2009-06-05 14:42:34',2,NULL,'http://img.cinemaki.com/m/240/100.jpg',NULL,114,2),
 (2468,'Los Increibles','','Bob Parr, es uno de los superhéroes más grandes del mundo conocido por todos como “Mr. Increíble”. En la actualidad él y su esposa, una ex heroína famosa, han adoptado identidades comunes y se han retirado a los suburbios para vivir una vida normal con sus tres hijos. Ahora él trabaja en una compañía de seguros, tratando de combatir el aburrimiento y el exceso de peso. Sin embargo, nunca abandona el deseo de ayudar al prójimo y de volver a su antiguo trabajo de superhéroe. Bob encontrará su oportunidad cuando un mensaje misterioso le ordene ir a una isla remota para una misión ultra secreta.',NULL,'2009-06-05 14:42:34','2009-06-05 14:42:34',2,NULL,'http://img.cinemaki.com/m/240/2533.jpg',NULL,115,2),
 (2469,'La Era de Hielo 2','','Manny, el mamut, Sid, el perezoso, Diego, el tigre dientes de sable y la desafortunada ardilla Scrat, están de regreso. Su vida cambia con este nuevo mundo en deshielo. Manny, Sid y Diego todavía siguen unidos y disfrutan las ventajas de su nueva realidad. El clima cálido trae una nueva aventura: una gran presa glacial que contiene al océano está a punto de reventar, por lo que amenaza a todo el valle. La única oportunidad de supervivencia se encuentra llegando al otro extremo. Los tres héroes, junto a sus nuevos amigos, se embarcan en una peligrosa misión a través de un ambiente que los llenará de desopilantes situaciones.',NULL,'2009-06-05 14:42:34','2009-06-05 14:42:34',2,NULL,'http://img.cinemaki.com/m/240/2253.jpg',NULL,88,2),
 (2470,'Lo que Ellas Quieren','','Nick Marshall es un egocéntrico, machista y triunfador publicista de Chicago, que tras sufrir un accidente con un secador en la bañera descubre que puede escuchar los pensamientos de las mujeres. Este don le permitirá sacar ventaja en su trabajo, y en el amor.',NULL,'2009-06-05 14:42:34','2009-06-05 14:42:34',2,NULL,'http://img.cinemaki.com/m/240/2603.jpg',NULL,127,2),
 (2471,'Diarios de Motocicleta','','Basada en los diarios y en un libro de los propios \"Che\" Guevara y Alberto Granado, es la crónica de un joven que abandona su hogar y experimenta y despierta al mundo de su alrededor.\r\nRelata la odisea por Latinoamérica llevada a cabo por el posteriormente conocido revolucionario Ernesto \"Che\" Guevara y su amigo el Dr. Alberto Granado en 1952, cuando Guevara era un joven estudiante de medicina de 23 años. Ambos embarcaron en un viaje de 9 meses recorriendo América del Sur en una destartalada moto Norton de 500 cc, a la que apodaban \"La poderosa\". En su ruta fueron a la provincia argentina de Córdoba, Buenos Aires, la Patagonia, la ciudad chilena de Valparaíso, el desierto de Atacama, Machu Picchu y la colonia San Pablo, el leprosario más importante de Latinoamérica.',NULL,'2009-06-05 14:42:34','2009-06-05 14:42:34',2,NULL,'http://img.cinemaki.com/m/240/2333.jpg',NULL,126,2),
 (2472,'American Pie','','Jim es como cualquier otro chico de su edad, un joven sano y vigoroso que también resulta ser virgen, el principal motivo de su  desesperación. Desde que sus padres lo sorprendieron viendo películas pornográficas, las cosas han ido a peor. En casa, su bienintencionado padre extiende un celo mortificador en todo lo referente a la educación sexual de su hijo; en el colegio, las cosas no van mucho mejor: sus experiencias con una bella chica perteneciente a un programa de intercambio tienen toda la pinta de fracasar. Así que su último recurso se llama Michelle, una integrante de la banda de música que resulta ser todo un prodigio.',NULL,'2009-06-05 14:42:34','2009-06-05 14:42:34',2,NULL,'http://img.cinemaki.com/m/240/2249.jpg',NULL,95,2),
 (2473,'Cruzada','','Balian, es un joven herrero francés quien ha perdido a su familia y está a punto de perder la fe. El destino llega en busca de Balian de la mano de Godfrey de Ibelin, un cruzado que está brevemente en su hogar en Francia después de haber luchado para mantener la paz en la Tierra Santa. Revelando ser el padre de Balian, Godfrey le muestra el verdadero significado de la Caballería al tiempo en que lo lleva de viaje hacia la mítica Jerusalén. A la muerte inesperada de Godfrey, éste le hereda a su hijo su espada y el juramento sagrado de proteger a los desvalidos, salvaguardar la paz y trabajar a favor de la armonía entre las religiones y las culturas. Balian toma la espada y da el paso hacia la historia.',NULL,'2009-06-05 14:42:34','2009-06-05 14:42:34',2,NULL,'http://img.cinemaki.com/m/240/2746.jpg',NULL,142,2),
 (2474,'Shrek 2','','Después de enfrentarse al malvado Lord Farquaad para ganar la mano de la Princesa Fiona, Shrek ahora se enfrenta a su mayor reto: los suegros. Shrek y la Princesa Fiona regresan de su luna de miel y reciben una invitación para visitar al Rey y a la Reina del reino de Un Lugar Muy Lejano. Con el Burro como compañía, los recién casados emprenden el viaje. Los reyes anticipan con regocijo el regreso a casa de Fiona y su nuevo príncipe. Pero nadie pudo haberlos preparado para la apariencia física de su nuevo yerno, sin mencionar cuánto ha cambiado su hija.',NULL,'2009-06-05 14:42:34','2009-06-05 14:42:34',2,NULL,'http://img.cinemaki.com/m/240/2503.jpg',NULL,93,2),
 (2475,'Click: Perdiendo el Control','','Michael Newman (Adam Sandler), un arquitecto muy ocupado que trata de progresar y tener tiempo para su mujer Donna (Kate Beckinsale) y sus dos hijos, decide comprar un control remoto que funcione para todos sus electrodomésticos. Pronto descubre que con él, también puede controlar todo lo que sucede a su alrededor.',NULL,'2009-06-05 14:42:35','2009-06-05 14:42:35',2,NULL,'http://img.cinemaki.com/m/240/2649.jpg',NULL,107,2),
 (2476,'Traffic','','El juez Robert Wakefield es nombrado por el Presidente de los Estados Unidos para supervisar los grupos de lucha contra la droga y su coordinación con las autoridades de México. Sin embargo su entusiasmo inicial por la posición de prestigio alcanzada se acabará cuando se dé cuenta de que su hija adolescente Caroline, de 16 años, es adictahecho. Mientras tanto, al sur de la frontera, el agente mexicano Javier Rodriguez inicia su propia batalla contra la droga.',NULL,'2009-06-05 14:42:35','2009-06-05 14:42:35',2,NULL,'http://img.cinemaki.com/m/240/2610.jpg',NULL,147,2),
 (2477,'American Pie 3: La Boda','','Jim Y Michelle están a punto de casarse, ella quiere que la boda sea perfecta y Jim va a esforzarse lo más posible para que así sea. A su vez, Stifler y Finch van a pelear por conquistar a Cadence, la hemana de Michelle.\r\nTendrán que pasar por muchos inconvenientes previos a la boda.',NULL,'2009-06-05 14:42:35','2009-06-05 14:42:35',2,NULL,'http://img.cinemaki.com/m/240/2251.jpg',NULL,96,2),
 (2478,'Harry Potter y el Prisionero de Azkabán','','Harry Potter y sus amigos vuelven al colegio Hogwarts para cursar su tercer año de estudios y se ven involucrados en el misterio de la fuga de la prisión para magos de Azkaban de Sirius Black, un peligroso mago que fue cómplice de Lord Voldemort y que buscará vengarse de Harry Potter.',NULL,'2009-06-05 14:42:35','2009-06-05 14:42:35',2,NULL,'http://img.cinemaki.com/m/240/2708.jpg',NULL,141,2),
 (2479,'Los Fockers','','Greg Focker está en paz con sus suegros Jack y Dina Byrnes. Pero cuando todo parece estar en orden, los aprehensivos padres de Pam conocen a los excesivamente relajados padres de Greg, Bernie y Roz. Ambas familias son totalmente opuestas y no importa cuanto se esfuercen Pam y Greg para reconciliarlos. Ahora todo apunta hacia el desastre.',NULL,'2009-06-05 14:42:35','2009-06-05 14:42:35',2,NULL,'http://img.cinemaki.com/m/240/2509.jpg',NULL,115,2),
 (2480,'Más Rápido y Más Furioso','','Brian O\'Conner (Paul Walker), un policía caído en desgracia, fue un adicto a la velocidad y ahora está pagando el precio por eso. Tal y como lo ven sus antiguos jefes y los altos mandos del FBI, este agente de incógnito echó a perder una de las investigaciones más importantes que habían emprendido. Ahora ha pasado el tiempo, O\'Conner está en otra ciudad y tiene una última oportunidad. A los federales de Miami les está costando mucho enchironar a Carter Verone (Cole Hauser), un empresario que utiliza su negocio de importación y exportación como blanqueo de dinero. Aduanas lleva un año sometiendo a Verone a una estricta vigilancia y lo único que han podido establecer es su relación con las carreras callejeras ilegales. El tiempo se acaba y los agentes deciden llamar a O\'Conner para que haga lo que sabe hacer mejor que nadie: volver a infiltrarse entre los conductores. Pero éste pondrá ciertas condiciones.',NULL,'2009-06-05 14:42:35','2009-06-05 14:42:35',2,NULL,'http://img.cinemaki.com/m/240/2519.jpg',NULL,107,2),
 (2481,'La Leyenda del Zorro','','Tras ayudar con su espada a que California se convierta en el estado número 31 de la Unión, el Zorro (Antonio Banderas) debe cumplir la promesa que le hizo a su mujer Elena (Catherine Zeta-Jones): abandonar su identidad secreta y llevar una vida normal como Alejandro de la Vega.',NULL,'2009-06-05 14:42:35','2009-06-05 14:42:35',2,NULL,'http://img.cinemaki.com/m/240/2609.jpg',NULL,125,2),
 (2482,'El Señor de los Anillos: La Comunidad del Anillo','','En la Tierra Media, el Señor Oscuro Saurón creó los Grandes Anillos de Poder, forjados por los herreros Elfos. Tres para los reyes Elfos, siete para los Señores Enanos, y nueve para los Hombres Mortales. Secretamente, Saurón también forjó un anillo maestro, el Anillo Único, que contiene en sí el poder para esclavizar a toda la Tierra Media. Con la ayuda de un grupo de amigos y de valientes aliados, Frodo emprende un peligroso viaje con la misión de destruir el Anillo Único. Pero el Señor Oscuro Sauron, quien creara el Anillo, envía a sus servidores para perseguir al grupo. Si Sauron lograra recuperar el Anillo, sería el final de la Tierra Media.',NULL,'2009-06-05 14:42:35','2009-06-05 14:42:35',2,NULL,'http://img.cinemaki.com/m/240/1997.jpg',NULL,178,2),
 (2483,'Piratas del Caribe: La Maldición del Perla Negra','','La historia transcurre en el Mar Caribe en el siglo XVIII. El aventurero capitán Jack Sparrow (Johnny Depp) recorre las aguas caribeñas. Pero sus andanzas terminan cuando su enemigo, el Capitán Barbossa (Geoffrey Rush) le roba su barco, el Perla Negra, y ataca la ciudad de Port Royal, secuestrando a Elizabeth Swann (Keira Knightley), hija del Gobernador (Jonathan Pryce). Will Turner (Orlando Bloom), el amigo de la infancia de Elizabeth, se une a Jack para rescatarla y recuperar el Perla Negra. Pero el prometido de Elizabeth, Comodoro Norrington (Jack Davenport) los persigue a bordo del HMS Dauntless. \r\nBarbossa y su tripulación son víctimas de un conjuro por el que están condenados a vivir eternamente, y a transformarse cada noche en esqueletos vivientes, en fantasmas guerreros. El conjuro sólo puede romperse si devuelven lo que robaron: una pieza de oro azteca, y saldan una deuda de sangre.',NULL,'2009-06-05 14:42:35','2009-06-05 14:42:35',2,NULL,'http://img.cinemaki.com/m/240/2261.jpg',NULL,143,2),
 (2484,'Rocky V','','Rocky, arruinado y retirado del boxeo, vuelve a su barrio. Allí conoce a un joven con aptitudes para boxear y decide entrenarlo.',NULL,'2009-06-05 14:42:35','2009-06-05 14:42:35',2,NULL,'http://img.cinemaki.com/m/240/2541.jpg',NULL,104,2),
 (2485,'Una Película de Miedo','','Comedia que parodia algunos de los films de éxito de los últimos años.',NULL,'2009-06-05 14:42:35','2009-06-05 14:42:35',2,NULL,'http://img.cinemaki.com/m/240/2552.jpg',NULL,88,2),
 (2486,'Érase Una Vez en México','','Sands (Johnny Depp) es un peculiar agente de la CIA enviado a México; su misión, segun él, es mantener el equilibrio en el país. Tras enterarse del plan de Barillo (Willem Dafoe) de asesinar al presidente mexicano por medio del general Marquez (Gerardo Vigil), Sands buscará al legendario El Mariachi (Antonio Banderas), quien tiene una cuenta pendiente con Marquez y que lleva ahora una vida de aislamiento, para acabar con éste.',NULL,'2009-06-05 14:42:36','2009-06-05 14:42:36',2,NULL,'http://img.cinemaki.com/m/240/2576.jpg',NULL,102,2),
 (2487,'La Estafa Maestra','','El plan no tenía fallas, el robo se ejecutó a la perfección, la huída no tuvo tropiezos. La única amenaza que el genial ladrón Charlie Croker (Mark Wahlberg) nunca imaginó fue la traición de un miembro de su propio equipo. Luego de completar el robo de un cargamento de lingotes de oro de un resguardado palacio en Venecia, Charlie y sus compañeros no se esperan la traición de uno de ellos. Ahora el objetivo no es dividir el botín, si no vengarse.',NULL,'2009-06-05 14:42:36','2009-06-05 14:42:36',2,NULL,'http://img.cinemaki.com/m/240/2451.jpg',NULL,111,2),
 (2488,'Sexto Sentido','','El Dr. Malcom Crowe es un conocido psicólogo infantil obsesionado con el doloroso recuerdo de un joven paciente desequilibrado al que fue incapaz de ayudar. Cole Sear es un aterrorizado y confuso niño de ocho años que necesita tratamiento. El Dr. Crowe ve la oportunidad de redimirse haciendo todo lo posible por ayudarlo. Sin embargo, Malcom no está preparado para conocer la terrible verdad acerca del don sobrenatural de su paciente. El sexto sentido de Cole desvelará el intenso y escalofriante final de esta sorprendente película.',NULL,'2009-06-05 14:42:36','2009-06-05 14:42:36',2,NULL,'http://img.cinemaki.com/m/240/2166.jpg',NULL,107,2),
 (2489,'Charlie y la Fábrica de Chocolate','','La mayoría de las noches en el hogar de los Bucket, la cena es un tazón de sopa de repo-llo aguada que el joven Charlie comparte con mucho gusto con su familia. Todas las noches, lo último que Charlie ve desde su ventana es la gran fábrica, y se queda dormido soñando con lo que habrá dentro. Desde hace casi quince años, nadie ha visto entrar o salir de la fábrica a un solo trabajador, y tampoco han visto al propio Willy Wonka (Johnny Depp),  sin embargo, misteriosamente, se siguen elaborando grandes cantidades de chocolate que se envían a tiendas de todo el mundo. Un día Willy Wonka decide abrir su famosa fábrica y revelar todos sus secretos y su magia a cinco afortunados niños que encuentren unos billetes dorados escondidos en el interior de cinco chocolatinas Wonka elegidas al azar. Nada haría más feliz a la familia de Charlie que verlo ganar, pero tiene muy pocas posibilidades, ya que sólo pueden comprar una chocolatina al año, para su cumpleaños.',NULL,'2009-06-05 14:42:36','2009-06-05 14:42:36',2,NULL,'http://img.cinemaki.com/m/240/2139.jpg',NULL,115,2),
 (2490,'Harry Potter y el Cáliz de Fuego','','Harry y sus amigos vivirán nuevas aventuras: La Copa Internacional de Quidditch, el inicio de la atracción por Cho Chang, y un año de aún más magia, cuando una gran sorpresa los obligará a enfrentarse a muchos desafíos temibles. El torneo de magia para tres escuelas, y el temido regreso Lord Voldemort.',NULL,'2009-06-05 14:42:36','2009-06-05 14:42:36',2,NULL,'http://img.cinemaki.com/m/240/2496.jpg',NULL,157,2),
 (2491,'Inframundo 3','','Tercer episodio de la saga “Inframundo”, es una precuela que busca explicar el origen del histórico enfrentamiento entre una raza de vampiros aristocráticos llamados Death Dealers y sus esclavos, los Lycans.\r\nVampiros y hombres lobo desataron una guerra que se mantiene desde la Edad de la Oscuridad. El condenado romance entre Lucian (un hombre lobo esclavo de los vampiros) y Sonja (vampira, hija de Viktor, el vampiro más viejo) desata una serie de eventos impensables que sellan el trágico destino heredado de aquellos a quienes siguen.',NULL,'2009-06-05 14:42:36','2009-06-05 14:42:36',2,NULL,'http://img.cinemaki.com/m/240/1626.jpg','http://www.entertheunderworld.com/',92,2),
 (2492,'Bridget Jones: Al Borde de la Razón','','Durante seis gloriosas semanas (y 71 relaciones sexuales estáticas) ha sido la enamorada del abogado exquisitamente perfecto Mark Darcy y nada puede ser mejor. ¿O sí? A pesar de la aparente devoción de Darcy, Bridget todavía tiene interrogantes pendientes sobre la vida, el amor y la forma más apropiada de guardar la ropa interior. Ahora que finalmente ha encontrado a su hombre, Bridget se enfrenta al insondable reto de lograr que la relación funcione. No puede dejar de preguntarse: ¿Exactamente qué es lo que sucede después del \"y vivieron por siempre felices\".... Y precisamente cuando está comenzando a resolverlo todo, llega la competencia: la nueva colega de Darcy, una espectacular chica de largas piernas que siempre dice la frase adecuada. Súbitamente los celos, las dudas y la tentación personificada por el antiguo jefe de Bridget, el roba corazones y mujeriego Daniel Cleaver amenazan con convertir el sueño de Bridget en un laberinto cómico de malos consejos, malentendidos tontos y desastres totales como sólo le pueden suceder a ella.',NULL,'2009-06-05 14:42:36','2009-06-05 14:42:36',2,NULL,'http://img.cinemaki.com/m/240/2295.jpg',NULL,108,2),
 (2493,'Se Busca','','Un joven quien considera que su vida es mediocre, es reclutado un día por una organización de asesinos, que le informa que su padre ha muerto un día antes. El había sido abandonado al nacer. Desde ese momento comienza un entrenamiento muy fuerte, para poder localizar a los asesinos de su padre, y al mismo tiempo poder conocer sobre su pasado',NULL,'2009-06-05 14:42:36','2009-06-05 14:42:36',2,NULL,'http://img.cinemaki.com/m/240/168.jpg',NULL,110,2),
 (2494,'El Transportador 3','','Frank Martin (Jason Statham) se pone los guantes de chofer para una tercera misión. Esta vez, deberá transportar a Valentina, la hija secuestrada de un funcionario del gobierno ucraniano, desde Marsella a Odessa en el Mar Negro. En el camino, deberá lidiar con matones que quieren interceptar la segura entrega de la chica y evitar que sus sentimientos se interpongan en su misión.',NULL,'2009-06-05 14:42:36','2009-06-05 14:42:36',2,NULL,'http://img.cinemaki.com/m/240/724.jpg','http://www.transporter3film.com/',100,2),
 (2495,'Misión Imposible III','','En esta tercera misión, el agente secreto Ethan Hunt viaja a China para encontrarse cara a cara con un sádico y peligroso contrabandista de armas, mientras trata de preservar su identidad secreta para proteger a su novia de los peligros de su arriesgada y escondida profesión.',NULL,'2009-06-05 14:42:36','2009-06-05 14:42:36',2,NULL,'http://img.cinemaki.com/m/240/2597.jpg',NULL,126,2),
 (2496,'Rocky','','Rocky Balboa es un desconocido boxeador a quien se le ofrece la posibilidad de pelear por el título mundial de los pesos pesados. Con mucha fuerza de voluntad, Rocky se preparará concienzudamente para este combate, y también para los cambios que producirá en su vida.',NULL,'2009-06-05 14:42:36','2009-06-05 14:42:36',2,NULL,'http://img.cinemaki.com/m/240/2537.jpg',NULL,119,2),
 (2497,'Loco Por Mary','','Ted Strohehmann ha vivido angustiado durante 14 años de su vida. La razón de su desgracia no es otra que la famosa Mary Jensen, la chica a la que todos desean y con la que por fin consigue tener una cita en la fiesta de graduación. Pero un desgraciado accidente con el cierre de su pantalón arruinó este momento tan deseado. Ahora parece que tendrá otra oportunidad.',NULL,'2009-06-05 14:42:36','2009-06-05 14:42:36',2,NULL,'http://img.cinemaki.com/m/240/2507.jpg',NULL,119,2),
 (2498,'El Juego del Miedo II','','El perturbador Jigsaw regresa dispuesto a continuar con sus terroríficos juegos, en los cuales la muerte es la principal protagonista. Todo comienza cuando se descubre un asesinato, cuya víctima presenta signos característicos de Jigsaw, lo que lleva a que el agente Eric Mathews vaya en su búsqueda. La investigación lo conduce hasta el asesino, quien gustosamente se deja atrapar para poder consumar su plan, en el que Mathews también está inmerso.',NULL,'2009-06-05 14:42:36','2009-06-05 14:42:36',2,NULL,'http://img.cinemaki.com/m/240/2517.jpg',NULL,93,2),
 (2499,'La Pasión de Cristo','','Recrea los sucesos agonizantes y finalmente redentores de las últimas doce horas de la vida de Cristo, y el legado que ha sido reflejado durante los últimos dos mil años.',NULL,'2009-06-05 14:42:37','2009-06-05 14:42:37',2,NULL,'http://img.cinemaki.com/m/240/2903.jpg',NULL,124,2),
 (2500,'Una Mente Brillante','','El eminente matemático Dr. Nash descubrió una teoría cuya aplicación revolucionó varios campos de la ciencia, pero su prodigiosa mente también le causó una terrible enfermedad.',NULL,'2009-06-05 14:42:37','2009-06-05 14:42:37',2,NULL,'http://img.cinemaki.com/m/240/2248.jpg',NULL,135,2),
 (2501,'Los Ángeles de Charlie: Al límite','','Los ángeles se preparan para una misión rutinaria de incógnito para recuperar dos anillos de plata perdidos. No son anillos ordinarios, pues contienen valiosa información encriptada que revela las nuevas identidades de las personas pertenecientes al Programa Federal de Protección de Testigos. Cuando los testigos empiezan a morir, sólo los Ángeles, haciendo uso de su experiencia como maestras del disfraz, el espionaje y las artes marciales, pueden detener al criminal.',NULL,'2009-06-05 14:42:37','2009-06-05 14:42:37',2,NULL,'http://img.cinemaki.com/m/240/2646.jpg',NULL,106,2),
 (2502,'Apocalypto','','Historia ambientada en tiempos remotos del imperio maya. Cuando la idílica existencia de unos miembros de la civilización maya es brutalmente interrumpida por el ataque de una fuerza invasora, un hombre emprende un arriesgado viaje a un mundo regido por el miedo y la opresión en el que le espera un incierto final. Debido a un giro del destino y espoleado por el amor a su esposa y su familia, emprenderá el regreso a su hogar en un desesperado esfuerzo por preservar su forma de vida.',NULL,'2009-06-05 14:42:37','2009-06-05 14:42:37',2,NULL,'http://img.cinemaki.com/m/240/2112.jpg',NULL,139,2),
 (2503,'Los Ángeles de Charlie','','El multimillonario Charlie,  es el jefe de Natalie, Dylan y Alex, tres mujeres expertas en artes marciales, en disfraces y en la más avanzada tecnología. Las tres deberán ocuparse de un caso en el que el genio de la informática Eric Knox probablemente haya sido secuestrado por su competidor Roger Corwin, y que tendría como consecuencia la destrucción de la intimidad de todas las personas del mundo, incluido su misterioso jefe Charlie.',NULL,'2009-06-05 14:42:37','2009-06-05 14:42:37',2,NULL,'http://img.cinemaki.com/m/240/2647.jpg',NULL,98,2),
 (2504,'Philadelphia','','Un joven y prometedor abogado de Philadelphia, Andrew Beckett, es despedido del prestigioso bufete en el que trabaja al conocerse que ha contraído el sida. Decide demandar a la empresa por despido improcedente, pero en un principio ningún abogado acepta defender su caso.',NULL,'2009-06-05 14:42:37','2009-06-05 14:42:37',2,NULL,'http://img.cinemaki.com/m/240/2358.jpg',NULL,125,2),
 (2505,'Analízate','','Paul Vitti está cerca de cumplir su condena en Sing Sing, y los agentes del FBI le controlar para seguir su comportamiento. Día tras día observan que Paul anda por su celda en un estado semicatatónico, e incluso le da por cantar. ¿Está Vitti teniendo un ataque de nervios por las amenazas contra su vida realizadas por una familia rival o su extraño comportamiento es una estratagema para liberarse antes de la cárcel? El FBI no está seguro, y tampoco su antiguo psicoterapeuta Ben Sobel, que es llamado como consultor en el caso.',NULL,'2009-06-05 14:42:37','2009-06-05 14:42:37',2,NULL,'http://img.cinemaki.com/m/240/2729.jpg',NULL,96,2),
 (2506,'El Laberinto del Fauno','','Año 1944, tras la victoria de Franco. La niña Ofelia (Ivana Baquero) y su madre, Carmen (Ariadna Gil), convaleciente a causa de un avanzado estado de gestación, se trasladan hasta un pequeño pueblo en el que se encuentra destacado el nuevo marido de Carmen, Vidal (Sergi López), un cruel capitán del ejército franquista por el que la niña no siente ningún afecto. Su misión es acabar con los últimos vestigios de la resistencia republicana que permanecen escondidos en los montes de la zona. También allí se encuentra Mercedes (Maribel Verdú)una joven que se encuentra a cargo de los demás miembros del servicio y el doctor (Álex Angulo) que se hará cargo del delicado estado de salud de Carmen. Una noche, Ofelia descubre las ruinas de un laberinto y allí se encuentra con un fauno (Doug Jones), una extraña criatura que le hace una increíble revelación: Ofelia es en realidad una princesa, última de su especie, a la que los suyos llevan mucho tiempo esperando. Para poder regresar a su mágico reino, la niña deberá enfrentarse a tres pruebas que poco a poco irá superando.',NULL,'2009-06-05 14:42:37','2009-06-05 14:42:37',2,NULL,'http://img.cinemaki.com/m/240/2216.jpg',NULL,112,2),
 (2507,'La Llamada','','Rachel Keller (Naomi Watts) es una jóven periodista que tras la inexplicable muerte de la niñera de su pequeño hijo decide investigar sus causas. Todo la lleva a encontrar un misterioso cassette de video cuyo siniestro contenido no solo le generará mas incógnitas sino que pondrá en peligro su propia vida y la de su hijo.',NULL,'2009-06-05 14:42:37','2009-06-05 14:42:37',2,NULL,'http://img.cinemaki.com/m/240/2521.jpg',NULL,115,2),
 (2508,'El Transportador','','El ex operador de Fuerzas Especiales, Frank Martin vive lo que parece ser una vida tranquila a orillas del Mediterráneo francés, donde presta sus servicios como un transportador mercenario que traslada bienes humanos, o de cualquier tipo, de un lugar a otro. Sin preguntas de por medio. Frank, en su Mercedes equipado lleva a cabo misiones secretas y a veces peligrosas. Se apega a un estricto juego de reglas que nunca rompe. Regla Número Uno: Nunca modifiques el trato. Regla Número Dos: Omitir nombres, Frank no quiere saber para quién trabaja o qué es lo que transporta. Regla Número Tres: Nunca ver qué hay dentro del paquete.',NULL,'2009-06-05 14:42:37','2009-06-05 14:42:37',2,NULL,'http://img.cinemaki.com/m/240/2110.jpg',NULL,92,2),
 (2509,'Scary Movie 5','','La película hará parodias de The Descent, Serpientes en el Avión, La Maldición y Silent Hill, entre otras.',NULL,'2009-06-05 14:42:37','2009-06-05 14:42:37',2,NULL,'http://img.cinemaki.com/m/240/2409.jpg',NULL,NULL,2),
 (2510,'Virgen a los 40','','Andy es un hombre adorable que decide seguir los desastrosos consejos que le dan sus amigos, para no dejar pasar la oportunidad de encontrar lo que lleva tantos años buscando. Jay y Cal, compañeros de trabajo de Andy, deciden acabar de una vez por todas con una sequía de cuarenta años. Tres mujeres se unen a ese club de descerebrados: Beth, la librera dispuesta a todo que quizá consiga subir el autoestima de Andy; Nicky, la chica que se emborracha y que seguro cae rendida en los brazos de Andy; y Trish, la amable mujer que trabaja enfrente y que por fin deja de ver a Andy como una simple curiosidad.',NULL,'2009-06-05 14:42:37','2009-06-05 14:42:37',2,NULL,'http://img.cinemaki.com/m/240/2871.jpg',NULL,116,2),
 (2511,'Cómo Perder a Un Hombre en 10 Días','','Andie Anderson escribe la columna \"How To\" en la revista Composure. Debe terminar un reportaje muy poco usual y tiene muy poco tiempo para conseguirlo. Se trata de escribir, basándose en experiencias de primera mano, sobre todas esas cosas que hacen las mujeres para alejar a los hombres de su lado sin querer y debe tenerlo listo en diez días. Su misión es encontrar a un chico, hacer que se enamore de ella y luego provocar todos los errores típicos que pueden suceder cuando se tiene una cita, para que el chico la deje. El hombre que elige para enamorar es el cotizado soltero Benjamin Barry, que precisamente acaba de apostar con el director de la agencia de publicidad en donde trabaja que es capaz de hacer que una mujer se enamore de él en diez días.',NULL,'2009-06-05 14:42:38','2009-06-05 14:42:38',2,NULL,'http://img.cinemaki.com/m/240/2604.jpg',NULL,116,2),
 (2512,'Pecados Capitales','','Un asesino en serie mata siguiendo el patrón de los siete pecados capitales. La mente privilegiada del criminal siempre se adelanta en la labor de dos policías que le siguen la pista. Los cuerpos de las víctimas, sobre los que el asesino se ensaña de manera impúdica, se convertirán para los policías en un enigma que les obligará a viajar al horror y la barbarie más absoluta.',NULL,'2009-06-05 14:42:38','2009-06-05 14:42:38',2,NULL,'http://img.cinemaki.com/m/240/1939.jpg',NULL,127,2),
 (2513,'La Leyenda del Jinete Sin Cabeza','','Un policía de Nueva York que utiliza avanzados métodos de investigación es enviado al pequeño pueblo de Sleepy Hollow para descubrir qué hay de verdad en la leyenda de un jinete sin cabeza que aterroriza a los habitantes del lugar.',NULL,'2009-06-05 14:42:38','2009-06-05 14:42:38',2,NULL,'http://img.cinemaki.com/m/240/2578.jpg',NULL,105,2),
 (2514,'Infiltrados','','El Departamento de Policía de Massachussets se ve envuelto en una guerra campal para derrotar a la mayor banda de crimen organizado de la ciudad. La estrategia es terminar con el reinado del poderoso jefe de la mafia Frank Costello (Jack Nicholson) desde dentro. A un joven novato, Billy Costigan (Leonardo DiCaprio), criado en el sur de Boston, se le encarga infiltrarse en la mafia dirigida por Costello. Mientras Billy intenta ganarse la confianza de Costello, otro joven policía que también ha surgido de las calles del sur, Colin Sullivan (Matt Damon), sube rápidamente de categoría dentro de la policía del Estado. Colin, que se ha ganado un buen puesto en la unidad de Investigaciones Especiales, forma parte de un grupo de oficiales de élite cuya misión es acabar con Costello. Pero lo que sus superiores no saben es que Colin trabaja para Costello, y le mantiene un paso por delante de la policía.Billy y Colin se encuentran en peligro constante de que les descubran y queden expuestos al enemigo, cada uno debe revelar la identidad del otro para salvarse a sí mismo.',NULL,'2009-06-05 14:42:38','2009-06-05 14:42:38',2,NULL,'http://img.cinemaki.com/m/240/2097.jpg',NULL,151,2),
 (2515,'Como si Fuera Cierto','','David alquila un pintoresco piso en San Francisco y lo que menos espera es compartirlo. Ya lo tiene casi desordenado a su gusto cuando aparece una bonita chica llamada Elizabeth, que insiste en que el departamento es suyo. David piensa que ha habido un enorme malentendido, hasta que Elizabeth desaparece tan misteriosamente como ha llegado. Convencido que se trata de un fantasma, David intenta ayudar a Elizabeth a pasar \"al otro lado\". A pesar que Elizabeth descubre que tiene ciertas cualidades, como la de atravesar paredes, no piensa ir a ninguna parte porque cree que sigue viva. Mientras que juntos empiezan a investigar para descubrir quién es Elizabeth y por qué ha llegado a este punto, la relación se convierte en amor.',NULL,'2009-06-05 14:42:38','2009-06-05 14:42:38',2,NULL,'http://img.cinemaki.com/m/240/2301.jpg',NULL,95,2),
 (2516,'300','','Adaptación del cómic de Frank Miller (autor del cómic de \"Sin City\") sobre la famosa batalla de las Termópilas, ocurrida en el año 480 A.C. durante las Guerras Médicas, en las que Jerjes, emperador de Persia, trataba de conquistar Grecia. Atenas consiguió convencer a Leónidas I, rey de Esparta, para que participase en la guerra contra los persas. Así, el rey Leonidas (Gerard Butler) y 300 espartanos se enfrentaron a un inmensamente superior ejército persa.',NULL,'2009-06-05 14:42:38','2009-06-05 14:42:38',2,NULL,'http://img.cinemaki.com/m/240/2404.jpg',NULL,117,2),
 (2517,'Austin Powers in Goldmember','','El agente Austin Powers se enfrenta de nuevo al doctor Maligno y a su cómplice, Mini-Yo; que tras escapar de una cárcel de máxima seguridad obliga a Austin Powers a ponerse de nuevo en acción. Miembro de Oro es un misterioso personaje que ayuda al doctor Maligno a idear el plan para dominar el mundo. El malvado viajará en el tiempo y secuestrará al padre del protagonista.',NULL,'2009-06-05 14:42:38','2009-06-05 14:42:38',2,NULL,'http://img.cinemaki.com/m/240/2506.jpg',NULL,94,2),
 (2518,'Harry Potter y la Piedra Filosofal','','Versión cinematográfica del libro escrito por J.K. Rowling. Harry Potter se entera, el día de su décimo primer cumpleaños, de que es el hijo huérfano de dos poderosos hechiceros, y que él mismo también posee poderes mágicos. En el colegio Hogwarts de Magia y Hechicería, junto con otros niños que también tienen  poderes y donde aprenderán todo lo necesario para ser magos, Harry se embarcará en la aventura de su vida.',NULL,'2009-06-05 14:42:38','2009-06-05 14:42:38',2,NULL,'http://img.cinemaki.com/m/240/2401.jpg',NULL,152,2),
 (2519,'El Señor de los Anillos: Las Dos Torres','','La Compañía del Anillo se ha disuelto. El portador del anillo Frodo y su fiel amigo Sam se dirigen hacia Mordor para destruir el Anillo Único y acabar con el poder de Sauron. Mientras, y tras la dura batalla contra los orcos donde cayó Boromir, el hombre Aragorn, el elfo Legolas y el enano Gimli intentan rescatar a los medianos Merry y Pipin, secuestrados por los ogros de Mordor. Por su parte, Saurón y el traidor Sarumán continúan con sus planes en Mordor, en espera de la guerra contra las razas libres de la Tierra Media.',NULL,'2009-06-05 14:42:38','2009-06-05 14:42:38',2,NULL,'http://img.cinemaki.com/m/240/2092.jpg',NULL,179,2),
 (2520,'El Día Después de Mañana','','Al climatólogo Jack Hall le preocupa sobremanera estar al borde de una nueva Era de Hielo. La investigación que lleva a cabo le indica que el calentamiento global podría provocar un cambio abrupto y catastrófico en el clima del planeta. El derretimiento de los casquetes polares ha aumentado el nivel de los océanos y alterado las corrientes que estabilizan nuestro sistema atmosférico. Un suceso de esta índole sucedió hace diez mil años y ahora podría repetirse si las autoridades no actúan rápidamente.\r\nSam, su hijo de diecisiete años, se encuentra en Nueva York, refugiado en la Biblioteca Pública de Manhattan. Cuando comienzan las evacuaciones Jack se dirige a Nueva York para salvar a su hijo, pero ni siquiera él está preparado para lo que está a punto de suceder.',NULL,'2009-06-05 14:42:38','2009-06-05 14:42:38',2,NULL,'http://img.cinemaki.com/m/240/2523.jpg',NULL,124,2),
 (2521,'El Día que La Tierra se Detuvo','','El dia que la tierra se detuvo es la version contemporanea de la pelicula que Fox hizo en 1951. Keanu Reeves protagoniza a Klaatu, el famoso alienígena que viene a la Tierra para advertir a todo los líderes mundiales, que si lo humanos no terminan con la violencia enfrentarán el fin de la especie.',NULL,'2009-06-05 14:42:38','2009-06-05 14:42:38',2,NULL,'http://img.cinemaki.com/m/240/962.jpg','http://www.thedaytheearthstoodstillmovie.com/',NULL,2),
 (2522,'Moulin Rouge','','París 1900. Satine, la estrella más brillante del Moulin Rouge, encandila a toda la ciudad con sus bailes llenos de sensualidad y su enorme belleza. Atrapada entre el amor de Christian, un joven escritor, y la obsesión del duque, lucha por hacer realidad su sueño de convertirse en actriz. Pero, en un mundo en el que vale todo excepto enamorarse, nada es fácil.',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/2565.jpg',NULL,127,2),
 (2523,'Celular','','Jessica Martin es una madre y profesora de ciencias quien resulta víctima de un secuestro por cinco desconocidos entre los que se encuentran Ethan Greer.\r\nEn el lugar donde la mantienen cautiva consigue hacer funcionar un teléfono roto y en un intento desesperado hace una llamada. Del otro lado responde Ryan,un joven totalmente desconocido quien descubre de repente que es la última esperanza de Jessica.',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/2833.jpg',NULL,94,2),
 (2524,'Matrix','','Un programador pirata recibe un día una misteriosa visita... \r\nExisten dos realidades: una que consiste en la vida que vivimos cada día, y otra que se encuentra detrás de ella. Una es un sueño. La otra The Matrix. ¿Has tenido alguna vez un sueño del que estuvieras muy seguro de que era real? Neo, esta buscando desesperadamente la verdad sobre The Matrix, algo de lo que ha oído hablar sólo en susurros, algo misterioso y desconocido. Neo está seguro de que algo tiene un control inimaginable y siniestro sobre su vida.',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/1923.jpg',NULL,136,2),
 (2525,'El Silencio de los Inocentes','','El FBI busca a un asesino en serie, apodado Buffalo Bill, que mata a sus víctimas, todas ellas adolescentes, después de prepararlas minuciosamente y arrancarles la piel. Para poder atraparlo contactan con Clarice Starling, una brillante licenciada universitaria, experta en conductas psicópatas, que aspira a formar parte del FBI. Siguiendo las instrucciones de su jefe, Jack Crawford, Clarice visita la cárcel de alta seguridad donde el gobierno mantiene encerrado a Hanibal Lecter, antiguo psicoanalista y asesino, dotado de una inteligencia superior a la normal. Su misión será intentar sacarle información sobre los patrones de conducta de \"Buffalo Bill\".',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/1924.jpg',NULL,118,2),
 (2526,'Si señor!','','En la película Si!, Jim Carrey es Carl Allen, un hombre cuya vida no tiene rumbo, hasta que se inscribe en un curso de Auto ayuda basado en un simple pacto: \"Decir si a todo...y nada\". Liberar el poder del SI transforma la vida de Carl en forma increíble e inesperada, obteniendo un ascenso en el trabajo y la apertura de un nuevo romance.',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/990.jpg','http://www.yesisthenewno.com/',104,2),
 (2527,'Los Rompebodas','','Los abogados especializados en divorcios John Beckwith y Jeremy Grey son socios y amigos de toda la vida que comparten un pasatiempo único: les gusta asistir a bodas sin estar invitados. El carismático dúo aplica sus reglas para colarse en los casamientos y así conocer mujeres. Jeremy se entera que la hija del Secretario del Tesoro de la Nación, William Cleary, se casa en lo que será el evento social más relevante del año en Washington DC. Los amigos no pueden dejar pasar esta oportunidad, por lo tanto ponen la mirada en las damas de honor Claire y Gloria Cleary. Jeremy lleva a cabo su elaborado plan para seducir a Gloria, pero John se ve impedido en su trabajo con Claire, debido a la intromisión de su novio. Imprevistamente, John se enamora de Claire y convence a su amigo de romper las reglas y aceptar la invitación a pasar un fin de semana con la familia Cleary. El dúo atravesará una multitud de obstáculos cómicos, aprendiendo algunas lecciones sobre el amor y las relaciones.',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/2294.jpg',NULL,119,2),
 (2528,'Miss Simpatía 2: Armada y Fabulosa','','Luego de haber alcanzado la fama con el concurso de belleza de Miss Estados Unidos, la agente secreta Gracie Hart, se transformó en la gran sensación del FBI. Sin embargo, las cosas no le han ido muy bien últimamente. Hace poco rompió con su novio y su nueva fama pone en constante riesgo su trabajo de agente. Ya no lo puede seguir haciendo. Por eso, Gracie acepta el único trabajo que su jefe le ofrece, ser la presentadora del programa periodístico \"La nueva cara del FBI\". Gracie no está muy convencida de querer desempeñar ese papel pero, de a poco la idea comienza a agradarle. Cuando los mejores amigos de Gracie, la ganadora del concurso de belleza y el maestro de ceremonias, son secuestrados en Las Vegas, los instintos policiales de Gracie vuelven a ella. Una vez más deberá probar que las apariencias engañan y que cuando se trata de desentrañar un caso difícil, o de ayudar a sus amigos, nada ni nadie podrá evitar que entre en acción.',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/2814.jpg','http://www2.warnerbros.com/misscongeniality2',119,2),
 (2529,'Belleza Americana','','Una inquietante y sorprendente incursión en la vida suburbana norteamericana a través de Lester y su esposa Carolyn, una pareja cuyo matrimonio y vidas lentamente se desmoronan. Su mujer lo odia, su hija lo desprecia y tiene problemas en su trabajo, así que Lester decide cambiar algunas cosas en su existencia; lo que enfurece más a Carolyn y a su hija. Pero también aprende que la libertad total tiene un precio muy alto.',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/2053.jpg',NULL,122,2),
 (2530,'Misión Imposible II','','El agente especial Ethan Hunt tiene una nueva misión: evitar que un despiadado ex-agente y ahora terrorista internacional se apodere de un virus mortal que podría soltar sobre Australia causando millones de víctimas. Para evitarlo, contará otra vez con la inestimable ayuda del genio informático Luther Stickell, del experto conductor Billy Baird y con la presencia de una ladrona internacional Nhye, que en el pasado mantuvo una relación sentimental con el criminal.',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/2596.jpg',NULL,123,2),
 (2531,'Súper Agente 86','','Adaptación de la serie de televisión de los años 60 \"Superagente 86\". Maxwell Smart (Steve Carell) tiene una misión: evitar que la maligna organización conocida como KAOS llegue a dominar el mundo. Cuando la central de la agencia de espías Control norteamericana es atacada, las identidades de sus agentes secretos corren riesgo de ser descubiertas. Al jefe de la agencia (Alan Arkin), no le queda otra opción más que llamar a su siempre listo analista Maxwell Smart. Él siempre soñó con trabajar como espía junto al resuelto agente estrella 23 (Dwayne Johnson). En vez de eso, Smart debe tener como compañera a la amorosa pero letal agente veterana 99 (Anne Hathaway). Con muy poca experiencia en el campo y poquísimo tiempo para hacer todo, Smart—armado tan solo con algunos dispositivos técnicos de espía, y un entusiasmo sin límites – debe tratar de impedir a toda costa que los planes del jefe de KAOS, Siegfried (Terance Stamp), se cumplan.',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/86.jpg','http://wwws.la.warnerbros.com/getsmart/',100,2),
 (2532,'Shakespeare Apasionado','','Londres, 1593. El joven William Shakespeare, precoz talento de la escena londinense, necesita urgentemente romper con la mala fortuna por la que está atravesando su carrera de escritor. Por mucho que lo intenta, y a pesar de la presión que recibe de financieros y dueños de salas de teatro, no consigue concentrarse en la escritura de su nueva obra. Lo que Will necesita es una musa. Así, un romance secreto con la bella Lady Viola hará que sus palabras salgan de su interior como nunca lo habían hecho antes.',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/2796.jpg',NULL,123,2),
 (2533,'El Nuevo Novio de Mi Mamá','','Colin Hanks es un joven agente del FBI que debe seguir los pasos de un ladrón de arte buscado internacionalmente, quien resulta ser el nuevo novio de su madre. Henry debe liderar un equipo con la misión de mantener a este ladrón bajo cuidado.',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/234.jpg',NULL,97,2),
 (2534,'El Juego del Miedo 5','','Hoffman (Costas Mandylor) es la última persona viva para heredar el legado de Jigsaw (Tobin Bell). Pero cuando su secreto se ve amenazado, Hoffman debe iniciar la caza para eliminar todos los cabos sueltos.',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/427.jpg','http://www.officialsaw.com/',92,2),
 (2535,'Ace Ventura: Detective de Mascotas','','El detective Ace Ventura, especializado en rescatar animales secuestrados, recibe el encargo de localizar y rescatar el delfin Copo de Nieve, mascota del equipo de fútbol de Miami, que ha sido secuestrado el día anterior a la gran final que debe disputar el equipo.',NULL,'2009-06-05 14:42:39','2009-06-05 14:42:39',2,NULL,'http://img.cinemaki.com/m/240/2505.jpg',NULL,86,2),
 (2536,'Guerra de los Mundos','','La película muestra la extraordinaria batalla por el futuro de la humanidad a través de los ojos de una familia estadounidense que lucha para sobrevivirla. Ray Ferrier es un trabajador de los muelles, divorciado y padre poco ejemplar. Después que su ex esposa le deja a sus hijos Robbie y Rachel para pasar un fin de semana juntos, una extraña y poderosa tormenta eléctrica desciende sobre ellos. Momentos después, Ray es testigo de un extraordinario hecho que cambiará sus vidas para siempre.',NULL,'2009-06-05 14:42:40','2009-06-05 14:42:40',2,NULL,'http://img.cinemaki.com/m/240/2516.jpg',NULL,116,2);
INSERT INTO `events` (`id`,`title`,`description`,`text`,`thumbnail`,`created_at`,`updated_at`,`sponsor_id`,`price`,`image_url`,`web`,`duration`,`category_id`) VALUES 
 (2537,'Las Crónicas de Narnia: El León, La Bruja y El Arm','','La historia narra las aventuras de cuatro hermanos: Lucy, Edmund, Susan y Peter que, durante la Segunda Guerra Mundial, descubren el mundo de Narnia, al que acceden a través de un armario mágico mientras juegan a las escondidas en la casa de campo de un viejo profesor. En Narnia descubrirán un mundo increíble habitado por animales que hablan, duendes, faunos, centauros y gigantes.',NULL,'2009-06-05 14:42:40','2009-06-05 14:42:40',2,NULL,'http://img.cinemaki.com/m/240/2495.jpg',NULL,140,2),
 (2538,'Toy Story 1 - 3D','','Sin Sinopsis',NULL,'2009-06-05 14:42:40','2009-06-05 14:42:40',2,NULL,'http://img.cinemaki.com/m/240/908.jpg',NULL,81,2),
 (2539,'Rápido y Furioso 3: Reto Tokio','','Sean Boswell es un amante de las carreras clandestinas de automóviles, las utiliza como un escape a su triste realidad. Su pasión a estas arriesgadas competencias le trajo muchos problemas con la ley. Por esa razón, Sean es enviado a vivir con su padre, un militar que reside en Japón. En Tokio descubre que también existen las carreras clandestinas, sin embargo son muy distintas a las norteamericanas. Allí manda el `drifting`, el arte de deslizarse a gran velocidad en una pista con muchas curvas. El desafío es muy grande y el peligro también, pero Sean no piensa en perdérselo.',NULL,'2009-06-05 14:42:40','2009-06-05 14:42:40',2,NULL,'http://img.cinemaki.com/m/240/2520.jpg',NULL,104,2),
 (2540,'Todopoderoso','','Bruce Nolan, un periodista de TV de Nueva York, especializado en intereses humanos está insatisfecho con casi todo en su vida. Al final del peor día de su vida, Bruce enfurecido ridiculiza y se enfada con Dios, y Dios le responde. Aparece ante él y le traslada a Bruce todos sus poderes divinos, lo reta a tomar el gran trabajo y ver si él es capaz de hacer algo mejor.',NULL,'2009-06-05 14:42:40','2009-06-05 14:42:40',2,NULL,'http://img.cinemaki.com/m/240/2513.jpg',NULL,101,2),
 (2541,'El Club de la Pelea','','Jack es un personaje insomne y desesperado por escapar de su fatal y aburrida vida. En un viaje en avión conoce a Tyler Durden, un carismático vendedor de jabón con una filosofía muy particular; Tyler cree que el perfeccionismo es para los débiles y que es la destrucción de uno mismo lo que realmente hace que la vida merezca la pena. Jack y Tyler forman un club de lucha secreto que se convierte en un éxito arrollador.',NULL,'2009-06-05 14:42:40','2009-06-05 14:42:40',2,NULL,'http://img.cinemaki.com/m/240/1783.jpg',NULL,139,2),
 (2542,'Wall-E','','¿Qué ocurriría si la humanidad debiera abandonar la Tierra y alguien se olvidara de apagar al último robot? Tras cientos de solitarios años haciendo aquello para lo que fue construido (limpiar el planeta) WALL E (la abreviatura de Waste Allocation Load Lifter Earth-Class) descubre una nueva misión en su vida (además de recolectar cosas inservibles) cuando se encuentra con un lustroso robot explorador llamado EVA. Ambos viajan a través de la galaxia y desencadenan una de las más excitantes e imaginativas comedias de aventuras que hayan sido llevadas al cine. Junto a WALL-E en este fantástico viaje a través de un universo de visiones jamás imaginadas del futuro, hay un comiquísimo elenco de personajes, entre ellos, una cucaracha mascota y un heroico equipo de robots fallados.',NULL,'2009-06-05 14:42:40','2009-06-05 14:42:40',2,NULL,'http://img.cinemaki.com/m/240/90.jpg','http://asdads',103,2),
 (2543,'James Bond 22, Quantum of Solace','','Quantum of Solace continúa con el alto grado de aventura de James Bond en Casino Royale. Ambientada minutos después del final de esa película, nos muestra a un Bond consumido por la furia y la tristeza luego de la muerte de Vesper Lynd a manos de un cartel de criminales internacionales. 007 lucha contra el deseo de hacer su última misión algo personal. Siguiendo su determinación por encontrar la verdad, Bond y M interrogan a Mr White, quien pone de manifiesto que la organización que chantajeó a Vesper es más compleja y peligrosa de lo que podían imaginarse.',NULL,'2009-06-05 14:42:40','2009-06-05 14:42:40',2,NULL,'http://img.cinemaki.com/m/240/444.jpg','http://www.007.com/',105,2),
 (2544,'Mi Novia Polly','','Reuben Feffer es un asesor analista de riesgos de una importante compañía aseguradora. Vive sacando estadísticas y analizando los riesgos y beneficios de sus decisiones. Recientemente casado, en su luna de miel sorprende a su esposa Lisa en plena infidelidad con el simpático instructor francés de buceo. De regreso a su rutina, Reuben se reencuentra con una antigua compañera de colegio, Polly Prince. Ella vive como si la vida fuera un juego de azar, disfrutando la incertidumbre que una vida no planificada puede dar. Reuben intentará ganarse el amor de Polly y superar los obstáculos que le impiden ser feliz, descubriendo que la vida es arriesgada y el amor también.',NULL,'2009-06-05 14:42:40','2009-06-05 14:42:40',2,NULL,'http://img.cinemaki.com/m/240/2730.jpg',NULL,90,2),
 (2545,'X-Men2','','En medio de un clima de rabia y persecución, el profesor Xavier ha creado un instituto, un refugio, para estos seres poderosos. En este lugar los iniciados son preparados para aceptar y dominar sus habilidades, y ponerlas al servicio de la tolerancia y el combate contra la creciente histeria colectiva que está amenazando con su existencia. Pero la reputación de los mutantes será todavía peor cuando uno de ellos lanza un devastador ataque',NULL,'2009-06-05 14:42:40','2009-06-05 14:42:40',2,NULL,'http://img.cinemaki.com/m/240/2756.jpg',NULL,133,2),
 (2546,'Soy Leyenda','','Robert Neville, el último ser humano con vida en el planeta ha quedado solo en Nuea York. El resto de la humanidad ha desaparecido, quedando unos pocos transformados en zombies sedientos de sangre. Él lucha por sobrevivir y no enloquecer, mientras busca una cura para lograr salvar a la humanidad y que todo vuelva a la normalidad.',NULL,'2009-06-05 14:42:40','2009-06-05 14:42:40',2,NULL,'http://img.cinemaki.com/m/240/2921.jpg',NULL,93,2),
 (2547,'Como Si Fuera la Primera Vez','','Henry (Adam Sandler) es un biólogo marino que siempre inventa excusas para evitar compromisos con las chicas con las que sale. Cuando un día conoce a la chica de sus sueños, Lucy ( Drew Barrymore), aparece un pequeño inconveniente: ella se levanta cada mañana sin recordar nada del día anterior.',NULL,'2009-06-05 14:42:40','2009-06-05 14:42:40',2,NULL,'http://img.cinemaki.com/m/240/2524.jpg',NULL,99,2),
 (2548,'Hulk: El Hombre Increíble','','Bruce Banner vive en las sombras, recorriendo el planeta en busca de un antídoto. En su búsqueda lo atormentan personas hambrientas de guerra, que sólo sueñan con abusar de sus poderes. Tampoco puede librarse de sus deseos de estar junto a la única mujer a la que ha amado, Betty Ross.',NULL,'2009-06-05 14:42:41','2009-06-05 14:42:41',2,NULL,'http://img.cinemaki.com/m/240/2848.jpg',NULL,111,2),
 (2549,'Gladiador','','En el año 185, el Imperio Romano domina el mundo conocido. Tras la victoria sobre los bárbaros, el anciano emperador Marco Aurelio (Richard Harris) decide transferir el poder a Máximo (Russell Crowe), bravo general de sus ejércitos y fiel militar leal al imperio, pero su hijo Cómodo (Joaquin Phoenix) no lo acepta y trata de asesinarlo.',NULL,'2009-06-05 14:42:41','2009-06-05 14:42:41',2,NULL,'http://img.cinemaki.com/m/240/2093.jpg',NULL,155,2),
 (2550,'Kill Bill: Vol. 1','','Uma Thurman es una asesina que, el día de su boda, es atacada por los miembros de la banda de su jefe, Bill -David Carradine-. Sin embargo consigue sobrevivir, aunque queda en coma. Cinco años después la mujer despierta, con un trozo de metal en su cabeza y el deseo de venganza en su corazón.',NULL,'2009-06-05 14:42:41','2009-06-05 14:42:41',2,NULL,'http://img.cinemaki.com/m/240/2243.jpg',NULL,111,2),
 (2551,'Rocky III','','Tras haber defendido el título diez veces, el campeón mundial de boxeo Rocky Balboa (Silvester Stallone) ha decidido retirarse. Sin embargo Clubber Lang (Mr. T), un boxeador muy agresivo que ha ido escalando puestos a base de destrozar a sus rivales, desea ganarle el título. Pese a la negativa de Rocky, Clubber consigue provocarlo para que acepte el desafío, y esta vez el resultado del combate se presume bastante incierto.',NULL,'2009-06-05 14:42:41','2009-06-05 14:42:41',2,NULL,'http://img.cinemaki.com/m/240/2539.jpg',NULL,99,2),
 (2552,'Crimen Ferpecto','','Rafael es un tipo seductor y ambicioso. Le gustan las mujeres atractivas, la ropa elegante y el ambiente selecto. Trabaja en unos grandes shoppings, y ha convertido la sección de Señoras en su feudo particular. Rafael aspira a convertirse en el nuevo Jefe de Planta. Su principal rival para ocupar el puesto es Don Antonio, el veterano encargado de la sección de Caballeros. Por fatalidades del destino, Don Antonio muere accidentalmente tras una discusión acalorada. El único testigo del crimen es Lourdes, una horrorosa y obsesiva vendedora, que no duda en chantajear a Rafael para que se convierta en su amante, su marido y su esclavo. Rafael se desespera viendo cómo su mundo sofisticado se degenera poco a poco en un infierno de vulgaridad. Preso de la locura, idea un plan infalible para librarse de Lourdes. Esta vez no puede permitirse ni un error.',NULL,'2009-06-05 14:42:41','2009-06-05 14:42:41',2,NULL,'http://img.cinemaki.com/m/240/2744.jpg',NULL,105,2),
 (2553,'E.T.: El Extraterreste','','Un pequeño visitante de otro planeta se queda en la Tierra cuando su nave se marcha olvidándose de él. Tiene miedo. Está completamente solo. Está a 3.000.000 de años luz de su casa. Aquí se hará amigo de un niño, que lo esconde y lo protege en su casa. Juntos intentarán encontrar la forma de que el pequeño extraterrestre regrese a su planeta... antes de que los científicos y la policía de la Tierra lo encuentren.',NULL,'2009-06-05 14:42:41','2009-06-05 14:42:41',2,NULL,'http://img.cinemaki.com/m/240/2531.jpg',NULL,115,2),
 (2554,'Buscando a Nemo','','La vida en el Arrecife está plagada de peligros pero Marlín, está decidido a proteger a su único hijo Nemo, de todas las amenazas que lo rodean. Pero una mañana cuando éste iba para el colegio, nada más allá de donde debía, y es súbitamente atrapado por un buzo.\r\nAnte esta situación, Marlín emprende una desesperada búsqueda, para recuperar a su hijo. Junto a Dory, una agradable pez cirujano real azul, conforman una despareja dupla que emprende una misión imposible, rescatar a Nemo, que se halla encerrado en la pecera en el consultorio de un dentista en alguna parte de la inmensa ciudad.',NULL,'2009-06-05 14:42:41','2009-06-05 14:42:41',2,NULL,'http://img.cinemaki.com/m/240/2532.jpg',NULL,100,2),
 (2555,'Million Dollar Baby','','El entrenador de boxeo Frankie Dunn (Clint Eastwood) recibe la visita de Maggie Fitzgerald (Hilary Swank), una chica de 30 años que quiere cumplir su sueño de boxear. Frankie no desea asumir el reto de entrenar a la joven, pero la convicción y fuerza de voluntad de la chica le hace cambiar de opinión. Ambos compartirán un duro camino que les pedirá más corazón y coraje del que jamás podrían haber imaginado.',NULL,'2009-06-05 14:42:41','2009-06-05 14:42:41',2,NULL,'http://img.cinemaki.com/m/240/2220.jpg',NULL,132,2),
 (2556,'American Pie 2','','Los protagonistas masculinos de la primera entrega, entonces obsesionados por perder la virginidad, se reencuentran en su pueblo natal tras su primer año en la universidad. Ha pasado un año, y Jim (Jason Biggs), Oz (Chris Klein), Kevin (Thomas Ian Nicholas) y Finch (Eddie Kay Thomas) deciden para pasar juntos el verano. Para poder tener independencia y perseguir mujeres, como tradicionalmente acostumbran, aunque sin éxito, deciden alquilar una casa en la playa. Como el alquiler es algo caro deciden invitar también a Stifler (Seann William Scott), quien además de tener mucho dinero, supuestamente sabe mucho de mujeres, aunque su personalidad es detestable.',NULL,'2009-06-05 14:42:41','2009-06-05 14:42:41',2,NULL,'http://img.cinemaki.com/m/240/2250.jpg',NULL,108,2),
 (2557,'Misión Imposible','','Ethan Hunt es un superespía capaz de resolver cualquier arriesgada situación con la máxima eficacia. Forma parte de un competente equipo dirigido por el agente Jim Phelps, que los ha vuelto a reunir para una dificilísima misión: evitar la venta de un disco robado que contiene información secreta de vital importancia.',NULL,'2009-06-05 14:42:41','2009-06-05 14:42:41',2,NULL,'http://img.cinemaki.com/m/240/2595.jpg',NULL,110,2),
 (2558,'El Coleccionista de Huesos','','Un asesino psicópata va dejando un número de muertes junto a unas pistas que sólo Lincoln Rhyme (Denzel Washington) puede descifrar. Lincoln es un agente de homicidios que quedó tetrapléjico en un accidente mientras resolvía un crimen. Gracias a la policía novata Amelia Donaghy (Angelina Jolie), que puede inspeccionar las escenas del crimen por él, Lincoln intentará ir descifrando las pistas que el asesino va dejando tras sus crimenes.',NULL,'2009-06-05 14:42:41','2009-06-05 14:42:41',2,NULL,'http://img.cinemaki.com/m/240/2347.jpg',NULL,118,2),
 (2559,'King Kong','','Ambientada en la década del 30, Ann Darrow es una actriz de vodevil que se ha quedado sin trabajo durante la época de la gran depresión en Nueva York. Su suerte cambia cuando conoce a Carl Denham, un cineasta que lucha para abrirse camino en el mundo del espectáculo. Formando parte de un grupo de exploradores y realizadores, viajan a una isla misteriosa cerca de Sumatra para investigar la leyenda de un gorila gigante. Una vez allí descubren que King Kong es una realidad viviente en una jungla con criaturas prehistóricas que han estado ocultas durante millones de años.',NULL,'2009-06-05 14:42:41','2009-06-05 14:42:41',2,NULL,'http://img.cinemaki.com/m/240/2498.jpg',NULL,187,2),
 (2560,'El Curioso Caso de Benjamin Button','','\"Nací en circunstancias no habituales\". Y así comienza \"The Curious Case of Benjamin Button\", adaptado a partir de la   la historia de F. Scott Fitzgerald de 1920 sobre un hombre que cuenta su vida desde  sus 80 años para atrás. Un hombre, al igual que cualquiera de nosotros, que no ha podido detener el tiempo. Nosotros seguimos su historia, la vida más inusual que un hombre pudiera tener, que comienza en Nueva Orleans, desde el final de la Primera Guerra Mundial en 1918 en el siglo 21.',NULL,'2009-06-05 14:42:41','2009-06-05 14:42:41',2,NULL,'http://img.cinemaki.com/m/240/733.jpg','http://www.benjaminbutton.com/',165,2),
 (2561,'Titanic','','Durante las labores de recuperación de los restos del famoso trasatlántico Titanic, una anciana norteamericana se pone en contacto con la expedición para acudir a una plataforma flotante instalada en el Mar del Norte y asistir in situ a la recuperación de sus recuerdos. A través de su memoria reviviremos los acontecimientos que marcaron el siniestro más famoso del siglo XX: el hundimiento del trasatlántico más lujoso del mundo, la máquina más sofisticada de su tiempo, considerada “insumergible”, que sucumbió a las heladas aguas del Atlántico en abril de 1912, llevándose consigo la vida de 1.500 personas, más de la mitad de los pasajeros. \r\nLa película combina el trágico accidente con una historia de amor entre Jack (Di Caprio) un joven artista que gana su pasaje en un juego de cartas y Rose (Winslet) una joven de buena familia que está a bordo con su prometido.',NULL,'2009-06-05 14:42:42','2009-06-05 14:42:42',2,NULL,'http://img.cinemaki.com/m/240/2211.jpg',NULL,194,2),
 (2562,'Rocky IV','','Rocky Balboa, el popular campeón de boxeo de los pesos pesados, se enfrenta a un nuevo desafío: un ruso llamado Drago, una máquina de pelea, casi inhumano que ha sido creado en los laboratorios. El primer compromiso de Drago en América es con Apollo Creed, amigo de Rocky y antiguo rival.',NULL,'2009-06-05 14:42:42','2009-06-05 14:42:42',2,NULL,'http://img.cinemaki.com/m/240/2540.jpg',NULL,91,2),
 (2563,'El Extraño Mundo de Jack 3D','','El extraño mundo de Jack 3D es el re estreno de la obra producida por Tim Burton únicamente en las salas digitales del país.',NULL,'2009-06-05 14:42:42','2009-06-05 14:42:42',2,NULL,'http://img.cinemaki.com/m/240/429.jpg',NULL,76,2),
 (2564,'Viaje al Centro de la Tierra 3D','','Esta vez en 3D, relata la historia de un científico (Brendan Fraser) que emprende un viaje con su sobrino (Josh Hutcherson), y con una guía de montaña (Anita Briem). Luego de entrar a una cueva, ellos tres caen a un mundo subterráneo (el centro de la tierra) habitado por criaturas fascinantes (plantas carnívoras, hongos gigantes, dinosaurios).',NULL,'2009-06-05 14:42:42','2009-06-05 14:42:42',2,NULL,'http://img.cinemaki.com/m/240/235.jpg',NULL,92,2),
 (2565,'La Lista de Schindler','','A los principios de la Segunda Guerra Mundial, despues de la invasión Alemana a Polonia un empresario, Oskar Schindler, ideó un esquema para hacerse rico a costa de la población judía, a la cual se le prohibió la propiedad de cualquier medio de producción o riqueza. Mediante el esquema, los judíos le entregarían todos sus bienes como \"inversión\" a cambio de poder trabajar en su fábrica. Con el transcurrir del tiempo y después de presenciar la barbarie Nazi, Schindler emplea su fábrica como un escudo humanitario para evitar que mas de 1000 miembros de la comunidad de Polonia fueran enviados a los campos de exterminio y permitiendoles sobrevivir al Holocausto.',NULL,'2009-06-05 14:42:42','2009-06-05 14:42:42',2,NULL,'http://img.cinemaki.com/m/240/1720.jpg',NULL,195,2),
 (2566,'Mi Nombre es Sam','','Sean Penn interpreta a un padre soltero y disminuido psíquico al que asuntos sociales quiere quitarle la custodia de su hija porque le determina incapacitado para educarla.',NULL,'2009-06-05 14:42:42','2009-06-05 14:42:42',2,NULL,'http://img.cinemaki.com/m/240/2440.jpg',NULL,132,2),
 (2567,'Hitch: Especialista en Seducción','','Alex Hitchens es un legendario doctor de citas de la ciudad de Nueva York, que trabaja brindando sus servicios para lograr que incontables hombres conquisten a la mujer de sus sueños. Mientras entrena a Albert, un sumiso contador que está enamorado de Allegra Cole, una glamorosa celebridad, Hitch finalmente conoce a su media naranja, una columnista de la sección sociales que sigue cada movimiento de Allegra. Hitch, el profesional de la seducción, se ve completamente enamorado de Sara, una periodista cuya máxima aspiración podría ser desenmascarar al más famoso doctor amor de Manhattan.',NULL,'2009-06-05 14:42:42','2009-06-05 14:42:42',2,NULL,'http://img.cinemaki.com/m/240/2525.jpg',NULL,118,2),
 (2568,'Patch Adams','','Basada en una historia real, la película es la biografía del médico Patch Adams (Robin Williams), que revolucionó a la comunidad médica oficial aplicando singulares terapias consistentes en hacer reír y proporcionar afecto a los pacientes enfermos de cáncer.',NULL,'2009-06-05 14:42:42','2009-06-05 14:42:42',2,NULL,'http://img.cinemaki.com/m/240/2337.jpg',NULL,120,2),
 (2569,'El Transportador 2','','Frank se ha reubicado, del Mediterráneo Francés, a la ciudad de Miami en Florida; en donde por hacerle el favor a un amigo, ahora es el chofer de la familia Billings. Hay muy pocas cosas que puedan sorprender a “El Transportador”, pero el joven Jack Billings lo ha conseguido; de manera inesperada Frank ha creado lazos afectivos con Jack de seis años de edad a quien conduce a la escuela y a su hogar todos los días. Pero cuando Jack es raptado, Frank debe de utilizar sus habilidades de combate para liberar al muchacho y frustrar el plan de los secuestradores de soltar un virus que matará a cualquier persona que entre en contacto con él.',NULL,'2009-06-05 14:42:42','2009-06-05 14:42:42',2,NULL,'http://img.cinemaki.com/m/240/2111.jpg',NULL,87,2),
 (2570,'El Diario de Bridget Jones','','Bridget Jones es una treintañera soltera con pocas ambiciones: sólo quiere perder peso y encontrar el amor verdadero, pero parece una meta imposible. Bridget decide controlar un poco su vida y empieza un diario íntimo. \r\nPronto se encontrará dividida entre dos hombres. Por un lado, su jefe Daniel Cleaver, encantador y sexy pero peligroso, y un viejo amigo de la familia, Mark Darcy, que parece en un principio reservado y aburrido pero que acaba mostrando su verdadera personalidad.',NULL,'2009-06-05 14:42:42','2009-06-05 14:42:42',2,NULL,'http://img.cinemaki.com/m/240/2272.jpg',NULL,97,2),
 (2571,'Zoolander','','Derek Zoolander (Ben Stiller) es el modelo masculino más famoso del mundo, ganador durante tres años consecutivos del premio de \"Modelo del Año\". Derek está muy nervioso, pues este año tiene seria competencia por parte de Hansel (Owen Wilson), un rubio modelo, más joven que Derek, y con una actitud mucho más en línea con la de la juventud actual. Mientras que Derek ocupa su tiempo desarrollando la expresión facial que lo ha hecho famoso, Hansel lo invierte participando en deportes extremos y actividades de iluminación espiritual. Mientras tanto, un consorcio mundial de modas acostumbrado a utilizar mano de obra infantil en países tercermundistas se ve amenazado por las reformas laborales que el primer ministro de Malasia desea implementar. El consorcio no puede permitir esto, por lo que deciden eliminar al jefe de estado, tarea que le encargan a Mugatu, un mundialmente famoso diseñador de modas, quien desarrolla un plan para que Zoolander tenga un papel preponderante en el asesinato.',NULL,'2009-06-05 14:42:42','2009-06-05 14:42:42',2,NULL,'http://img.cinemaki.com/m/240/2277.jpg',NULL,89,2),
 (2572,'La Nueva Gran Estafa','','Después de repartir los 160 millones de dólares conseguidos, cada uno de los conocidos miembros del equipo de Ocean ha tratado de portarse bien, pasar desapercibido y llevar una vida legal pero eso ha resultado ser difícil, para disgusto de Tess (Julia Roberts), la esposa de Danny. Cuando alguien rompe la regla número uno y los delata, portarse bien deja de ser una opción. Quiere que le devuelvan sus 160 millones de dólares –con intereses– o de lo contrario... Y, como la banda descubre rápidamente, Benedict no es la única persona poderosa del mundo que busca a los Ocean’s eleven.',NULL,'2009-06-05 14:42:42','2009-06-05 14:42:42',2,NULL,'http://img.cinemaki.com/m/240/2242.jpg',NULL,125,2),
 (2573,'Viviendo con Mi Ex','','Gary y Brooke son una pareja que tras iniciar una discusión aparentemente insignificante se encuentran súbitamente, después de dos años de vivir juntos, frente al final de su relación. Pero como ninguno de los dos está dispuesto a mudarse del condominio que han compartido y al que han dedicado toda su atención, se desata una batalla psicológica entre ellos para hacer que la media naranja abandone el departamento. Sin embargo, las tácticas no rinden buenos resultados y lo único que logran es dirigir su relación directo al fracaso.',NULL,'2009-06-05 14:42:43','2009-06-05 14:42:43',2,NULL,'http://img.cinemaki.com/m/240/2712.jpg',NULL,105,2),
 (2574,'Rápido y Furioso','','Una misteriosa banda de delincuentes se dedica a robar camiones en plena marcha desde vehículos deportivos. La policía decide infiltrar un hombre en el mundo de las carreras ilegales para descubrir posibles sospechosos. El joven y apuesto Brian entra en el mundo de las carreras donde conoce a Dominic, rey indiscutible de este mundo y sospechoso número uno, pero todo se complicará cuando se enamora de la hermana de Dominic.',NULL,'2009-06-05 14:42:43','2009-06-05 14:42:43',2,NULL,'http://img.cinemaki.com/m/240/2518.jpg',NULL,106,2),
 (2575,'El Hombre Araña','','Peter Parker es un joven y tímido estudiante que vive con su tía May y su tío Ben desde la muerte de sus padres, siendo él muy pequeño. Peter está enamorado de su bella vecina, pero su falta de carisma no lo hace ser precisamente muy popular en el instituto. Un día es mordido por una araña que ha sido modificada genéticamente, descubriendo al día siguiente que posee poderes poco habituales: tiene la fuerza y agilidad de una araña.',NULL,'2009-06-05 14:42:43','2009-06-05 14:42:43',2,NULL,'http://img.cinemaki.com/m/240/2499.jpg',NULL,121,2),
 (2576,'Piratas del Caribe: el Cofre de la Muerte','','A pesar de que ya se ha levantado la maldición del Perla Negra, una amenaza aún más aterradora se cierne sobre su capitán y su tripulación: Jack tiene una deuda de sangre con el legendario Davy Jones (Bill Nighy), el Amo de las Profundidades del Océano, que capitanea el fantasmal Flying Dutchman, al que ningún otro barco puede igualar en velocidad. \r\nA menos que el astuto Jack encuentre la forma de saldar este pacto con el diablo, estará condenado por la eternidad a una vida más allá de la muerte al servicio de Jones. Este acontecimiento interrumpe los planes de boda de Will Turner y Elizabeth Swann que, una vez más, se ven arrastrados por las desventuras de Jack, y deberán enfrentarse a todo tipo de mounstros marinos.',NULL,'2009-06-05 14:42:43','2009-06-05 14:42:43',2,NULL,'http://img.cinemaki.com/m/240/2262.jpg',NULL,151,2),
 (2577,'Hombre en Llamas','','John Creasy es un agente del gobierno, desencantado con su vida en general. En México, acepta un trabajo para proteger a una niña cuyos padres han recibido amenazas de secuestro. Su relación con su pequeña protegida irá creciendo y despertará en él un espíritu perdido. Pero cuando ella es secuestrada, su rabia se desatará contra los responsables y no dejará de hacer nada por intentar salvarla.',NULL,'2009-06-05 14:42:43','2009-06-05 14:42:43',2,NULL,'http://img.cinemaki.com/m/240/2276.jpg',NULL,146,2),
 (2578,'Rocky II','','Rocky Balboa, el boxeador de Philadelphia, disfruta de su  fama después de estar a punto de derrotar al campeón mundial de los pesos pesados Apollo Creed. Las ofertas publicitarias para el anuncio de productos no van bien debido a la limitada educación y falta de sofisticación de Rocky. Por eso, y debido a la falta de dinero y al embarazo de su mujer Adrian, acepta la demanda de revancha del casi derrotado Creed.',NULL,'2009-06-05 14:42:43','2009-06-05 14:42:43',2,NULL,'http://img.cinemaki.com/m/240/2538.jpg',NULL,119,2),
 (2579,'El Clan de los Rompehuesos','','Un jugador de fútbol americano, Paul Crewe, y un campeón y entrenador del mismo deporte, Nate Scarboro, se encuentran cumpliendo condena en la misma prisión. Juntos deciden reunir un equipo para que juegue contra los guardias.',NULL,'2009-06-05 14:42:43','2009-06-05 14:42:43',2,NULL,'http://img.cinemaki.com/m/240/2504.jpg',NULL,113,2),
 (2580,'El Señor de los Anillos: El Regreso del Rey','','Las fuerzas de Saruman han sido destruidas, y su fortaleza sitiada. Ha llegado el momento de que se decida el destino de la Tierra Media, y por primera vez en mucho tiempo, parece que hay una pequeña esperanza. La atención del señor oscuro Sauron se centra ahora en Gondor, el último reducto de los hombres, y del cual Aragorn tendrá que reclamar el trono para ocupar su puesto de Rey. Pero las fuerzas de Sauron ya se preparan para lanzar el último y definitivo ataque contra el reino de Gondor, la batalla que decidirá el destino de todos. Mientras tanto, Frodo y Sam continuan su camino hacia Mordor, a la espera de que Sauron no repare en que dos pequeños Hobbits se acercan cada día más al final de su camino, el Monte del Destino.',NULL,'2009-06-05 14:42:43','2009-06-05 14:42:43',2,NULL,'http://img.cinemaki.com/m/240/1922.jpg',NULL,201,2),
 (2581,'Robots','','Rodney Copperbottom es un robot con habilidad para inventar cosas, que tiene la esperanza de mudarse de su pequeño pueblo y hacer del planeta un mejor lugar para vivir. Trabaja en un restaurant junto a su padre, quien es lavaplatos. Con su talento para inventar, Rodney se embarca en un viaje a Robot City para conocer a su ídolo, el majestuoso inventor Bigweld. Pero las cosas no resultan como Rodney espera y su búsqueda es más difícil de lo que imagina.',NULL,'2009-06-05 14:42:43','2009-06-05 14:42:43',2,NULL,'http://img.cinemaki.com/m/240/2750.jpg',NULL,91,2),
 (2582,'El Abogado del Diablo','','Kevin Lomax (Keanu Reeves) es un brillante y joven abogado que nunca ha perdido un caso. Convive felizmente con su atractiva y joven esposa, Mary Ann (Charlize Theron), y ambos viven una vida tranquila y feliz. Un día, Lomax recibe la visita de un abogado de Nueva York que le explica que su poderoso bufete tiene la intención de contratarlo. Al frente de la prestigiosa firma se encuentra John Milton (Al Pacino), un hombre de mundo, brillante y carismático, que encierra diabólicas intenciones para el protagonista.',NULL,'2009-06-05 14:42:43','2009-06-05 14:42:43',2,NULL,'http://img.cinemaki.com/m/240/2329.jpg',NULL,144,2),
 (2583,'¿Conoces a Joe Black?','','William Parrish (Anthony Hopkins), es un poderoso y meticulosos magnate cuya vida se ve alterada por la llegada de un enigmático joven llamado Joe Black (Brad Pitt) del que se enamora su hija. Se trata, en realidad, de la personificación de la muerte con una misión que cumplir en dicho hogar, pero su relación con la joven cambiará su destino.',NULL,'2009-06-05 14:42:43','2009-06-05 14:42:43',2,NULL,'http://img.cinemaki.com/m/240/2412.jpg',NULL,178,2),
 (2584,'El Joven Manos de Tijera','','En un castillo abandonado cercano a la ciudad, vive Edward, un joven creado por un científico ya muerto, y que tiene tijeras en vez de manos. Cuando una amable vendedora de Avon lo encuentra y decida llevárselo a vivir con su familia, comenzará para Edward una odisea donde conocerá el amor, la intolerancia, la soledad y el dolor de no ser aceptado.',NULL,'2009-06-05 14:42:43','2009-06-05 14:42:43',2,NULL,'http://img.cinemaki.com/m/240/2330.jpg',NULL,105,2),
 (2585,'Atrápame Si Puedes','','Basada en hechos reales, cuenta la historia de Frank W. Abagnale (Leonardo DiCaprio), un joven delincuente que se hace pasar continuamente por diversas identidades -médico, abogado o copiloto de líneas aéreas-. Carl Hanratty (Tom Hanks), un agente del FBI, tiene como única misión seguir su pista y capturarlo para llevarlo ante la justicia, pero Frank siempre va un paso adelante.',NULL,'2009-06-05 14:42:43','2009-06-05 14:42:43',2,NULL,'http://img.cinemaki.com/m/240/2568.jpg',NULL,141,2),
 (2586,'El Hombre Araña 3','','Peter Parker ha conseguido finalmente equilibrar la balanza entre su devoción a Mary Jane y sus deberes como superhéroe. Pero una tormenta se avecina en el horizonte. Cuando su traje se transforma de repente, convirtiéndose en negro y potenciando sus poderes, también transforma a Peter. Bajo la influencia del traje, aparecen el orgullo y el exceso de confianza de Peter y empieza a dejar de lado a los que más se preocupan por él. Aunque dos de los más temidos villanos, Hombre de Arena y Venom, consiguen un poder sin parangón y sed de castigo, la mayor batalla de Peter es contra si mismo. Spider-Man tendrá que volver a descubrir la compasión que lo convierte en lo que es: un héroe.',NULL,'2009-06-05 14:42:44','2009-06-05 14:42:44',2,NULL,'http://img.cinemaki.com/m/240/2501.jpg',NULL,139,2),
 (2587,'Miss Simpatía','','Gracie Hart, una agente del FBI no muy femenina que sin embargo es elegida para integrarse entre las participantes a Miss Estados Unidos con el fin de descubrir al criminal que amenaza con atentar durante el concurso. Pero para ello antes será necesario realizar muchos cambios tanto en el físico como en los modales de Gracie.',NULL,'2009-06-05 14:42:44','2009-06-05 14:42:44',2,NULL,'http://img.cinemaki.com/m/240/2815.jpg',NULL,109,2),
 (2588,'Troya','','En el año 1193 A.C., Paris (Orlando Bloom), príncipe de Troya, se enamora de Helena (Diane Kruger), Reina de Esparta, lo que da lugar al comienzo de la guerra de los griegos contra los troyanos. El ejército griego asedió a la ciudad de Troya durante más de diez años. Aquiles (Brad Pitt) era el gran héroe de los griegos, mientras Héctor (Eric Bana), el hijo mayor de Príamo (Peter O\'Toole), rey de Troya, representaba la esperanza del pueblo de la ciudad asediada.',NULL,'2009-06-05 14:42:44','2009-06-05 14:42:44',2,NULL,'http://img.cinemaki.com/m/240/2365.jpg',NULL,163,2),
 (2589,'Perfume de Mujer','','Remake de la película italiana de 1974 \"Perfume de mujer\" (Profumo di donna), narra la historia de la relación entre un oficial del ejército retirado, que sufre de ceguera, y un joven estudiante que le sirve de lazarillo en la gran ciudad de Nueva York.',NULL,'2009-06-05 14:42:44','2009-06-05 14:42:44',2,NULL,'http://img.cinemaki.com/m/240/2343.jpg',NULL,157,2),
 (2590,'La Familia de mi Novia','','El enfermero Gaylor Focker [Ben Stiller] está decido a proponerle matrimonio a su novia Pam [Teri Polo] durante un fin de semana en el que ambos se hospedarán en la casa de los padres de ella. Pero acá está el problema, primero necesita pedirle su mano a su futuro suegro.  Fanático de los gatos, ex-agente de la CIA, Jack Byrnes [Robert De Niro], inmediatamente desaprueba al bien intencionado pretendiente. La búsqueda de aceptación por parte de Gaylor se ve seriamente desviada cuando las leyes de Murphy se apoderan de toda la situación y una seguidilla de contratiempos lo convierten en el maestro del desastre.',NULL,'2009-06-05 14:42:44','2009-06-05 14:42:44',2,NULL,'http://img.cinemaki.com/m/240/2508.jpg',NULL,108,2),
 (2591,'Amores Perros','','Tres vidas chocan entre sí. Octavio, un joven adolescente, decide fugarse con Susana, la esposa de su hermano. El Cofí, su perro, se convierte en un medio para conseguir el dinero necesario para poder escapar juntos, complicando aún más un conmovedor triángulo pasional en donde el amor clandestino se convierte en un camino sin retorno. Al mismo tiempo, Daniel, un hombre de 42 años, deja a su esposa y a sus hijos para irse a vivir con Valeria, una hermosa modelo. El mismo día en que ambos festejan su nueva vida, el destino conduce a Valeria a ser embestida brutalmente en el trágico accidente.',NULL,'2009-06-05 14:42:44','2009-06-05 14:42:44',2,NULL,'http://img.cinemaki.com/m/240/2321.jpg',NULL,154,2),
 (2592,'La Mexicana','','Jerry Welbach acaba de recibir dos ultimátum: el primero de su jefe, un mafioso que le encarga viajar a México para recuperar una antigua y valiosa pistola llamada La Mexicana, y el segundo de su novia, Samantha, exigiéndole que ponga fin a su relación con la mafia. Jerry piensa que la alternativa más atractiva es la de permanecer vivo -aunque tenga problemas con Samantha- y decide dirigirse hacia el sur. Encontrar la pistola resulta fácil, pero traerla de vuelta es un asunto más complicado. Se supone que es portadora de una maldición legendaria, ya que fue encargada por un rico terrateniente como regalo de boda a una hija que finalmente murió en trágicas circunstancias. Una maldición que Jerry tiene motivos para creer, especialmente cuando un asesino a sueldo toma como rehén a Samantha para asegurarle la entrega de la pistola al capo mafioso.',NULL,'2009-06-05 14:42:44','2009-06-05 14:42:44',2,NULL,'http://img.cinemaki.com/m/240/2413.jpg',NULL,123,2),
 (2593,'Nueve Reinas','','En 24 horas Juan y Marcos, sus protagonistas, pasarán por la experiencia de sus vidas, por lo que Marcos insiste en llamar \"una en un millón\". Dos minúsculos estafadores que habitualmente trabajaban por unos pocos pesos, se conocerán fortuitamente una madrugada, e imprevistamente se verán envueltos en un negocio de centenares de miles. Un negocio urgente, inmediato, tanto que no les permitirá dudar: tienen que seguir adelante, hacer lo necesario. Y lo harán.',NULL,'2009-06-05 14:42:44','2009-06-05 14:42:44',2,NULL,'http://img.cinemaki.com/m/240/2231.jpg',NULL,115,2),
 (2594,'Hellboy','','Nacido de las llamas del infierno, y traído al mundo por medio de un ritual pagano, el temible héroe rojo Hellboy (Ron Pearlman) fue salvado por su amigo y mentor, el benevolente Doctor Broom. Criado en el Centro de Defensa e Investigaciones Paranormales del Doctor Broom, Hellboy se une a las huestes de “Mer-Man”. Juntos, estos héroes deberán aceptar sus fantásticos poderes que son tanto una bendición como una maldición. En el proceso descubrirán que sus habilidades servirán para beneficio de la humanidad, pero podrán también mantenerlos aislados para siempre de la sociedad a la que sólo ellos pueden proteger.',NULL,'2009-06-05 14:42:44','2009-06-05 14:42:44',2,NULL,'http://img.cinemaki.com/m/240/2704.jpg',NULL,122,2),
 (2595,'La Pantera Rosa 2','','El Inspector Jacques Clouseau forma un equipo de detectives internacionales tan torpes como él. Su misión: parar a un ladrón que viaja alrededor del mundo especializado en el robo de objetos históricos.',NULL,'2009-06-05 14:42:44','2009-06-05 14:42:44',2,NULL,'http://img.cinemaki.com/m/240/793.jpg','http://www.sonypictures.com/movies/thepinkpanther2',91,2),
 (2596,'Madagascar 2','','En Madagascar 2, la nueva aventura de DreamWorks, se mostrara como Gloria, Marty, Alex y Melman se escapan en un avión reparado por nuestros amigos los pingüinos para estrellarse en el medio de corazón de África.',NULL,'2009-06-05 14:42:44','2009-06-05 14:42:44',2,NULL,'http://img.cinemaki.com/m/240/722.jpg','http://www.madagascarmovie.com/',110,2),
 (2597,'El Efecto Mariposa','','Evan Treborn ha perdido la noción del tiempo. Su infancia ha sido marcada por una serie de acontecimientos aterradores que no es capaz de recordar. Lo único que permanece en su memoria, son las vidas destruidas de sus amigos de la niñez Lenny, Tommy y su novia Kayleigh.\r\nConducido por sus demonios personales, Evan descubre los viejos diarios que escribió durante el período más oscuro de su infancia. Leyéndolos, se da cuenta que tiene la habilidad de regresar en el tiempo y habitar su cuerpo de niño. Alterando los eventos del pasado, Evan intenta rescribir la historia y evitarle a sus seres queridos, en especial a Kayleigh, todas esas experiencias traumáticas. Esos cambios en el pasado provocan en el presente inesperadas y desastrosas consecuencias.',NULL,'2009-06-05 14:42:45','2009-06-05 14:42:45',2,NULL,'http://img.cinemaki.com/m/240/2472.jpg',NULL,113,2),
 (2598,'X-Men','','En un futuro cercano, la humanidad comienza a ver aparecer una nueva raza; los mutantes. Dotados de extraños y variados poderes, están agrupados en dos bandos: los que abogan por la integración y el entendimiento con la humanidad, encabezados por el doctor Charles Xavier, y los que buscan el enfrentamiento con una raza que consideran inferior y que les odia, dirigidos por Magnus, alias Magneto, un peligroso mutante con extraordinarios poderes.',NULL,'2009-06-05 14:42:45','2009-06-05 14:42:45',2,NULL,'http://img.cinemaki.com/m/240/2755.jpg',NULL,104,2),
 (2599,'Iron Man: El Hombre de Hierro','','Basada en el super héroe de Marvel, seguirá los pasos del billionario fabricante de armas, Tony Stark, quien crea un traje especial cuando lo secuestran unos terroristas para construir un misil. Luego trabajará en su perfeccionamiento, para luchar no solo contra los terroristas, si no también contra insospechados enemigos. Así nace Iron Man.',NULL,'2009-06-05 14:42:45','2009-06-05 14:42:45',2,NULL,'http://img.cinemaki.com/m/240/1284.jpg','http://www.homemdeferro.com.br/',126,2),
 (2600,'Ghost','','Una pareja de enamorados ve terminada su felicidad cuando él es asesinado por un ladrón. La necesidad de salvar la vida de su novia hace que él permanezca en la Tierra en forma de fantasma, e intente advertirle y protegerla del peligro que corre. Su único medio de comunicación es una alocada vidente.',NULL,'2009-06-05 14:42:45','2009-06-05 14:42:45',2,NULL,'http://img.cinemaki.com/m/240/2441.jpg',NULL,128,2),
 (2601,'La Gran Estafa','','A sólo 24 horas de haber quedado en libertad, Danny Ocean empieza a planear el robo más sofisticado que se haya realizado a un casino de Las Vegas. El ladrón recluta a once expertos en diferentes actividades y los adiestra bajo las tres reglas que gobiernan su vida: no hacer daño, no robar a quien no lo merece y seguir el plan hasta el final, como si no hubiera nada que perder.',NULL,'2009-06-05 14:42:45','2009-06-05 14:42:45',2,NULL,'http://img.cinemaki.com/m/240/2233.jpg',NULL,116,2),
 (2602,'El Hombre Araña 2','','Han pasado dos años desde que Peter Parker renunció a su amor de toda la vida, Mary Jane Watson, y decidió tomar el camino de la responsabilidad como el Hombre Araña.\r\nLa relación de Peter con su mejor amigo se ha opacado por el creciente deseo de venganza de Harry en contra del Hombre Araña, a quien culpa de la muerte de su padre. La vida de Peter se torna aún más complicada al hacerle frente al poderoso villano multi-tentáculos, Doctor Octopus. Peter deberá enfrentar nuevos retos y arreglárselas para manejar el don y la maldición de sus poderes, para aceptar su destino y detener a este diabólico lunático subido en ocho patas.',NULL,'2009-06-05 14:42:45','2009-06-05 14:42:45',2,NULL,'http://img.cinemaki.com/m/240/2500.jpg',NULL,127,2),
 (2603,'Hombres de Honor','','Basada en una historia real. \r\nCarl Brashear nació en Kentucky, en el seno de una familia de campesinos negros, cuyas vidas han estado fuertemente marcadas por el racismo. Mac, el padre de Carl, le enseña desde muy chico a valorar la perseverancia, y a vencer los obstáculos que los demás le impongan a sus sueños.',NULL,'2009-06-05 14:42:45','2009-06-05 14:42:45',2,NULL,'http://img.cinemaki.com/m/240/2727.jpg',NULL,129,2),
 (2604,'Harry Potter y el Príncipe Mestizo','','La película Harry Potter y el Misterio del Príncipe cuenta como con dieciséis años cumplidos, Harry inicia el sexto curso en Hogwarts en medio de terribles acontecimientos que acosan a Inglaterra. Elegido capitán del equipo de Quidditch, los entrenamientos, los exámenes y las chicas ocupan todo su tiempo, pero la tranquilidad dura poco.\r\nA pesar de los férreos controles de seguridad que protegen la escuela, dos alumnos son brutalmente atacados. Dumbledore sabe que se acerca el momento, anunciado por la Profecía, en que Harry y Voldemort se enfrentarán a muerte: «El único con poder para vencer al Señor Tenebroso se acerca... Uno de los dos debe morir a manos del otro, pues ninguno de los dos podrá vivir mientras siga el otro con vida.». El anciano director solicitará la ayuda de Harry y juntos emprenderán peligrosos viajes para intentar debilitar al enemigo, para lo cual el joven mago contará con la ayuda de un viejo libro de pociones perteneciente a un misterioso príncipe, alguien que se hace llamar Príncipe Mestizo.',NULL,'2009-06-05 14:42:45','2009-06-05 14:42:45',2,NULL,'http://img.cinemaki.com/m/240/671.jpg',NULL,125,2),
 (2605,'Sr. & Sra. Smith','','Jane Smith (Angelina Jolie) y John Smith (Brad Pitt) forman una pareja de vida acomodada dentro de un ordinario y monótono matrimonio suburbano. Además ambos ocultan algo por lo que su pareja mataría por saber: los dos son agentes secretos, asesinos increíblemente eficientes que trabajan para organizaciones que compiten entre sí. Un día el Sr. y la Sra. Smith descubren una nueva fuente de emoción en su matrimonio cuando se los contrata para asesinarse mutuamente, será entonces cuando comienza la verdadera diversión.',NULL,'2009-06-05 14:42:45','2009-06-05 14:42:45',2,NULL,'http://img.cinemaki.com/m/240/2514.jpg',NULL,120,2),
 (2606,'Rocky Balboa (VI)','','Hace treinta años era un hombre sin futuro, trabajando para un tiburón de poca monta en el lado sur de Filadelfia. Cuando la inesperada suerte le dio la posibilidad de saltar al ring para batirse con el campeón reinante Apollo Creed, era la oportunidad de su vida, una en un millón. Y todo lo que deseaba era superar el desafío. Su valor y su perseverancia, tanto en la vida como en el cuadrilátero dieron esperanza a millones. Ahora, la gloria ha pasado y Rocky Balboa, el que una vez fuera el Potro italiano, pasa sus tardes contando historias a los clientes de su restaurante, Adrians, llamado así en memoria de su mujer, por la quien silenciosamente sigue llorando. Su hijo, no quiere perder el tiempo con él; está demasiado ocupado en tratar de vivir su propia vida. La vida y los golpes han hecho humilde a Rocky, han deformado sus puños, han encorvado sus hombros y se han llevado todo lo que le quedaba, excepto sus viejas historias, pero en su corazón sigue siendo el mismo hombre.',NULL,'2009-06-05 14:42:45','2009-06-05 14:42:45',2,NULL,'http://img.cinemaki.com/m/240/2542.jpg',NULL,102,2),
 (2607,'Harry Potter y la Cámara Secreta','','Harry (DANIEL RADCLIFFE) no ha tenido un buen verano. No sólo ha tenido que aguantar a su autoritarios tía Petunia (FIONA SHAW) y tío Vernon Dursley (RICHARD GRIFFITHS) y el terror que tienen a sus poderes mágicos, sino que también parece que los mejores amigos de Harry, Ron Weasley (RUPERT GRINT) y Hermione Granger (EMMA WATSON), lo han olvidado, puesto que no han respondido a una sola de sus cartas. Entonces, repentina y misteriosamente, aparece Dobby, el elfo doméstico, en el dormitorio de Harry y le dice que correrá un gran peligro si el aprendiz de mago trata de volver a Hogwarts. Dobby está tan decidido a evitar que el joven Gryffindor vuelva al colegio de magos y hechiceros que ha impedido que toda la correspondencia de Ron y Hermione llegue a Harry. Pero, a pesar de los traviesos esfuerzos del elfo, el siempre decidido Harry es rescatado de las sombrías garras de los Dursley por Ron y sus hermanos, con la ayuda de un coche volador',NULL,'2009-06-05 14:42:45','2009-06-05 14:42:45',2,NULL,'http://img.cinemaki.com/m/240/2402.jpg',NULL,161,2),
 (2608,'La Era de Hielo','','La historia esta ubicada miles de años en el pasado, durante la más reciente de las glaciaciones que ha sufrido la Tierra, y en la que los animales que la habitan comienzan una larga jornada hacia el sur en busca de un lugar más cálido en el cual poder vivir. \r\nComo siempre sucede, las cosas no siempre salen bien para todos, por lo que un noble y gruñón mamut de nombre Manfred comienza a viajar hacia el norte buscando, quizás, un refugio en donde pasar sus últimos días. \r\nEn el camino se encuentra con un pequeño oso perezoso llamado Sid, quien a pesar de su limitada visión de las cosas y sus miedos, siempre mantiene un sentido del humor en todo lo alto. Sid tiene la intención de regresar a un bebé humano (Roshan) con su familia, por lo que decide adoptar al mamut como su protector.',NULL,'2009-06-05 14:42:46','2009-06-05 14:42:46',2,NULL,'http://img.cinemaki.com/m/240/2252.jpg',NULL,81,2),
 (2609,'Desperaux: Un Pequeño Gran Héroe','','Película de animación sobre tres héroes inusuales: un ratón que prefiere leer libros antes que comerlos, una rata poco feliz que planea dejar atrás la oscuridad del calabozo y una torpe sirvienta. Sus destinos se entrelazarán en una misión que cambiará sus pequeñas y hasta el momento insignificantes vidas.',NULL,'2009-06-05 14:42:46','2009-06-05 14:42:46',2,NULL,'http://img.cinemaki.com/m/240/735.jpg','http://www.thetaleofdespereauxmovie.com/',100,2),
 (2610,'Beverly Hills Chihuahua','','Película de animación que cuenta la historia de Chloe, un chihuahua que vive la gran vida en Beverly Hills y que, de vacaciones en México, se pierde y se encuentra con la necesidad de que la ayuden a volver a casa.',NULL,'2009-06-05 14:42:46','2009-06-05 14:42:46',2,NULL,'http://img.cinemaki.com/m/240/374.jpg',NULL,112,2),
 (2611,'Dos colgados muy fumados','','La película es la segunda en la saga de aventuras de Harold y Kumar, dos drogadictos que esta vez escapan de la ley, sospechados de ser terroristas tras intentar llevar droga de contrabando en un viaje a Amsterdam.',NULL,'2009-06-05 14:42:46','2009-06-05 14:42:46',2,NULL,'http://img.cinemaki.com/m/240/367.jpg',NULL,100,2),
 (2612,'El reino prohibido','','Un adolescente obsesionado con el cine de Hong Kong y los clásicos de Kung-fu, hace un extraordinario descubrimiento en una pequeña casa de empeños del barrio chino. Descubre por casualidad el legendario báculo de un sabio guerrero chino, más conocido como el Rey Mono. Gracias a la reliquia, el joven retrocede en el tiempo hasta la Antigua China donde se une a un grupo de guerreros expertos en artes marciales que intentarán liberar al Rey Mono.',NULL,'2009-06-05 14:42:46','2009-06-05 14:42:46',2,NULL,'http://img.cinemaki.com/m/240/297.jpg',NULL,103,2),
 (2613,'Hellboy 2','','Luego de romperse la antigua tregua entre la humanidad y el reino invisible de lo fantástico, el infierno está a punto de apoderarse de la tierra. Un líder inescrupuloso que tiene el mundo bajo el peso de sus pies, desafía a su propia sangre y despierta un ejército de criaturas imparables. Es entonces momento para que entre en acción el superhéroe más fuerte y duro del planeta, y le haga frente al despiadado dictador y a su ejército de secuaces. Es rojo, tiene cuernos, y es un incomprendido. Pero a la hora de cumplir con una misión, se puede contar con Hellboy.',NULL,'2009-06-05 14:42:46','2009-06-05 14:42:46',2,NULL,'http://img.cinemaki.com/m/240/373.jpg',NULL,120,2),
 (2614,'Misión Babilonia','','Un mercenario es contratado para escoltar a una mujer de Rusia a China, sin saber que ésta ha sido elegida por un culto que desea utilizarla para producir a un Mesías genéticamente modificado.',NULL,'2009-06-05 14:42:46','2009-06-05 14:42:46',2,NULL,'http://img.cinemaki.com/m/240/171.jpg',NULL,90,2),
 (2615,'Meteoro','','A toda velocidad en la pista, haciendo rugir los motores en todas las competencias, Meteoro tiene un talento innato para estar detrás del volante. Nacido dentro de una familia de pilotos de autos de carrera, Meteoro es agresivo, intuitivo, y sobre todo, temerario. Su única verdadera competencia es la memoria de su hermano al que idolatra -el legendario Corredor X-, cuya muerte en el circuito del automovilismo ha dejado un legado que Meteoro está destinado a reemplazar. Meteoro es leal a los negocios de familia con el automovilismo, liderado por su padre, Papa, el diseñador del estruendoso Mach 5 que conduce Meteoro. Cuando Meteoro rechaza una lucrativa y tentadora propuesta de Royalton Industries, no solo hace enfurecer al maníaco dueño de la compañía sino que además descubre un terrible secreto algunas de las carreras más importantes son arregladas por un puñado de magnates despiadados que manipulan a los pilotos más destacados para incrementar las ganancias. Si Meteoro no corre para Royalton, Royalton se encargará de que el Mach 5 nunca cruce la línea de llegada.',NULL,'2009-06-05 14:42:46','2009-06-05 14:42:46',2,NULL,'http://img.cinemaki.com/m/240/381.jpg',NULL,135,2),
 (2616,'Xuxa em Sonho de Menina','','Sin Sinopsis',NULL,'2009-06-05 14:42:46','2009-06-05 14:42:46',2,NULL,'http://img.cinemaki.com/m/240/300.jpg',NULL,87,2),
 (2617,'La Isla de Nim','','Una pequeña niña vive en una isla desierta junto con su padre científico, en esa isla la imaginación es lo único que controla todo lo que sucede. Cuando su padre desaparece, Nim tendrá que buscar ayuda en su personaje literario favorito y en la autora, que vive recluida en la gran ciudad, para reestablecer el orden. A través de esa aventura, la pequeña conocerá que su fuerza y su valentía son más grandes de lo que ella cree.',NULL,'2009-06-05 14:42:46','2009-06-05 14:42:46',2,NULL,'http://img.cinemaki.com/m/240/217.jpg',NULL,96,2),
 (2618,'Le Ballon Rouge','','Sin Sinopsis',NULL,'2009-06-05 14:42:46','2009-06-05 14:42:46',2,NULL,'http://img.cinemaki.com/m/240/307.jpg',NULL,34,2),
 (2619,'El Espíritu','','La película The Spirit es la historia de un ex policía novato quien regresa misteriosamente de la muerte transformado en The Spirit (Gabriel Macht) para luchar contra el crimen en las sombras de la Ciudad Central. Su archienemigo, el Octopus (Samuel L. Jackson) tiene una misión diferente; eliminar a la muy querida ciudad de The Spirit, mientras busca su propia versión de inmortalidad.',NULL,'2009-06-05 14:42:46','2009-06-05 14:42:46',2,NULL,'http://img.cinemaki.com/m/240/648.jpg','http://lionsgate.com/thespirit/',NULL,2),
 (2620,'My Sister\'s Keeper','','Adaptación de la novela de Jodi Picoult. \r\nUna nena de 13 años demanda a sus padres para conseguir su emancipación, ya que fue concebida para salvar a su hermana con cáncer.',NULL,'2009-06-05 14:42:46','2009-06-05 14:42:46',2,NULL,'http://img.cinemaki.com/m/240/2489.jpg',NULL,106,2),
 (2621,'La Caja','','Ambientado en 1971, el matrimonio de Norma y Arthur Lewis, vive felizmente en Virginia junto a Walter, su hijo de 9 años. Dana, una joven de 16 años, es la niñera de la familia y se ocupa de Walter cuando sus padres tienen algún compromiso. Pero Dana oculta un secreto; es hija de Arlington Steward, un tipo enemistado con los padres de Walter que quiere entrar en su casa para apoderarse de un objeto misterioso: una caja con un botón en el interior capaz de materializar los más tentadores deseos pero que también puede resultar aterradora por sus inesperadas consecuencias.',NULL,'2009-06-05 14:42:47','2009-06-05 14:42:47',2,NULL,'http://img.cinemaki.com/m/240/2699.jpg',NULL,115,2),
 (2622,'Locura de Amor en Las Vegas','','No sólo Jack y Joy se casaron después de una borrachera en Las Vegas, si no que también momentos después, se sacaron el premio mayor en un tragamonedas: la asombrosa cantidad de tres millones de dólares. Bueno, Jack se lo ganó con una moneda de Joy. En la máquina en la que ella ya había jugado. ¿O fue al revés? Y, como sea, ¿a quién le pertenece el dinero?',NULL,'2009-06-05 14:42:47','2009-06-05 14:42:47',2,NULL,'http://img.cinemaki.com/m/240/2980.jpg','http://www.jogodeamoremlasvegas.com.br/',105,2),
 (2623,'Está Dentro de Ti','','Una joven pareja y un convicto fugitivo, se encuentran atrapados en una estación de gasolina aislada por un parásito voraz que devora en un santiamén, transformando a sus víctimas en máquinas mortíferas. Los 3 deben encontrar una manera de trabajar juntos para sobrevivir a este horror.',NULL,'2009-06-05 14:42:47','2009-06-05 14:42:47',2,NULL,'http://img.cinemaki.com/m/240/2948.jpg',NULL,82,2),
 (2624,'La Mala Educación','','Dos niños, Ignacio y Enrique, conocen el amor, el cine y el miedo en un colegio religioso a principio de los años 60. El Padre Manolo, director del colegio y su profesor de literatura es testigo y parte de estos descubrimientos.\r\nAl cabo de los años, Ignacio va al encuentro de Enrique y le entrega un relato titulado \"La visita\" escrito por él inspirado en la infancia de ambos en el colegio.',NULL,'2009-06-05 14:42:47','2009-06-05 14:42:47',2,NULL,'http://img.cinemaki.com/m/240/2320.jpg',NULL,106,2),
 (2625,'Volver','','Narra la historia de tres generaciones de mujeres: una abuela (Carmen Maura), sus hijas (Penélope Cruz y Lola Dueñas) y la nieta (Yohana Cobo) que se reencuentran en una humilde casa de la localidad de Almagro. Tres generaciones de mujeres que sobreviven al viento, al fuego, e incluso a la muerte, a base de bondad, atrevimiento y una vitalidad sin límites.',NULL,'2009-06-05 14:42:47','2009-06-05 14:42:47',2,NULL,'http://img.cinemaki.com/m/240/2271.jpg',NULL,122,2),
 (2626,'Los Abrazos Rotos','','Un hombre escribe, vive y ama en la oscuridad. Catorce años antes sufrió un brutal accidente de coche, donde no sólo perdió la vista sino que también murió Lena, la mujer de su vida. Este hombre tiene dos nombres, Harry Caine, lúdico seudónimo bajo el que firma sus trabajos literarios, relatos y guiones, y Mateo Blanco, su nombre de pila, con el que vive y firma las películas que dirige. Después del accidente, Mateo Blanco se convierte en su seudónimo, Harry Caine. Si ya no puede dirigir películas, prefiere sobrevivir con la idea de que Mateo Blanco ha muerto con Lena, la mujer a la que amaba, en el accidente.',NULL,'2009-06-05 14:42:47','2009-06-05 14:42:47',2,NULL,'http://img.cinemaki.com/m/240/2470.jpg',NULL,125,2),
 (2627,'Amélie','','Amelie no es una chica como las demás. Ha visto a su pez de colores deslizarse hacia las alcantarillas municipales, a su madre morir en la plaza de Notre-Dame y a su padre dedicar todo su afecto a un gnomo de jardín. De repente, a sus veintidós años, descubre su objetivo en la vida: arreglar la vida de los demás. A partir de entonces, inventa toda clase de estrategias para intervenir, sin que se den cuenta, en la existencia de varias personas de su entorno. Entre ellas está su portera, que pasa los días bebiendo vino de Oporto; Georgette, una estanquera hipocondríaca, o \"el hombre de cristal\", un vecino que sólo ve el mundo a través de la reproducción de un cuadro de Renoir.',NULL,'2009-06-05 14:42:47','2009-06-05 14:42:47',2,NULL,'http://img.cinemaki.com/m/240/2327.jpg',NULL,122,2),
 (2628,'Sentencia de muerte','','En la pelicula Sentencia de muerte, Nick Hume (Kevin Bacon) es un apacible ejecutivo con una vida perfecta, hasta que una noche es testigo de una terrible experiencia que le cambia la vida para siempre. Ahora debe vengarse de la banda que ha asesinado brutalmente a su hijo.',NULL,'2009-06-05 14:42:47','2009-06-05 14:42:47',2,NULL,'http://img.cinemaki.com/m/240/961.jpg','http://www.deathsentencemovie.com/',106,2),
 (2629,'Billy Elliot','','Billy Elliot es un niño de 11 años, hijo de un minero, que vive en el norte de Inglaterra. Su vida cambiará para siempre al conocer a la Sra. Wilkinson, quien da clases de ballet en el gimnasio donde él intenta aprender a boxear. Pronto se encuentra inmerso en el mundo del ballet, para el que demuestra tener un talento innato gracias al cual podrá alcanzar sus sueños y cambiar las vidas de los que le rodean.',NULL,'2009-06-05 14:42:47','2009-06-05 14:42:47',2,NULL,'http://img.cinemaki.com/m/240/2443.jpg',NULL,110,2),
 (2630,'Sex and the City','','La trama girará en torno a las aventuras de las cuatro estrellas principales (Carrie, Samantha, Charlotte y Miranda) viviendo sus vidas en Manhattan cuatro años después del final de la serie. En particular, todo va a girar en torno al casamiento de Carrie, que hacia el final veremos si pasa por el el altar o decide seguir con su vida libertina.',NULL,'2009-06-05 14:42:47','2009-06-05 14:42:47',2,NULL,'http://img.cinemaki.com/m/240/394.jpg',NULL,145,2),
 (2631,'Closer, Llevados por el Deseo','','Es la historia de cuatro extraños (Julia Roberts, Jude Law, Natalie Portman y Clive Owen), sus encuentros casuales, sus atracciones instantáneas y sus ocasionales traiciones.',NULL,'2009-06-05 14:42:47','2009-06-05 14:42:47',2,NULL,'http://img.cinemaki.com/m/240/2600.jpg',NULL,104,2),
 (2632,'Tiempo Límite','','Matt es el jefe de la policía de la pequeña ciudad de Banyan Key. Es bueno en su trabajo, respetado por sus pares y amado en su comunidad. Pero cuando un brutal homicidio doble shockea a la ciudad, Matt comienza su investigación y su vida comienza a complicarse. Mientras empiezan a apilarse los detalles del caso, todas las evidencias apuntan hacia él como principal sospechoso. Con la investigación en marcha, Matt se encuentra en una carrera contra el tiempo, para resolver los asesinatos antes que otros descubran las pistas, que él mismo va encontrando y empiecen a sospechar de él.',NULL,'2009-06-05 14:42:47','2009-06-05 14:42:47',2,NULL,'http://img.cinemaki.com/m/240/2350.jpg','http://www.outoftimemovie.com',114,2),
 (2633,'La Mujer de mis Pesadillas','','Remake de \"La Tentación Vive Arriba\", en la que un recién casado descubre a lo largo de una semana que la mujer de su vida no es su esposa, si no su espectacular vecina.',NULL,'2009-06-05 14:42:48','2009-06-05 14:42:48',2,NULL,'http://img.cinemaki.com/m/240/2938.jpg',NULL,115,2),
 (2634,'La Muerte le Sienta Bien','','Helen y Madeline se odian mutuamente. Madeline está casada con Ernest, que está teniendo una aventura con Helen. Ambas mujeres depositan su confianza en Ernest, que es cirujano plástico, para mantener su joven aspecto. Así que cuando Madeline encuentra una cura para el envejecimiento, Helen también lo hace. Pero no es hasta que ambas se vuelven inmortales cuando se dan cuenta de que su vida ya no será la misma.',NULL,'2009-06-05 14:42:48','2009-06-05 14:42:48',2,NULL,'http://img.cinemaki.com/m/240/2967.jpg',NULL,104,2),
 (2635,'Seduciendo a un Extraño','','Siguiendo las pistas del asesinato sin resolver de uno de sus amigas de la infancia, la periodista Nowena Price, decide investigar por su cuenta, hasta dar con el culpable. En su búsqueda por internet, se contacta con uno de sus principales sospechosos, el multimillonario Harryson Hills. Con la ayuda de un hacker, Miles Haley, y aprovechando el anonimato de Internet, Nowena espera hacer justicia.',NULL,'2009-06-05 14:42:48','2009-06-05 14:42:48',2,NULL,'http://img.cinemaki.com/m/240/2924.jpg',NULL,109,2),
 (2636,'Perdidos en Tokio','','Charlotte es una joven recién casada y Bob un actor venido a menos que ahora participa en comerciales. Ambos se conocen en Japón y entablan rápido una amistad, mientras ella espera a que su esposo realice su trabajo como fotógrafo, él necesita de alguien que acompañe sus tardes frente a un vaso de licor.',NULL,'2009-06-05 14:42:48','2009-06-05 14:42:48',2,NULL,'http://img.cinemaki.com/m/240/2142.jpg',NULL,102,2),
 (2637,'La Leyenda del Tesoro Perdido: El Libro de los Sec','','Ben Gates emprende nuevamente una búsqueda global, estimulante y plena de acción para develar la Historia y los tesoros escondidos. Cuando sale a la luz una página perdida del diario de John Wilkes Booth, el tatarabuelo de Ben se ve de pronto implicado como uno de los conspiradores clave de la muerte de Abraham Lincoln. Decidido a demostrar la inocencia de su antepasado, Ben sigue una cadena internacional de pistas que lo llevan desde París hasta Londres y finalmente de vuelta a América. Este viaje conduce a Ben y a su equipo no solo hasta sorprendentes revelaciones… sino también hasta el rastro de uno de los secretos más atesorados del mundo.',NULL,'2009-06-05 14:43:18','2009-06-05 14:43:18',2,NULL,'http://img.cinemaki.com/m/240/3094.jpg',NULL,123,2),
 (2638,'Las Crónicas de Narnia: El León, La Bruja y El Arm','','La historia narra las aventuras de cuatro hermanos: Lucy, Edmund, Susan y Peter que, durante la Segunda Guerra Mundial, descubren el mundo de Narnia, al que acceden a través de un armario mágico mientras juegan a las escondidas en la casa de campo de un viejo profesor. En Narnia descubrirán un mundo increíble habitado por animales que hablan, duendes, faunos, centauros y gigantes.',NULL,'2009-06-05 14:43:22','2009-06-05 14:43:22',2,NULL,'http://img.cinemaki.com/m/240/2495.jpg',NULL,140,2),
 (2639,'Orgullo y Prejuicio','','Finales del siglo XVIII, Inglaterra. La señora Bennet se entera de una gran noticia: un joven rico y soltero acaba de mudarse a Netherfield Park, una mansión vecina. Madre de cinco hijas, su gran objetivo es que una de ellas se case con él. Las vidas de las hermanas serán alteradas, dando comienzo a una batalla entre el orgullo y los prejuicios de cada uno.',NULL,'2009-06-05 14:43:26','2009-06-05 14:43:26',2,NULL,'http://img.cinemaki.com/m/240/2857.jpg','http://www.orgulloyprejuicio.uip.es/',123,2),
 (2640,'El Descanso','','Después de una seguidilla de problemas amorosos, Amanda Woods (Diaz) e Iris Simpkins (Winslet) buscan desesperadas un cambio en sus vidas. Para concretarlo, ambas deciden emprender un viaje, en direcciones opuestas (Amanda va a Londres, Iris a Los Angeles). Una vez en destino, descubren que están en un lugar extraño, con su voz interior como única compañía.',NULL,'2009-06-05 14:43:26','2009-06-05 14:43:26',2,NULL,'http://img.cinemaki.com/m/240/2562.jpg',NULL,138,2),
 (2641,'Mi Gran Casamiento Griego','','Todos en la familia Portokalos están preocupados por Toula. Ella tiene 30 años, todavía no se ha casado y trabaja en el restaurante griego de sus padres. Lo único que su padre quiere es que se case con un bueno muchacho griego. Pero Toula busca otra cosa para su vida, deja su trabajo de camarera y comienza a trabajar en la agencia de viajes de su tía. Allí conoce a Ian, de quien se enamora profundamente, el único problema es que Ian no es griego.',NULL,'2009-06-05 14:43:26','2009-06-05 14:43:26',2,NULL,'http://img.cinemaki.com/m/240/2917.jpg',NULL,95,2);
INSERT INTO `events` (`id`,`title`,`description`,`text`,`thumbnail`,`created_at`,`updated_at`,`sponsor_id`,`price`,`image_url`,`web`,`duration`,`category_id`) VALUES 
 (2642,'Secreto en la Montaña','','Historia del amor homosexual entre dos jóvenes vaqueros; un ranchero de Wyoming y un cowboy de rodeos, en el verano de 1963. Ennis del Mar y Jack Twist se conocen mientras esperan en una cola a que el ranchero Joe Aguirre los contrate para trabajar. \r\nCuando son enviados a la majestuosa montaña Brokeback, entre ambos surge un sentimiento de compañerismo que termina en una relación íntima. Al concluir el verano, los dos tienen que abandonar Brokeback y seguir caminos diferentes. Ennis permanece en Wyoming y se casa con Alma (Michelle Williams), el amor de su vida, con quien tiene dos hijas. Entre tanto, Jack se marcha a Texas, donde se casa con Lureen Newsome (Anne Hathaway) y tiene un hijo.',NULL,'2009-06-05 14:43:26','2009-06-05 14:43:26',2,NULL,'http://img.cinemaki.com/m/240/2266.jpg',NULL,134,2),
 (2643,'Bajo el Sol de Toscana','','Frances Mayes, es una escritora americana de 35 años que vive en San Francisco y cuya perfecta vida acaba de dar un giro radical. Su reciente divorcio le ha causado un bloqueo a la hora de escribir y se encuentra profundamente deprimida. La receta de la Dra. Patty es muy sencilla: 10 días en la Toscana italiana. Una vez allí su vida empezará a cambiar.',NULL,'2009-06-05 14:43:26','2009-06-05 14:43:26',2,NULL,'http://img.cinemaki.com/m/240/2651.jpg',NULL,113,2),
 (2644,'21 Blackjack','','Basada en la historia real de un grupo de estudiantes superdotados, narra su aventura en Las Vegas, donde gracias a sus habilidades matemáticas y un profesor interesado se disponen a arrasar con los casinos y volverse millonarios de la noche a la mañana.',NULL,'2009-06-05 14:43:26','2009-06-05 14:43:26',2,NULL,'http://img.cinemaki.com/m/240/2665.jpg',NULL,123,2),
 (2645,'Monster','','Basada en la vida de Aileen Wuornos, una prostituta ejecutada en otoño del 2002 en Florida tras haber sido condenada por el asesinato de seis hombres. Aunque Wuornos confesó los seis asesinatos, incluido el de un policía, afirmó haber matado sólo en defensa propia, al resistirse a ser víctima de violentos ataques mientras trabajaba como prostituta.',NULL,'2009-06-05 14:43:26','2009-06-05 14:43:26',2,NULL,'http://img.cinemaki.com/m/240/2448.jpg',NULL,108,2),
 (2646,'La Caída','','Berlín, abril de 1945. Hitler (Bruno Ganz) y su círculo de confianza se han atrincherado en el búnker del Führer. Entre ellos se encuentra Traudl Junge (Alexandra Maria Lara), secretaria personal de Hitler. En el exterior, la situación se recrudece. A pesar de que Berlín ya no puede resistir más, el Führer se niega a abandonar la ciudad. Mientras el sangriento peso de la guerra cae sobre sus últimos defensores, Hitler prepara su despedida final.',NULL,'2009-06-05 14:43:26','2009-06-05 14:43:26',2,NULL,'http://img.cinemaki.com/m/240/2661.jpg',NULL,156,2),
 (2647,'Bourne: El Ultimatum','','El agente Jason Bourne, vuelve a la acción cuando dos periodistas que investigan a la desaparecida sección Treadstone de la CIA son eliminados, en misteriosas circunstancias, en un intento de borrar las últimas piezas de ese pasado que él aún intenta recuperar.',NULL,'2009-06-05 14:43:26','2009-06-05 14:43:26',2,NULL,'http://img.cinemaki.com/m/240/2258.jpg',NULL,115,2),
 (2648,'Gran Torino','','Clint Eastwood dirige y protagoniza esta película sobre un malhumorado y racista veterano de la Guerra de Corea que se dispone a reformar a su vecino, un adolescente asiático, luego de que éste intenta robarle su más preciada posesión: un auto Gran Torino.',NULL,'2009-06-05 14:43:26','2009-06-05 14:43:26',2,NULL,'http://img.cinemaki.com/m/240/790.jpg','http://www.thegrantorino.com/',NULL,2),
 (2649,'Agente Internacional','','Louis Salinger, agente de la Interpol, y Eleanor Whitman, Abogada Asistente del Distrito de Manhattan, desean depositar a los bancos más poderosos del mundo en manos de la justicia. Luego de arrojar luz sobre innumerables actividades ilegales, a cuál más reprensible, Salinger y Whitman siguen las huellas del dinero implicado, lo que los obliga a visitar Berlín, Milán, Nueva York y Estambul.\r\nInmersos en esta insegura persecución internacional, su incansable tenacidad ha puesto sus vidas en riesgo, ya que sus enemigos no tienen empacho en implementar los recursos más escabrosos ?incluyendo el asesinato? a fin de continuar financiando el terrorismo y la guerra.',NULL,'2009-06-05 14:43:26','2009-06-05 14:43:26',2,NULL,'http://img.cinemaki.com/m/240/1824.jpg','http://EverybodyPays.com',118,2),
 (2650,'Muerte en un Funeral','','Al morir su padre, Daniel debe organizar su funeral, pero nada saldrá según lo planeado, y las cosas se complicarán aún más con la llegada de un misterioso invitado que asegura que el muerto ocultaba un terrible secreto.',NULL,'2009-06-05 14:43:26','2009-06-05 14:43:26',2,NULL,'http://img.cinemaki.com/m/240/72.jpg','http://www.muerteenunfuneral.com.ar',90,2),
 (2651,'La Novena Puerta','','Dean Corso trabaja de forma confidencial, con sumo cuidado, dotado de una sólida cultura, nervios de acero y pocos escrúpulos. Su reputación le ha servido para ser llamado por Boris Balkan, apasionado por los textos demoníacos. Su misión será encontrar los dos últimos ejemplares del legendario manual de invocación satánica ”Las Nueve Puertas del Reino de las Sombras”. Corso dispone para ello de recursos ilimitados. De Nueva York a Toledo, de París a Sintra, se verá inmerso en un laberinto lleno de peligros y tentaciones, aterradoras sorpresas, violencia y muertes inesperadas.',NULL,'2009-06-05 14:43:27','2009-06-05 14:43:27',2,NULL,'http://img.cinemaki.com/m/240/2586.jpg',NULL,133,2),
 (2652,'Propuesta Indecente','','David (Harrelson), arquitecto, y Diana Murphy (Moore), agente inmobiliario, son un matrimonio felizmente casado que, por culpa de un traspié económico, están a punto de perder su casa. Un  apuesto multimillonario (Redford) ofrece a David un millón de dólares a cambio de pasar una noche con su mujer. Con dudas, ambos aceptan la propuesta.',NULL,'2009-06-05 14:43:27','2009-06-05 14:43:27',2,NULL,'http://img.cinemaki.com/m/240/2481.jpg',NULL,117,2),
 (2653,'La Tormenta Perfecta','','Basada en hechos reales. El Andrea Gail es un barco de pesca capitaneado por Billy Tyne, veterano pescador que ha tenido una serie de capturas decepcionantes. Tyne busca un golpe de suerte que haga cambiar esta mala racha, y se aventura a un lugar más allá de las zonas frecuentadas, el Flemish Cap. Lo que ignora es la gran tormenta que se avecina, la  más aterradora, más fuerte, violenta y destructiva de la historia moderna.',NULL,'2009-06-05 14:43:27','2009-06-05 14:43:27',2,NULL,'http://img.cinemaki.com/m/240/2762.jpg',NULL,130,2),
 (2654,'El Plan Perfecto','','Enfrentamiento de un duro policía y un inteligente ladrón durante un secuestro con rehenes en un banco de Manhattan. Según se desarrolla el peligroso juego, aparece una complicación; Madaline (Jodie Foster), una poderosa bróker con una agenda secreta que inyecta otra dosis de inestabilidad a la situación.',NULL,'2009-06-05 14:43:27','2009-06-05 14:43:27',2,NULL,'http://img.cinemaki.com/m/240/2353.jpg',NULL,129,2),
 (2655,'Inocencia Interrumpida','','Basada en una historia real. Susanna Kaysen, de 17 años, es como la mayoría de las chicas americanas de su edad: está confundida, insegura y luchando por entender un mundo que está cambiando rápidamente a su alrededor. A pesar de ello, el psiquiatra al que visita la interna en el Hospital Claymoore, diagnosticándole lo que llama Trastorno Borderline de la Personalidad. En el centro Susanna descubre a Lisa, Georgina, Polly y Janet, un grupo de chicas inadaptadas que no sólo se convierten en sus íntimas amigas, sino que le iluminan el camino para encontrar a alguien que había perdido: ella misma.',NULL,'2009-06-05 14:43:27','2009-06-05 14:43:27',2,NULL,'http://img.cinemaki.com/m/240/2803.jpg',NULL,127,2),
 (2656,'Casper','','La señora Crittenden contrata al doctor Harvey, para que exorcice la mansión de Whipstaff, en la que habitan cuatro fantasmas. Tres de ellos; Látigo, Tufo y Gordy no toleran a los mortales dentro de la casa y tienen un sentido del humor muy negro. Con ellos vive su sobrino Casper, joven, amistoso y harto de sus tíos. Crittenden quiere encontrar un tesoro escondido en el edificio. Algo que oculta al doctor Harvey, que se presenta en la mansión con su hija Kat, una joven adolescente. La hija de Harvey y Casper se empiezan a llevar estupendamente desde muy pronto. Ambos son adolescentes y tienen problemas para relacionarse. De Casper huye todo el mundo porque es un fantasma y de Kat, en cuanto se enteran de la profesión de su padre.',NULL,'2009-06-05 14:43:27','2009-06-05 14:43:27',2,NULL,'http://img.cinemaki.com/m/240/3104.jpg',NULL,100,2),
 (2657,'Vanilla Sky','','David tiene todo aquello que cualquiera desearía tener: plata, mujeres, poder. Maneja una Ferrari y se lleva el mundo por delante. Consigue todo lo que quiere y al fin cree haber encontrado una mujer a quien poder amar de verdad. Pero un trágico accidente cambiará su vida para siempre.',NULL,'2009-06-05 14:43:27','2009-06-05 14:43:27',2,NULL,'http://img.cinemaki.com/m/240/2971.jpg',NULL,136,2),
 (2658,'La Leyenda del Tesoro Perdido: El Libro de los Sec','','Ben Gates emprende nuevamente una búsqueda global, estimulante y plena de acción para develar la Historia y los tesoros escondidos. Cuando sale a la luz una página perdida del diario de John Wilkes Booth, el tatarabuelo de Ben se ve de pronto implicado como uno de los conspiradores clave de la muerte de Abraham Lincoln. Decidido a demostrar la inocencia de su antepasado, Ben sigue una cadena internacional de pistas que lo llevan desde París hasta Londres y finalmente de vuelta a América. Este viaje conduce a Ben y a su equipo no solo hasta sorprendentes revelaciones… sino también hasta el rastro de uno de los secretos más atesorados del mundo.',NULL,'2009-06-05 14:43:54','2009-06-05 14:43:54',2,NULL,'http://img.cinemaki.com/m/240/3094.jpg',NULL,123,2),
 (2659,'Las Crónicas de Narnia: El León, La Bruja y El Arm','','La historia narra las aventuras de cuatro hermanos: Lucy, Edmund, Susan y Peter que, durante la Segunda Guerra Mundial, descubren el mundo de Narnia, al que acceden a través de un armario mágico mientras juegan a las escondidas en la casa de campo de un viejo profesor. En Narnia descubrirán un mundo increíble habitado por animales que hablan, duendes, faunos, centauros y gigantes.',NULL,'2009-06-05 14:43:57','2009-06-05 14:43:57',2,NULL,'http://img.cinemaki.com/m/240/2495.jpg',NULL,140,2),
 (2660,'Identidad Desconocida','','Identidad Desconocida cuenta la historia de Jason Bourne, un joven que es encontrado por un barco pesquero en el medio del océano. Tiene dos balazos en la espalda, un número de cuenta de un banco suizo y sufre de amnesia. Allí comienza su camino para reencontrarse con quien realmente es.',NULL,'2009-06-05 14:44:01','2009-06-05 14:44:01',2,NULL,'http://img.cinemaki.com/m/240/1895.jpg','http://www.thebourneidentity.com/',119,2),
 (2661,'Alguien Tiene que Ceder','','Harry es un solterón que sólo sale con mujeres menores de treinta años. Durante lo que se suponía sería un fin de semana romántico con su novia más reciente, Marin, en la casa de playa de la madre de la misma, él comienza a sentir dolores en el pecho. La madre de Marin, Erica, acepta cuidarlo de mala gana mientras se recupera. Una vez que están solos, Harry y Erica se sienten atraídos, el uno por el oto. Una vez recuperado, Harry regresa a su casa volviendo a su vida normal. Sin embargo, cuando sus emociones hacia Erica resultan alterarle la vida,  se ve obligado a experimentar un verdadero cambio de actitud para recuperarla.',NULL,'2009-06-05 14:44:01','2009-06-05 14:44:01',2,NULL,'http://img.cinemaki.com/m/240/2918.jpg',NULL,126,2),
 (2662,'Inteligencia Artificial','','En un mundo futuro donde los avances científicos hacen posible la existencia, los humanos comparten todos los aspectos de sus vidas con sofisticados robots denominados Mecas. La emoción es la última y controvertida frontera en la evolución de las máquinas. Pero cuando un avanzado niño robótico llamado David es programado para amar, los humanos no están preparados para las consecuencias. David se encuentra solo en un extraño y peligroso mundo.',NULL,'2009-06-05 14:44:02','2009-06-05 14:44:02',2,NULL,'http://img.cinemaki.com/m/240/2958.jpg',NULL,146,2),
 (2663,'7, El Número Equivocado','','Slevin va a perder su departamento y a su novia en Los Ángeles, entonces decide irse a New York, para vivir con su amigo Nick Fisher e intentar cambiar su suerte. Cuando se instala en la casa de su amigo surge un inconveniente, al parecer Nick está seriamente involucrado con la mafia local. Un día llaman a la puerta unos mafiosos que intentan cobrarse un favor y lo confunden con su amigo Nick. Slevin debe arreglárselas para salir de una peligrosa confusión de identidades. La policía y la mafia lo buscan, su suerte parece haberlo abandonado. ¿Qué sucede cuando el destino pone tu vida en el tiempo, la hora y el número equivocado?',NULL,'2009-06-05 14:44:02','2009-06-05 14:44:02',2,NULL,'http://img.cinemaki.com/m/240/2722.jpg',NULL,109,2),
 (2664,'Quédate a mi Lado','','Isabel es una fotógrafa que se enamora de un hombre divorciado con dos hijos. Ganarse el amor de los niños le resultará difícil, ya que la madre, Jackie, no está dispuesta a facilitárselo.',NULL,'2009-06-05 14:44:02','2009-06-05 14:44:02',2,NULL,'http://img.cinemaki.com/m/240/2406.jpg',NULL,125,2),
 (2665,'Erin Brockovich','','Basada en una historia real. Cuenta la historia de Erin Brockovich, una madre soltera que, atravesando dificultades, consigue un puesto de trabajo en un pequeño despacho de abogados. Su personalidad poco convencional hará que sus comienzos no sean demasiado alentadores, pero todo cambiará cuando decide investigar el extraño caso de unos clientes que padecen de una sospechosa enfermedad.',NULL,'2009-06-05 14:44:02','2009-06-05 14:44:02',2,NULL,'http://img.cinemaki.com/m/240/2599.jpg',NULL,130,2),
 (2666,'Leyendas de Pasión','','Narra la historia de tres hermanos, de personalidades muy diferentes, que viven con su padre -un militar retirado, desencantado de la sociedad- en un apartado rancho de Montana. La Primera Guerra Mundial y una bella mujer cambiarán el destino de cada uno para siempre.',NULL,'2009-06-05 14:44:02','2009-06-05 14:44:02',2,NULL,'http://img.cinemaki.com/m/240/2411.jpg',NULL,134,2),
 (2667,'Mejor Imposible','','Melvin Udall, un escritor obsesivo y maniático, es uno de los seres más desagradables y desagradecidos que uno pueda tener como vecino. Pero, un buen día, tiene que hacerse cargo de un perro al que odia a muerte. La presencia en su vida del animal ablandará su corazón.',NULL,'2009-06-05 14:44:02','2009-06-05 14:44:02',2,NULL,'http://img.cinemaki.com/m/240/2593.jpg',NULL,139,2),
 (2668,'En Sus Zapatos','','Dos hermanas, Maggie y Rose Feller, no tienen nada en común salvo que calzan lo mismo. Maggie apenas se graduó de la preparatoria, suele cambiar rápidamente de trabajo y cree que su más grande virtud es su atractivo físico. Sin confianza en su habilidad intelectual, tiene un talento innato para elegir los accesorios perfectos para cualquier ocasión. Rose, graduada de la universidad de Princeton, trabaja para una importante firma de abogados en Filadelfia. Tiene constantes problemas de peso y su bajo autoestima con respecto a su aspecto físico, ha provocado que su vida en pareja sea nula. El único regocijo de Rose son los zapatos, pero tiene muy pocas oportunidades sociales para lucirlos. Después de una pelea, las dos hermanas emprenden un viaje hacia el descubrimiento de la abuela materna, quien pensaron había fallecido. Gracias a ese viaje, Maggie y Rose podrán hacer las paces consigo mismas y entre ellas.',NULL,'2009-06-05 14:44:02','2009-06-05 14:44:02',2,NULL,'http://img.cinemaki.com/m/240/2584.jpg',NULL,130,2),
 (2669,'El Señor de la Guerra','','Historia de un traficante de armas ruso, Yuri Orlov. A través de algunas de las zonas de guerra más peligrosas, Yuri lucha por escapar de un implacable agente de la Interpol, de sus rivales en el negocio y hasta de alguno de sus clientes, que incluyen a muchos de los más importantes dictadores.',NULL,'2009-06-05 14:44:02','2009-06-05 14:44:02',2,NULL,'http://img.cinemaki.com/m/240/2260.jpg',NULL,122,2),
 (2670,'Kill Bill: Vol. 2','','Tras eliminar a algunos de los miembros de la banda que intentó asesinarla el día de su boda, \"Mamba negra\" (Uma Thurman) continúa con su venganza e intenta acabar con el resto de la banda, en especial con su líder y antiguo jefe, Bill (David Carradine), que la dió por muerta dejándola en coma.',NULL,'2009-06-05 14:44:02','2009-06-05 14:44:02',2,NULL,'http://img.cinemaki.com/m/240/2245.jpg',NULL,136,2),
 (2671,'Apariencias','','Carmelo es un reprimido oficinista que, según definen sus padres, atraviesa \"problemas de relación\". El conflictuado joven está secretamente enamorado de Verónica, una compañera de trabajo con la que ha tenido apenas un par de amables cruces de palabras. Las casualidades y la timidez del protagonista hacen que ella lo confunda con un líder de la comunidad homosexual, y así Carmelo termina actuando de \"gay sensible\" y asistiendo a Verónica en una investigación de mercado, mientras ella se prepara para casarse con Federico, un yuppie tan arrogante como insulso.',NULL,'2009-06-05 14:44:02','2009-06-05 14:44:02',2,NULL,'http://img.cinemaki.com/m/240/3080.jpg',NULL,94,2),
 (2672,'Johnny & June: Pasión y Locura','','En 1955, Johnny Cash entró a los famosos Sun Studios en Memphis. Fue un momento de gran efecto sobre la cultura Americana, con interpretaciones de ásperas canciones de desamor y supervivencia que salían de su interior. Cash empezó un camino tortuoso de transformación personal, enfrentándose a sus propios demonios, luchando por su relación amorosa con June Carter Cash y aprendiendo a caminar sobre esa filosa vereda que existe entre la destrucción y la redención.',NULL,'2009-06-05 14:44:02','2009-06-05 14:44:02',2,NULL,'http://img.cinemaki.com/m/240/2997.jpg',NULL,136,2),
 (2673,'Marley y yo','','La película Marley y yo, dirigida por David Frenkel, cuenta la inolvidable y conmovedora historia de una familia en formación y su perro neurótico que les enseña lo que es realmente importante en la vida.',NULL,'2009-06-05 14:44:02','2009-06-05 14:44:02',2,NULL,'http://img.cinemaki.com/m/240/726.jpg','http://www.marleyandmemovie.com/',115,2),
