 (3069,'Dino Rey \n 							Serie animada','','Viviendo en el presente, Max, Rex y Zoe, se transportan a cualquier rincón del mundo en busca de las tarjetas de dinosaurios que perdió el Dr.Z durante sus viajes en el tiempo. De esta manera, dinosaurios verdaderos reaparecen en acción y se enfrentan en batallas espeluznantes y memorables.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
 (3070,'Dímelo tú. Nelson Castro \n 							Entrevista','','En un mismo hombre conviven el médico neurólogo, el destacado periodista y el músico aficionado. Pero también el escritor de libros muy singulares que ayudan a entender el entramado complejo del país. El autor de ´Enfermos de poder´ reflexiona sobre la ética periodística y la libertad de prensa, comenta en detalle el episodio que lo marginó de su clásico espacio en Radio del Plata, y desmenuza la actualidad política del país de cara a las próximas elecciones legislativas.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
