 (3074,'Horton y el mundo de los quién \n 							Comedia','','Horton, un bondadoso elefante, oye un llamado de auxilio de una pequeña mota de polvo. Al investigar de cerca descubre toda una raza de microscópicos Quienes que viven allí y se hace amigo de ellos, protegéndolos de los peligros posibles. Sus vecinos de la selva se preocupan de que pudiera haberse vuelto loco creyendo en cosas que no existen. Por eso conspiran para destruir la mota de polvo a fin de hacerle despertar de su falsa ilusión, pero él está decidido a salvar a la diminuta partícula.',NULL,'2009-06-16 17:34:17','2009-06-16 17:34:17',2,NULL,NULL,NULL,NULL,3),
