 (3100,'El engaño \n 							Drama','','Nick está atrapado en un trabajo sin futuro dentro de un pueblo sin futuro. Lo único bueno en su vida es Lissa, su nueva novia. La oportunidad de conseguir dinero fácil y salir de aquel pueblo sólo resulta en más problemas, ya que se ve envuelto en una red de sexo, deudas, gangsters, secuestros y asesinatos.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3101,'Crimen perfecto \n 							Drama','','Willy Beachum, un joven y ambicioso fiscal cuya carrera está empezando a despegar, y Thomas Crawford, un ingeniero de mediana edad que acaba de dispararle a su mujer a sangre fría, se encuentran cara a cara en un camino directo al desastre. Crawford resulta ser tan complejo e impredecible como el crimen que ha cometido y, mientras el caso perfecto de Beachum comienza a desmoronarse, el futuro del joven fiscal parece destruirse con él.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3102,'Fuego en sus labios \n 							Aventura','','Tony y Felix navegan en su pequeña embarcación, realizando extraños trabajos y bebiendo mucho ron. Contratados para llevar ilegalmente a una enigmática dama, exiliada y sin documentación, ambos se enamoran de la mujer, y tratan de traicionarse entre sí para conseguir su atención.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
 (3103,'Modigliani \n 							Drama','','Ambientada en el París de los años 20 se centra en la tempestuosa relación del famoso pintor Amadeo Modigliani con Jeanne, la separación de su hijo ilegítimo, su lucha contra los excesos y su ambigua rivalidad con Pablo Picasso.',NULL,'2009-06-16 17:34:18','2009-06-16 17:34:18',2,NULL,NULL,NULL,NULL,3),
