 (3258,'Wonder showzen \n 							Humorístico','','Una ácida sátira de los programas para chicos, pensado para adultos. Niños dando respuestas irreventes sobre los temas más variados, humor negro, alusiones a la realidad política y social de Estados Unidos se combinan para darle vida a uno de los shows más polémicos y explosivos de la pantalla de MTV, que recurre a muñecos sarcásticos para descolocar y tomar por sorpresa a confiados ciudadanos.',NULL,'2009-06-16 17:34:23','2009-06-16 17:34:23',2,NULL,NULL,NULL,NULL,3),
