 (3616,'Amarte es mi pecado (repetición) \n 							Telenove','','Nora es una bella joven llena de ilusiones, que ama en secreto a Alfredo, y huye de Pátzcuaro cuando tras la muerte de su padre Jacobo, su madrastra la vende al hombre más rico del pueblo en complicidad de su amor. En Morelia, Nora conoce a Arturo pero al sentirse traicionada nuevamente, decide convertirse en una mujer dura y vengarse de los hombres.',NULL,'2009-06-16 17:34:36','2009-06-16 17:34:36',2,NULL,NULL,NULL,NULL,3),
