 (3804,'Bendita. Temporada 4 (Repetición) \n 							Interés','','El programa intenta no sólo entretener sino hacer pensar y debatir al televidente, a través de informes, invitados especiales y los distintos puntos de vista del conductor y sus panelistas. La nueva sección se títula ´Bendita Perdona´, donde ciertos personajes son perdonados por sus malas acciones. Participan: Analia Franchin, Edith Hermida, Teto Medina, Adriana Gorosito e invitados.',NULL,'2009-06-16 17:49:22','2009-06-16 17:49:22',2,NULL,NULL,NULL,NULL,3),
 (3805,'GLOBAL 3000. The Globalization Program \n 							In','','',NULL,'2009-06-16 17:49:22','2009-06-16 17:49:22',2,NULL,NULL,NULL,NULL,3),
 (3806,'Fifi y los Floriguitos. Episodio No. 5 \n 							In','','Fifi es una niña curiosa y traviesa que vive en un colorido jardín. Junto con sus amigos, cuida de las flores y hace tortas de frutas entre otras actividades.',NULL,'2009-06-16 17:49:22','2009-06-16 17:49:22',2,NULL,NULL,NULL,NULL,3),
 (3807,'Disney. Los hechiceros de Waverly Place \n 							C','','Una típica familia compuesta por la madre, Theresa Russo, el padre, Jerry Russo, un hijo, Justin Russo, una hija, Alex Russo y otro hijo llamado Max Russo. Los chicos y su familia viven una vida normal, pero sus amigos no saben que ellos en realidad son hechiceros.',NULL,'2009-06-16 17:49:22','2009-06-16 17:49:22',2,NULL,NULL,NULL,NULL,3),
 (3808,'Keeping up With The Kardashians. Unmasked \n 						','','Muestra el lado más íntimo y los pormenores de la familia de Kim Kardashian. Kim es una de las socialité favorita es una conocida amiga de Paris Hilton e hija del ilustre abogado estadounidense y fallecido Robert Kardashian, reconocido por defender a OJ Simpson en el famoso caso de asesinato. Tras su divorcio, la madre de Kim, Kris, se casó con Bruce Jenner, reconocido medallista olímpico, con quien tuvo 2 hijos más.',NULL,'2009-06-16 17:49:22','2009-06-16 17:49:22',2,NULL,NULL,NULL,NULL,3),
 (3809,'Playboy´s Celebrity Centerfolds \n 							Condicion','','Este es el lanzamiento de las bellezas mas imponentes de Playboy. Descubre que tienen Marilyn Monroe, PAM Anderson, Carmen Elektra, Ana-Nicole Smith y otras bellezas calientes.',NULL,'2009-06-16 17:49:23','2009-06-16 17:49:23',2,NULL,NULL,NULL,NULL,3),
 (3810,'Se hará justicia. Los secretos de Patricia Allanso','','Casos de la vida real, crímenes que han conmovido al mundo entero. A pesar de lo evidente, cada una de esas historias tiene varias caras. Policías, investigadores, abogados y los mismos acusados, dan su versión de los hechos con testimonios realmente estremecedores.',NULL,'2009-06-16 17:49:23','2009-06-16 17:49:23',2,NULL,NULL,NULL,NULL,3),
 (3811,'Animal Planet al extremo. Viaje al fondo del mar \n','','A pesar de que el 70% de la superficie terrestre está cubierta de agua, conocemos más sobre la luna que sobre el océno. Vea cuáles son los animales que pueden permanecer durante más tiempo debajo del agua. Entre tanto, averiguaremos por qué se arrugan nuestros dedos al bañarnos y conoceremos sirenas reales.',NULL,'2009-06-16 17:49:24','2009-06-16 17:49:24',2,NULL,NULL,NULL,NULL,3),
 (3812,'Archivos privados (Repetición) \n 							Espectácul','','El conductor visita a los personajes del espectáculo y el deporte, quienes le mostrarán su valioso archivo privado.',NULL,'2009-06-16 17:49:24','2009-06-16 17:49:24',2,NULL,NULL,NULL,NULL,3),
 (3813,'La verdad incómoda: Una advertencia global \n 					','','Se centra en la campaña ecológica llevada a cabo durante los últimos años por Al Gore para concienciar a la población del peligro del calentamiento global y la contaminación atmosférica. La historia de la apasionada entrega de un hombre decidido a exponer los mitos e ideas equivocadas acerca del calentamiento global y su prevención para ayudar a salvar el planeta.',NULL,'2009-06-16 17:49:24','2009-06-16 17:49:24',2,NULL,NULL,NULL,NULL,3),
