 (3821,'Nip/Tuck. Season 3. Episodio 2. Kiki \n 							Dram','','Ambientado en el sensual mundo de South Beach, Miami. Este porgrama se adentra en el mundo superficial de la cirugía plástica. En cada episodio, revela las complejidades y la frágil naturaleza de los pacientes que tratan de enmascarar sus problemas psicológicos cambiando de apariencia.',NULL,'2009-06-16 17:49:25','2009-06-16 17:49:25',2,NULL,NULL,NULL,NULL,3),
 (3822,'Stargate Atlantis. Temporada 2. Episodio 2. The In','','El Dr. Weir reune a un equipo de científicos y militares para explorar el espacio intergaláctico. El grupo comando Stargate llega a la galaxia Pegaso, y allí descubre una inquietante red que los enfrenta al poderoso y temible Wraith.',NULL,'2009-06-16 17:49:25','2009-06-16 17:49:25',2,NULL,NULL,NULL,NULL,3),
 (3823,'Las tortugas ninja. De regreso a la alcantarilla \n','','Luego de ser empujados en el tiempo, la Ventana del Tiempo funciona y ellos logran volver a la alcantarilla, su hogar en la Nueva York actual. Sin embargo, el villano digital Viral ha interferido su viaje y cuando las Tortugas regresan a su hogar, se entristecen al descubrir que el Maestro Splinter no ha podido regresar con ellas. Las Tortugas deben salvar a Splinter, que ha sido convertido en un código digital para ser desparramado en el ciberespacio.',NULL,'2009-06-16 17:49:25','2009-06-16 17:49:25',2,NULL,NULL,NULL,NULL,3),
