 (3826,'Cambia la casa. Episodio No. 12. Entre obstáculos ','','Un agente de bienes raíces busca las casas más destruidas, las compra, las arregla por completo, las revaloriza y las convierte en propiedades extremadamente atractivas para luego venderlas y ganar muchísimo dinero. Pero, por supuesto, no lo hace solo: tiene un equipo entrenado que conoce todos los tips y trucos y que viene dispuesto a dar los mejores consejos para remodelar el hogar.',NULL,'2009-06-16 17:49:25','2009-06-16 17:49:25',2,NULL,NULL,NULL,NULL,3),
 (3827,'Leñadores. Temporada 1. Episodio 5. Un trabajo pel','','Los leñadores realizan el trabajo más difícil de Norteamérica, sin embargo esto no les asegura un trabajo estable. Debido a problemas económicos la compañía se ve en la necesidad de recortar presupuesto. Maquinaria vieja, empleados despedidos, entre otras cosas agobian a los leñadores igual que los peligros de su trabajo.',NULL,'2009-06-16 17:49:25','2009-06-16 17:49:25',2,NULL,NULL,NULL,NULL,3),
