 (3834,'Las nuevas locuras del emperador de Disney \n 					','','Kuzco es egocéntrico y malcriado y vive bajo el lema ´soy el centro del mundo´. Tal es así que cuando festeja su cumpleaños que hipotéticamente marca el momento en que debe convertirse en emperador, se lleva una gran sorpresa: para asumir el trono de su Imperio, primero debe graduarse del colegio, hasta que eso suceda Kuzco es un muchacho más. Pero adaptarse a la vida en el pueblo no va a ser tarea fácil y rendir las materias de la escuela tampoco.',NULL,'2009-06-16 17:49:28','2009-06-16 17:49:28',2,NULL,NULL,NULL,NULL,3),
