 (3858,'La casa de Operación Triunfo 2009 (Vivo) \n 							','','Durante casi cuatro meses, 22 participantes se preparan y se esfuerzan para ser elegidos, mediante el voto del público, y consagrarse como verdaderas estrellas de la música. El jurado compuesto por Martín Alfiz, Juan Alberto Badía, Daisy May Queen y Facundo Saravia decidirá cuáles de los participantes están en condiciones de continuar en la academia y quiénes deben someterse al voto del público para abandonarla.',NULL,'2009-06-16 17:58:55','2009-06-16 17:58:55',2,NULL,NULL,NULL,NULL,3),
