 (3997,'Los criminales más tontos de América \n 							Docu','','Cámaras de seguridad y de la policía dejan en evidencia los hechos más ridículos y desopilantes en diferentes escenas del crimen. Empleados que se resisten a ser robados hasta arriesgar sus propias vidas, sospechosos que golpean a la policía agravando su situación, pirómanos que se prenden fuego a si mismos, etc. Una galería de situaciones en las que criminales, policías y ciudadanos protagonizan las situaciones más vergonzantes.',NULL,'2009-06-16 18:03:25','2009-06-16 18:03:25',2,NULL,NULL,NULL,NULL,3),
 (3998,'El asesinato de Jesse James por el cobarde Robert ','','Explora la vida privada y las hazañas públicas del bandido más notorio de América. Mientras el carismático e impredecible Jesse James planea su próximo gran robo, declara la guerra a sus enemigos, quienes intentan hacerse con la recompensa, y la gloria, que implicaría su captura. Pero la amenaza más importante a su vida puede que venga de aquellos en quienes más confia.',NULL,'2009-06-16 18:03:26','2009-06-16 18:03:26',2,NULL,NULL,NULL,NULL,3),
