 (4041,'Las tortugas ninja. De regreso a la alcantarilla \n','','Luego de ser empujados en el tiempo, la Ventana del Tiempo funciona y ellos logran volver a la alcantarilla, su hogar en la Nueva York actual. Sin embargo, el villano digital Viral ha interferido su viaje y cuando las Tortugas regresan a su hogar, se entristecen al descubrir que el Maestro Splinter no ha podido regresar con ellas. Las Tortugas deben salvar a Splinter, que ha sido convertido en un código digital para ser desparramado en el ciberespacio.',NULL,'2009-06-16 18:03:33','2009-06-16 18:03:33',2,NULL,NULL,NULL,NULL,3),
